INSERT INTO `hongniang` VALUES ('45', '1992', 'Loveid:10655722', 'http://www.hongniang.com/data/upload/photo/20171013/59e01ceca4d12_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01ceca4d12ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01ceca4d12ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01ceca4d12ff3_mid.jpg', '25岁', '159CM', '未婚', '保密', '大专', '浙江杭州', '我是一个善良,大大咧咧,可爱的人  。比较笨容易相信别人我只是想找杭州本地或定居在杭州的，谢谢', '女');
INSERT INTO `hongniang` VALUES ('46', '糖糖', 'Loveid:10655713', 'http://www.hongniang.com/data/upload/photo/20171013/59e01ce975247_mid.jpg', '28岁', '156CM', '未婚', '保密', '大学本科', '浙江杭州', '非诚勿扰。', '女');
INSERT INTO `hongniang` VALUES ('47', '欣', 'Loveid:10655738', 'http://www.hongniang.com/data/upload/photo/20171013/59e01cf36ff8b_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01cf36ff8bff1_mid.jpg', '42岁', '162CM', '未婚', '保密', '高中及以下', '浙江杭州', '一个人走得久了，会累，有个人，陪你在冬日的午后晒太阳，为你递上一杯热气腾腾的绿茶，和心爱的人慢慢变老，还有什么比这更幸福呢？经历了风雨总会见彩虹，我未婚，希望能在这里找到一个温暖的有爱心会关心我的人，一起开心快乐的生活，谢谢', '女');
INSERT INTO `hongniang` VALUES ('48', '多多', 'Loveid:10655715', 'http://www.hongniang.com/data/upload/photo/20171013/59e01ceb32096_mid.jpg', '29岁', '160CM', '未婚', '保密', '大专', '浙江杭州', '这个世界上，总有一个人在等你，总有一个人会给你安心的幸福，总有一个人会陪你到老，这个人，要珍惜，要感恩。你是我要找的幸福吗？', '女');
INSERT INTO `hongniang` VALUES ('49', '人生如茶', 'Loveid:10655741', 'http://www.hongniang.com/data/upload/photo/20171013/59e01cf47be1e_mid.jpg', '26岁', '164CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个温柔,乐观的人 ，爱好广泛的我，喜欢旅行,摄影,美食。', '女');
INSERT INTO `hongniang` VALUES ('50', 'GSUN', 'Loveid:10655719', 'http://www.hongniang.com/data/upload/photo/20171013/59e01cec07be1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01cec07be1ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01cec07be1ff2_mid.jpg', '29岁', '155CM', '未婚', '保密', '大专', '浙江杭州', '我深深相信，会有那么一个人用尽全力爱上我的全部。我的哭，我的笑，我的任性，我的温柔，我的依赖，我的自私，我的天真，我的粗心，我的疯狂，我的安静，还有我同样用尽全力爱上你的全部的那颗心。', '女');
INSERT INTO `hongniang` VALUES ('51', '犯犯', 'Loveid:10655746', 'http://www.hongniang.com/data/upload/photo/20171013/59e01cf699748_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01cf699748ff1_mid.jpg', '28岁', '168CM', '未婚', '保密', '大学本科', '浙江杭州', '不急着求带走，只求志同道合！！！不求急爱，只求懂我，了解我！只爱注重细节的你，有担当绅士男！懂生活，会享受生活的男人！', '女');
INSERT INTO `hongniang` VALUES ('52', 'chenfeng', 'Loveid:10655723', 'http://www.hongniang.com/data/upload/photo/20171013/59e01ceceaea1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01ceceaea1ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01ceceaea1ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01ceceaea1ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01ceceaea1ff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01ceceaea1ff5_mid.jpg', '43岁', '160CM', '未婚', '保密', '大专', '浙江杭州', '百年修得同船渡,前年修得共枕眠,相信缘分,', '女');
INSERT INTO `hongniang` VALUES ('53', '文子', 'Loveid:10655724', 'http://marry.hongniang.com/data/upload/photo/20171013/59e01cee5aef2_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171013/59e01cee5aef2ff1_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171013/59e01cee5aef2ff2_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171013/59e01cee5aef2ff3_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171013/59e01cee5aef2ff4_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171013/59e01cee5aef2ff5_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171013/59e01cee5aef2ff6_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171013/59e01cee5aef2ff7_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171013/59e01cee5aef2ff8_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171013/59e01cee5aef2ff9_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171013/59e01cee5aef2ff10_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171013/59e01cee5aef2ff11_mid.jpg', '24岁', '156CM', '未婚', '保密', '高中及以下', '浙江杭州', '喜欢阳光，干净，幽默，上进，孝顺，成熟的男孩子', '女');
INSERT INTO `hongniang` VALUES ('54', '哦啦啦', 'Loveid:10655725', 'http://www.hongniang.com/data/upload/photo/20171013/59e01ceed1534_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01ceed1534ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01ceed1534ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01ceed1534ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01ceed1534ff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01ceed1534ff5_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01ceed1534ff6_mid.jpg', '33岁', '168CM', '未婚', '保密', '大学本科', '浙江杭州', '备注：我还是想定居在杭州或者哪里，如果理想一致，你在哪我就会落脚在哪！\n　　我这个女人：\n　　我吧，84年2月的，山东妹纸，独子，168mm，神经有时候很大条，很傻很天真，有时候22的，但不要以为我就白痴了，什么时候该做什么不该做什么还是知道滴。\n　　身在游戏界的一名小混混，毕业之后一直在网游公司，总感嚼在这个小圈子的人都比较显年轻，心态也比较晚熟吧。反正我是这样滴-  -\n　　有点小胖，美女看多了的人可能接受不了我这微胖界滴人儿啊~~伤不起，伤不起……\n　　平时在家的时候喜欢看片，什么片子都看，时不时恐怖片、悬疑片等等的一段时间要看一下下滴，无聊的文艺片一个人静静看，看到的东西懂得人会懂的。是个重口味的小清新……\n　　有时间也会各处去玩，没见过的都想去看看，每次回来总会有很多收获，包括没有意识到的东西。我恐高、、、、我真的恐高、、、\n　　我要的那个男人：\n　　你在哪呢？2货~转悠30年了，还没遇到我！！\n　　眼睛比我大，个字比我高（为了后代优良基因考虑滴），年龄比我大，比我成熟。如果这些你没有，没有特别的缘分的话就不用看下面的了……\n　　希望他在我犯傻犯错之前制止我，包容我，小事让我做主，大事听你的。\n　　偶尔能收拾下自己的皮囊，忧郁大叔或者阳光骚年比较容易打动我。\n　　你可以木有钱，但要会赚钱，我不在乎钱，但不要因为没有钱交水电费吵那种无聊的架。最好有点小情调~不需要有多浪漫，偶尔能给点小温暖，小恩小惠的，才是感情持久的主要元素，没办法，我就吃这套。\n　　可以每年至少有一段时间出去走走，天天朝九晚五的生活早晚会失去美感的，你是懂我的对不。\n　　对我好，对我爸妈好，很重要。\n　　对于双方的父母：\n　　我爱我的爸妈，你应该也是，希望能够两家在一个城市，或者离我们不远，时常走动走动，吃吃饭喝喝茶下下棋唱唱歌，老人才不会寂寞。\n　　连这个都做不到的人，绕道吧~\n　　另外我有话要说：\n　　我不会让你负担整个家，我也会有自己的小梦想，so，我们一块努力吧~\n　　有眼缘的我会发信，如果你觉得不合适，请直接拒绝不要留一丝情面，不喜欢在感情上还拐弯抹角，找对象谁都不欠谁，对吧~\n　　我在等你，希望早点遇到你。（离异的人儿啊~分开的原因如果我能接受，我就接受，但是老爸老妈那关还需要你的努力，如果不行，那就只能祝你幸福了~）', '女');
INSERT INTO `hongniang` VALUES ('55', '安宁的女孩', 'Loveid:10655729', 'http://hongniang.com/data/upload/photo/20171013/59e01cf01d90c_mid.jpg,http://hongniang.com/data/upload/photo/20171013/59e01cf01d90cff1_mid.jpg,http://hongniang.com/data/upload/photo/20171013/59e01cf01d90cff2_mid.jpg,http://hongniang.com/data/upload/photo/20171013/59e01cf01d90cff3_mid.jpg,http://hongniang.com/data/upload/photo/20171013/59e01cf01d90cff4_mid.jpg,http://hongniang.com/data/upload/photo/20171013/59e01cf01d90cff5_mid.jpg,http://hongniang.com/data/upload/photo/20171013/59e01cf01d90cff6_mid.jpg', '26岁', '160CM', '未婚', '保密', '大专', '浙江杭州', '我是一个喜欢读书、看电视的女生。在业余时间最大的消遣就是与小姐妹一起睡觉、看电视、吃吃水果打闹！时时想着帮自己充充电。而我憧憬的生活：有一个温馨美满的家庭---家中有个疼爱自己的老公，彼此一起共同努力，互相的体谅、支持、信任！并有一份自己喜欢的工作。同时我希望我未来的另一半要有责任心顾家。有事业心。真心希望在这里能遇到我的那个TA!\n　　两个人的家，温馨，窝心快乐\n　　PS我是真诚交友，请那些凑热闹的就不要来打扰了！', '女');
INSERT INTO `hongniang` VALUES ('56', '囧儿', 'Loveid:10655735', 'http://uqy.hongniang.com/data/upload/photo/20171013/59e01cf2b6b38_mid.jpg,http://uqy.hongniang.com/data/upload/photo/20171013/59e01cf2b6b38ff1_mid.jpg,http://uqy.hongniang.com/data/upload/photo/20171013/59e01cf2b6b38ff2_mid.jpg,http://uqy.hongniang.com/data/upload/photo/20171013/59e01cf2b6b38ff3_mid.jpg', '28岁', '164CM', '未婚', '保密', '大学本科', '浙江杭州', '爱音乐——爱生活——爱家人——爱游戏——爱一切美好事物br /br / 本人没有邮票，有些信息看不到br /br / 希望对方不要过胖或过瘦，身高高一点最好，对感情忠诚度高，我对经济方面没什么要求，有个工作就行。强调一点 我不喜欢可爱型的男生！本人较内向，希望大家都真诚点。', '女');
INSERT INTO `hongniang` VALUES ('57', '123456nini', 'Loveid:10655736', 'http://marry.hongniang.com/data/upload/photo/20171013/59e01cf30a243_mid.jpg', '34岁', '163CM', '未婚', '保密', '大专', '浙江杭州', '好女人是男人宠出来的，你真心对我好，能给我足够的安全感和踏实感，那就结婚吧。', '女');
