INSERT INTO `hongniang` VALUES ('59', '红蝴蝶', 'Loveid:10655682', 'http://www.hongniang.com/data/upload/photo/20171013/59e01cd98e9ec_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01cd98e9ecff1_mid.jpg', '29岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '少年的时候，我疯狂的喜欢，带我走这三个字。现在，我再也不会任性的让任何人带我走。我学会了，自己走。', '女');
INSERT INTO `hongniang` VALUES ('60', 'uu', 'Loveid:10655742', 'http://marry.hongniang.com/data/upload/photo/20171013/59e01cf489670_mid.jpg', '28岁', '158CM', '未婚', '保密', '大学本科', '浙江杭州', '只想和你过一种简单的生活，\n　　相濡以沫，白头到老...……不知不觉今年又要过完了，在外地工作的我圈子比较小，希望在这里能够遇到有缘的那个人！简单做下介绍：有一份平凡稳定的工作，养活自己没问题....性格内外兼，属于比较顾家型的吧.至于长相，还是带的出去的。年纪也不小了，想找一位踏实上进有责任心的男士。\n　　未来的那一位，你在哪呢？\n　　带着一颗诚心来到这里，\n　　希望能找到自己的有缘人！\n　　我憧憬的生活是平淡但不乏精彩。\n　　（我没有邮票哦，如果有诚意的请贴票票哦）', '女');
INSERT INTO `hongniang` VALUES ('61', '雁子', 'Loveid:10655743', 'http://www.hongniang.com/data/upload/photo/20171013/59e01cf49b524_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01cf49b524ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01cf49b524ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01cf49b524ff3_mid.jpg', '29岁', '168CM', '未婚', '保密', '大专', '浙江杭州', '我是一个孝顺,乐观的人 。在这看颜值的时代，外貌是带的出门也带的回来，现在在服装公司做设计，平时喜欢出去放放风，看看电影，每年会出去旅游一次。希望你是合的来眼缘，切有相同爱好的。', '女');
