INSERT INTO `hongniang` VALUES ('69', 'LIL麦琪', 'Loveid:10655697', 'http://www.hongniang.com/data/upload/photo/20171013/59e01cdf5bc45_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01cdf5bc45ff1_mid.jpg', '24岁', '159CM', '未婚', '保密', '大专', '浙江杭州', '不是每个擦肩而过的人都会相识，也不是每个相识的人都会让人牵挂。至少我们在今生，在那个地方，在一转身的时候没有错过。在我们双眼相望的时候，在眼中找到了爱的缘份。若大的地球上能和你相遇真的不容易，感谢上天给了我们这次相识，相恋的缘份！', '女');
INSERT INTO `hongniang` VALUES ('70', 'shuminjian', 'Loveid:10655698', 'http://www.hongniang.com/data/upload/photo/20171013/59e01cdf8c834_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01cdf8c834ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01cdf8c834ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01cdf8c834ff3_mid.jpg', '27岁', '160CM', '未婚', '保密', '高中及以下', '浙江杭州', '我喜欢听歌。真心希望在这里能遇到我的那个TA!', '女');
INSERT INTO `hongniang` VALUES ('71', '眼缘', 'Loveid:10655684', 'http://www.hongniang.com/data/upload/photo/20171013/59e01cdba0daa_mid.jpg', '33岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个善良,细心,正直,诚信,简单的人 ，关于外貌，简单形容就是身材匀称，我现在的生活状态和心情，可以说是“努力挣钱”。', '女');
INSERT INTO `hongniang` VALUES ('72', '小鱼', 'Loveid:10655688', 'http://hongniang.com/data/upload/photo/20171013/59e01cdc8f0ba_mid.jpg,http://hongniang.com/data/upload/photo/20171013/59e01cdc8f0baff1_mid.jpg', '24岁', '161CM', '未婚', '保密', '大学本科', '浙江杭州', '爱我，要爱我一生一世；爱我，爱，只且爱我一个；爱我，必须爱我的一切缺点；爱我，必须懂我；我爱看小说，你可以不爱；我爱猜谜语，你必须配合，哪怕你不会；我爱猜谜语，如果你会，你要装不会，但是最后要会。', '女');
