INSERT INTO `hongniang` VALUES ('74', '小娜', 'Loveid:10655690', 'http://hongniang.com/data/upload/photo/20171013/59e01cdceee93_mid.jpg,http://hongniang.com/data/upload/photo/20171013/59e01cdceee93ff1_mid.jpg,http://hongniang.com/data/upload/photo/20171013/59e01cdceee93ff2_mid.jpg', '24岁', '161CM', '未婚', '保密', '高中及以下', '浙江杭州', '我是一个善良,乐观的人 ，爱好广泛的我，喜欢美食，我的工作属于媒体业，我生长在一个单亲家庭，我爱我家人，他们也爱我。', '女');
INSERT INTO `hongniang` VALUES ('75', '青青', 'Loveid:10655692', 'http://marry.hongniang.com/data/upload/photo/20171013/59e01cdd8068a_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171013/59e01cdd8068aff1_mid.jpg', '30岁', '160CM', '未婚', '保密', '大专', '浙江杭州', '我真的没什么想说的，找个能照顾我的，真心愿意愿意照顾我的', '女');
INSERT INTO `hongniang` VALUES ('76', '西西', 'Loveid:10655693', 'http://www.hongniang.com/data/upload/photo/20171013/59e01cddb3355_mid.jpg', '25岁', '159CM', '未婚', '保密', '大学本科', '浙江杭州', '我觉得我至少还能活个56年吧？那在剩下的这么多日子里，一定要找个互相喜欢的人，不然多可惜啊，就只有一辈子，还碰不到一个能想着念着、对着可以撒撒娇、吹吹牛的他，想想都觉得很悲伤= =。\n　　我的性格其实有一丢丢内向，放不放的开取决于熟悉程度，至少我在关系好的朋友面前是话多的人，可以把她夸上天。然后我还是一个喜欢窝家里的人，在家，哪哪儿都好。当然该出去玩耍还是会出去的，毕竟不能蹲着长蘑菇。\n　　工作上，现在的工作在忙季会出差。符合小的时候隐隐的设想，年轻的时候，来个出出差的工作，所谓的看看世界。当然，这是不长久的，满足了一下刚毕业对出差生活的好奇，就要换份不出差的工作啦。\n　　我希望能找一个性格上能和我互补的他，因为我暗搓搓地观察了周边已婚妇女的生活，感觉互补的很多都很幸福。也就是希望未来的对象能开朗一点哈哈。并且有责任有担当，很man，或者是努力成为一个有责任有担当的未来很man的先生。\n　　最后，我希望能有一个人，我们大部分三观合拍，并且能在未来一起成长，共同进步。', '女');
INSERT INTO `hongniang` VALUES ('77', '★回忆灬', 'Loveid:10655694', 'http://marry.hongniang.com/data/upload/photo/20171013/59e01cdeee707_mid.jpg', '45岁', '156CM', '未婚', '保密', '高中及以下', '浙江杭州', '一杯清茶，一本小说，一张碟片还有一首老歌。我们生来时，什么也没有带来，同样的死后也带不走什么。所以,亲爱的你，我们简简单单过完这辈子，然后把这份感情留到下辈子好不好？遇见你，一定是我生命中最绚烂的时刻。', '女');
INSERT INTO `hongniang` VALUES ('78', '幸福', 'Loveid:10655705', 'http://www.hongniang.com/data/upload/photo/20171013/59e01ce7395cd_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01ce7395cdff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01ce7395cdff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01ce7395cdff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01ce7395cdff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01ce7395cdff5_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01ce7395cdff6_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01ce7395cdff7_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01ce7395cdff8_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01ce7395cdff9_mid.jpg', '27岁', '160CM', '未婚', '保密', '大专', '浙江杭州', '风雨人生，给自己一个微笑。人生，从来就没有百分百的完美，生命于我们，只不过是一个过程，完美也好，有一点缺憾也罢，这一路走来，重要的是我们欣赏到了沿途的风景。', '女');
INSERT INTO `hongniang` VALUES ('79', '猪头橙', 'Loveid:10655305', 'http://www.hongniang.com/data/upload/photo/20171012/59deb88143233_mid.jpg', '26岁', '170CM', '未婚', '保密', '高中及以下', '浙江杭州', '爱好广泛的我，喜欢旅行,电影,话剧，说说我的工作，我工作在在国企，我的工作属于医务工作者，我现在的生活状态和心情，可以说是“非诚勿扰,攒钱ing”。', '女');
