INSERT INTO `hongniang` VALUES ('81', '呆飞飞最听话', 'Loveid:10655699', 'http://www.hongniang.com/data/upload/photo/20171013/59e01cdfbe724_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01cdfbe724ff1_mid.jpg', '27岁', '158CM', '未婚', '保密', '大学本科', '浙江杭州', '不要因为寂寞爱错人，更不要因为爱错人而寂寞一生，尝试信任才能得到幸福。缘分是本书，翻的不经意会错过，读的太认真会流泪。', '女');
INSERT INTO `hongniang` VALUES ('82', '妖精跳起来', 'Loveid:10655700', 'http://www.hongniang.com/data/upload/photo/20171013/59e01cdfdf30d_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01cdfdf30dff1_mid.jpg', '30岁', '156CM', '未婚', '保密', '大学本科', '浙江杭州', '我性格开朗，活泼外向，喜欢旅游、看书、听音乐！在西湖区一家企业上班，担任经理！希望能找个性格脾气合的来得，有孝顺心、有上进心、有责任心的男人与我共度一生！祝所有浏览过我资料的人都能找到自己的幸福，谢谢~~', '女');
INSERT INTO `hongniang` VALUES ('83', '嘉嘉', 'Loveid:10655309', 'http://www.hongniang.com/data/upload/photo/20171012/59deb881f2ffd_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb881f2ffdff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb881f2ffdff2_mid.jpg', '27岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个孝顺,正直,靠谱,简单,诚信的人 ，爱好广泛的我，喜欢旅行,健身，说说我的工作，我工作在在私企。', '女');
INSERT INTO `hongniang` VALUES ('84', '若水', 'Loveid:10655310', 'http://www.hongniang.com/data/upload/photo/20171012/59deb882411e2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb882411e2ff1_mid.jpg', '26岁', '158CM', '未婚', '保密', '大专', '浙江杭州', '我是一个大大咧咧的人 ，爱好广泛的我，喜欢听歌，关于外貌，简单形容就是微胖，我现在的生活状态和心情，可以说是“奋斗中”。', '女');
INSERT INTO `hongniang` VALUES ('85', '1234', 'Loveid:10655704', 'http://marry.hongniang.com/data/upload/photo/20171013/59e01ce1b3e92_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171013/59e01ce1b3e92ff1_mid.jpg', '28岁', '164CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个简单的人 ，是个不折不扣的美食家，我有些特长：不挑食,好厨艺,特别能睡,力大无穷， 是不是很有趣呢？我的工作属于销售。', '女');
INSERT INTO `hongniang` VALUES ('86', 'jin', 'Loveid:10655325', 'http://www.hongniang.com/data/upload/photo/20171012/59deb88d79ead_mid.jpg', '27岁', '170CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个开朗的人 ，爱好广泛的我，喜欢看书，关于外貌，简单形容就是健康。不知道怎么回事我把这个软件删除又重下载后年龄跟身高都错了，我实际年龄24，身高1.64米。希望诚心交往的朋友不只是随便发个问候语，留下你的联系方式。在这里有一年多了，加的也只是聊几句，希望你能让我看到你的真诚。现实中没有遇到合适的，不是眼光高，只是想找一个合适的人。(系统消息看不到)', '女');
INSERT INTO `hongniang` VALUES ('87', '大一新生', 'Loveid:10655303', 'http://www.hongniang.com/data/upload/photo/20171012/59deb880d8d6a_mid.jpg', '22岁', '160CM', '未婚', '保密', '大专', '浙江杭州', '我，阳光，随意，勤勉，又有完美的生活目标，生活在这个世界上。你，只求如同一阵清新的空气，让我呼吸于中，融为一体。', '女');
INSERT INTO `hongniang` VALUES ('88', '若愚', 'Loveid:10655304', 'http://marry.hongniang.com/data/upload/photo/20171012/59deb880e38e8_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171012/59deb880e38e8ff1_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171012/59deb880e38e8ff2_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171012/59deb880e38e8ff3_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171012/59deb880e38e8ff4_mid.jpg', '25岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '大家好，很高兴来到这里，非常希望认识更多的朋友，更期待你的出现，快快给我发信吧—*', '女');
INSERT INTO `hongniang` VALUES ('89', 'yoko', 'Loveid:10655335', 'http://www.hongniang.com/data/upload/photo/20171012/59deb897c9db2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb897c9db2ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb897c9db2ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb897c9db2ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb897c9db2ff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb897c9db2ff5_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb897c9db2ff6_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb897c9db2ff7_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb897c9db2ff8_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb897c9db2ff9_mid.jpg', '26岁', '167CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个执着,独立的人 ，爱好广泛的我，喜欢摄影,瑜伽,音乐会，我的工作属于自由职业。', '女');
INSERT INTO `hongniang` VALUES ('90', '出水芙蓉', 'Loveid:10655306', 'http://marry.hongniang.com/data/upload/photo/20171012/59deb8815d7e8_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171012/59deb8815d7e8ff1_mid.jpg', '18岁', '150CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个正直,顾家,善良,靠谱,可爱的人 ，说说我的工作，我工作在在私企。', '女');
INSERT INTO `hongniang` VALUES ('91', '丨丶可乐灬', 'Loveid:10655336', 'http://www.hongniang.com/data/upload/photo/20171012/59deb8982b53b_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb8982b53bff1_mid.jpg', '26岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '这个世上，一切都会消亡，一切都会被淡忘，一切都会沉寂，唯有爱，生生不息，世代相传，这是一个高贵生命的本质特性。其实，我们也是生活在这样的爱里，如果我们感觉不到，那一定是心里的那个“我”长得太大了，以致遮蔽了我们感受爱的能力，也阻碍了我们去爱别人的能力', '女');
INSERT INTO `hongniang` VALUES ('92', '琉璃玥', 'Loveid:10655344', 'http://www.hongniang.com/data/upload/photo/20171012/59deb89f7d5ed_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb89f7d5edff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb89f7d5edff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb89f7d5edff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb89f7d5edff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb89f7d5edff5_mid.jpg', '33岁', '161CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个细心,简单的人 ，爱好广泛的我，喜欢养猫,旅行，关于外貌，简单形容就是小酒窝。', '女');
INSERT INTO `hongniang` VALUES ('93', '注销用户', 'Loveid:10655308', 'http://hongniang.com/data/upload/photo/20171012/59deb881d2a1e_mid.jpg,http://hongniang.com/data/upload/photo/20171012/59deb881d2a1eff1_mid.jpg', '23岁', '170CM', '未婚', '保密', '大专', '浙江杭州', '我是一个简单的人 ，爱好广泛的我，喜欢话剧，我有些特长：整理癖， 是不是很有趣呢？我的工作属于医务工作者。', '女');
