INSERT INTO `hongniang` VALUES ('95', '阿芳', 'Loveid:10655678', 'http://www.hongniang.com/data/upload/photo/20171013/59e01cd8b8306_mid.jpg', '40岁', '154CM', '未婚', '保密', '大专', '浙江杭州', '我是一个独立,乐观,正直,孝顺,细心,靠谱,文静,宅的人 ，是个不折不扣的美食家，我生长在一个高知家庭，我爱我家人，他们也爱我。', '女');
INSERT INTO `hongniang` VALUES ('96', '小', 'Loveid:10655315', 'http://www.hongniang.com/data/upload/photo/20171012/59deb884df9d2_mid.jpg', '34岁', '163CM', '未婚', '保密', '大专', '浙江杭州', '我喜欢画画 剪纸 。我在业余时间最大的消遣是做自己喜欢的事情。我憧憬的生活是和谐。我希望我未来的另一半最好是好脾气。真心希望在这里能遇到我的那个TA!', '女');
INSERT INTO `hongniang` VALUES ('97', 'Hong', 'Loveid:10655324', 'http://www.hongniang.com/data/upload/photo/20171012/59deb88d4901a_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb88d4901aff1_mid.jpg', '21岁', '158CM', '未婚', '保密', '大专', '浙江杭州', '哭的时候没人哄，我学会了坚强；怕的时候没人陪，我学会了勇敢；烦的时候没人问，我学会了承受；累的时候没人可以依靠，我学会了自立。就这样我找到了自己。世界上，只有一个我，我渴望你的倾听，你的靠近，渴望你用男人的温暖拥抱一个女人的全部。', '女');
INSERT INTO `hongniang` VALUES ('98', '浅夏﹌雨中弥漫着花香', 'Loveid:10655333', 'http://www.hongniang.com/data/upload/photo/20171012/59deb897481f8_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb897481f8ff1_mid.jpg', '27岁', '164CM', '未婚', '保密', '大学本科', '浙江杭州', '我一直在这里，没有离开，我一直在等待，等着那个和我终生相伴相爱一生的你的出现。因缘而聚，我始终这样认为，所以觉得这里真的很好，美丽的缘分，也许就是给我的最美丽的暗示吧。', '女');
INSERT INTO `hongniang` VALUES ('99', '张玲', 'Loveid:10655343', 'http://www.hongniang.com/data/upload/photo/20171012/59deb89f4ee64_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb89f4ee64ff1_mid.jpg', '25岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '自立 贸易主管 女强人 有兴趣可以加QQ聊', '女');
INSERT INTO `hongniang` VALUES ('100', '豹子回来了', 'Loveid:10655345', 'http://www.hongniang.com/data/upload/photo/20171012/59deb89fcef0a_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb89fcef0aff1_mid.jpg', '22岁', '170CM', '未婚', '保密', '高中及以下', '浙江杭州', '我在等一个人，一个愿意走进我的生命分享我的喜怒哀乐的人，一个知道我曾经无尽的等待因而更加珍惜我的人，一个也许没能参与我的昨天却愿意和我携手走过每一个明天的人， 一个知道我不完美却依然喜欢我甚至连我的不完美也一并欣赏的人!', '女');
INSERT INTO `hongniang` VALUES ('101', '然然', 'Loveid:10655528', 'http://www.hongniang.com/data/upload/photo/20171012/59def6551680f_mid.png,http://www.hongniang.com/data/upload/photo/20171012/59def6612b04c_mid.png,http://www.hongniang.com/data/upload/photo/20171012/59def66b93036_mid.png,http://www.hongniang.com/data/upload/photo/20171012/59def8e3bfb88_mid.png,http://www.hongniang.com/data/upload/photo/20171012/59def8ef2f29e_mid.png', '25岁', '163CM', '未婚', '5-10万元', '大专', '江苏南京', '范例 以前为了学习老妈不让谈恋爱，现在为了工作没时间恋爱，随着时间的推移，自己发现已经步入“剩女”的行列，其实自己对另一半的要求也不是很高，可以不是很帅，可以不是很富有，但是一定要有上进心，责任心，能够孝顺老人家也就差不多了。我对未来有很多憧憬和希望，但愿能和心爱的人一起实现.....', '女');
INSERT INTO `hongniang` VALUES ('102', '小《薇', 'Loveid:10655255', 'http://www.hongniang.com/data/upload/photo/20171012/59deb851e0059_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb851e0059ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb851e0059ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb851e0059ff3_mid.jpg', '28岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个靠谱,可爱,独立,善良的人，希望那个有缘人的出现。', '女');
INSERT INTO `hongniang` VALUES ('103', '紫现', 'Loveid:10655194', 'http://www.hongniang.com/data/upload/photo/20171012/59deb81fe008f_mid.jpg', '32岁', '167CM', '未婚', '保密', '高中及以下', '浙江杭州', '不自怜、不自卑、不怨叹，一日一日来，一步一步走，那柳暗花明的喜乐和必然的到达，在于我们自身的修持。', '女');
INSERT INTO `hongniang` VALUES ('104', '旦旦', 'Loveid:10655203', 'http://www.hongniang.com/data/upload/photo/20171012/59deb828138c1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb828138c1ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb828138c1ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb828138c1ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb828138c1ff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb828138c1ff5_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb828138c1ff6_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb828138c1ff7_mid.jpg', '30岁', '159CM', '未婚', '保密', '大专', '浙江杭州', '爱一个人意味着什么呢？这意味着为他的幸福而高兴，为使他能够幸福而去做需要做的一切，并从这当中得到快乐。一般的宿命，就是我们总会遇见一些人遭遇一些事。然后，看着命中注定的事发生，却无能为力。而我的宿命就是遇到了你，一眨眼一瞬间凝固停止延续到永远。', '女');
INSERT INTO `hongniang` VALUES ('105', '紫漓子', 'Loveid:10655213', 'http://test.hongniang.com/data/upload/photo/20171012/59deb831c8118_mid.jpg,http://test.hongniang.com/data/upload/photo/20171012/59deb831c8118ff1_mid.jpg,http://test.hongniang.com/data/upload/photo/20171012/59deb831c8118ff2_mid.jpg,http://test.hongniang.com/data/upload/photo/20171012/59deb831c8118ff3_mid.jpg', '27岁', '173CM', '未婚', '保密', '硕士', '浙江杭州', '我在等一个人，一个愿意走进我的生命分享我的喜怒哀乐的人，一个知道我曾经无尽的等待因而更加珍惜我的人，一个也许没能参与我的昨天却愿意和我携手走过每一个明天的人， 一个知道我不完美却依然喜欢我甚至连我的不完美也一并欣赏的人!', '女');
INSERT INTO `hongniang` VALUES ('106', '上善若水', 'Loveid:10655214', 'http://marry.hongniang.com/data/upload/photo/20171012/59deb83200a7d_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171012/59deb83200a7dff1_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171012/59deb83200a7dff2_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171012/59deb83200a7dff3_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171012/59deb83200a7dff4_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171012/59deb83200a7dff5_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171012/59deb83200a7dff6_mid.jpg', '25岁', '164CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个独立,大大咧咧,善良,顾家的人 ，爱好广泛的我，喜欢瑜伽,逛街,电影,养狗，是个不折不扣的女强人。', '女');
INSERT INTO `hongniang` VALUES ('107', '贝(⊙_⊙)蓓', 'Loveid:10655223', 'http://marry.hongniang.com/data/upload/photo/20171012/59deb8389d3f3_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171012/59deb8389d3f3ff1_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171012/59deb8389d3f3ff2_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171012/59deb8389d3f3ff3_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171012/59deb8389d3f3ff4_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171012/59deb8389d3f3ff5_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171012/59deb8389d3f3ff6_mid.jpg', '28岁', '155CM', '未婚', '保密', '大专', '浙江杭州', '我是一个很没有安全感的女人，我不需要太富有的丈夫，但也不接受条件太差的，因为我们家里有三个孩子，我是老大，我可以跟另一半一起奋斗，但我不希望我将来的孩子过得太委屈；我对样貌的要求不高，能看就行，我自己也不是什么美女，长的太帅我没安全感；家里不赞成我嫁的太远，最好是天台或杭州的。我觉得两个人相处信任很重要，也希望能够彼此尊重，当有一天你不再爱我了，我希望你诚恳的讲出来，不要让我变成最后一个知道的傻子。我很容易相信别人，有时候挺傻挺单纯的，俗称呆小白。如果你有我有那么点点感觉，请一定要主动强势的来找我，因为我是一个别扭的孩子，俗称傲娇，哈哈哈哈哈。', '女');
INSERT INTO `hongniang` VALUES ('108', '维多', 'Loveid:10655224', 'http://www.hongniang.com/data/upload/photo/20171012/59deb838e383c_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb838e383cff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb838e383cff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb838e383cff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb838e383cff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb838e383cff5_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb838e383cff6_mid.jpg', '29岁', '158CM', '未婚', '保密', '大专', '浙江杭州', '希望快乐的我会感染幸福的你，期待命中的你！\n　　如果有缘，千里无距，来信贴邮票吧', '女');
