INSERT INTO `hongniang` VALUES ('110', 'uyuu', 'Loveid:10655243', 'http://www.hongniang.com/data/upload/photo/20171012/59deb848b4457_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb848b4457ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb848b4457ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb848b4457ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb848b4457ff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb848b4457ff5_mid.jpg', '29岁', '160CM', '未婚', '保密', '高中及以下', '浙江杭州', '我喜欢唱歌、看书。我在业余时间最大的消遣是学习。我希望我未来的另一半最好是孝顺、专一。真心希望在这里能遇到我的那个TA!', '女');
INSERT INTO `hongniang` VALUES ('111', '谁懂我的心', 'Loveid:10655285', 'http://www.hongniang.com/data/upload/photo/20171012/59deb86c3653a_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb86c3653aff1_mid.jpg', '23岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '爱好广泛的我，喜欢淘宝,淘宝,养狗，是个不折不扣的萌妹纸，我有些特长：整理癖,过目不忘， 是不是很有趣呢？我现在的生活状态和心情，可以说是“单身求解救,非诚勿扰”。', '女');
INSERT INTO `hongniang` VALUES ('112', '喵星人Sugar', 'Loveid:10655244', 'http://www.hongniang.com/data/upload/photo/20171012/59deb84901c56_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb84901c56ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb84901c56ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb84901c56ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb84901c56ff4_mid.jpg', '28岁', '166CM', '未婚', '保密', '大专', '浙江杭州', '我是一个乐观,体贴,温柔的人 ，爱好广泛的我，喜欢健身。富有爱心。', '女');
INSERT INTO `hongniang` VALUES ('113', '娜小琪', 'Loveid:10655253', 'http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171012/59deb851a699a_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171012/59deb851a699aff1_mid.jpg', '25岁', '162CM', '未婚', '保密', '高中及以下', '浙江杭州', '真正的爱情并不一定是他人眼中的完美匹配，而是相爱的人彼此心灵的相互契合', '女');
INSERT INTO `hongniang` VALUES ('114', '萍児', 'Loveid:10655254', 'http://www.hongniang.com/data/upload/photo/20171012/59deb851d38d7_mid.jpg', '25岁', '158CM', '未婚', '保密', '大专', '浙江杭州', '我想有这么一个男人，他不一定很高很帅，但是会让我把以后的时光放心的交给他；他不一定很有钱，但是会让我每天回家后吃上热热的饭菜；他不一定会很早计划好我们的未来，但是会在某天深情的对我说，我最爱的丫头，我们是时候该有个家了。', '女');
