INSERT INTO `hongniang` VALUES ('121', '格蕾丝', 'Loveid:10655288', 'http://hongniang.com/data/upload/photo/20171012/59deb86cd1926_mid.jpg,http://hongniang.com/data/upload/photo/20171012/59deb86cd1926ff1_mid.jpg,http://hongniang.com/data/upload/photo/20171012/59deb86cd1926ff2_mid.jpg', '30岁', '155CM', '未婚', '保密', '大学本科', '浙江杭州', '我在世纪佳缘网上注册是不是为了好玩，资料全部属实，本人诚实，孝顺，勤劳，喜欢洗碗，打扫卫生。br /br /现在在杭州余杭从事外贸业务员工作，双休。br /br /想找一个风趣幽默， 诚实，有耐心，以后一起在杭州发展有上进心的人。', '女');
