INSERT INTO `hongniang` VALUES ('124', '陈糖', 'Loveid:10655044', 'http://www.hongniang.com/data/upload/photo/20171012/59deb77ba5eb0_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb77ba5eb0ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb77ba5eb0ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb77ba5eb0ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb77ba5eb0ff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb77ba5eb0ff5_mid.jpg', '28岁', '165CM', '未婚', '保密', '大专', '浙江杭州', '重要的是要以结婚为目地.一点最好是“江苏南京附近的人”不是的话非诚勿扰', '女');
INSERT INTO `hongniang` VALUES ('125', '蓝蓝', 'Loveid:10655144', 'http://www.hongniang.com/data/upload/photo/20171012/59deb7eea12eb_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb7eea12ebff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb7eea12ebff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb7eea12ebff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb7eea12ebff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb7eea12ebff5_mid.jpg', '31岁', '170CM', '未婚', '保密', '大专', '浙江杭州', '我不会轻易喜欢一个人，也不会随意忘记一个人。如果哪个人是我喜欢的，我会对他很好很好。\n　　我喜欢旅游,做过空姐，外贸，如今是做海运物流。我在业余时间最大的消遣是美容健身瑜伽逛街看书。我憧憬的生活是自由，轻松，充实忙碌的生活，我不喜欢浪费时间，浪费生命。我希望我未来的另一半最好是霸道，魄力，人格魅力，事业有成，孝顺，有责任心的人。我相信我将是你最棒的贤内助。\n　　真心希望在这里能遇到我的那个TA!', '女');
INSERT INTO `hongniang` VALUES ('126', 'BOBO和露露', 'Loveid:10655063', 'http://wlv.hongniang.com/data/upload/photo/20171012/59deb78d35287_mid.jpg', '27岁', '163CM', '未婚', '保密', '大专', '浙江杭州', '恩恩。比较乐观·孩子气把。我喜欢温柔的，有思想的，有男子气的男生', '女');
INSERT INTO `hongniang` VALUES ('127', '花开在静默的半夏', 'Loveid:10655064', 'http://www.hongniang.com/data/upload/photo/20171012/59deb78d433ee_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb78d433eeff1_mid.jpg', '26岁', '161CM', '未婚', '保密', '大学本科', '浙江杭州', '以平常之心，接受已发生的事;以宽阔之心，包容对不起你的人;以不变之心，坚持正确的理念;以喜悦之心，帮助须帮助的人;以放下之心，面对难割舍的事;以美好之心，欣赏周围的事物;以真诚之心，对待每一个人;以愉悦之心…', '女');
INSERT INTO `hongniang` VALUES ('128', '妍妍', 'Loveid:10655073', 'http://www.hongniang.com/data/upload/photo/20171012/59deb79b21c2b_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb79b21c2bff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb79b21c2bff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb79b21c2bff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb79b21c2bff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb79b21c2bff5_mid.jpg', '27岁', '165CM', '未婚', '保密', '高中及以下', '浙江杭州', '我只想找个喜欢我愿意娶我的人 应为家人催了所以才来佳缘 如果你只想谈恋爱 请不要给我邮件 非诚勿扰', '女');
INSERT INTO `hongniang` VALUES ('129', '1234', 'Loveid:10655077', 'http://marry.hongniang.com/data/upload/photo/20171012/59deb79c66b64_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171012/59deb79c66b64ff1_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171012/59deb79c66b64ff2_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171012/59deb79c66b64ff3_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171012/59deb79c66b64ff4_mid.jpg', '20岁', '160CM', '未婚', '保密', '高中及以下', '浙江杭州', '人生一直在做减法，而成长一直在做加法，我对自己的生活状态很满意，因为工作性质的关系出去玩的机会很少，可是我很快乐，家人很好，从他们身上我学会了很多，恩，可以试着了解我。', '女');
INSERT INTO `hongniang` VALUES ('130', 'QueEn', 'Loveid:10655083', 'http://test.hongniang.com/data/upload/photo/20171012/59deb7a1c433d_mid.jpg,http://test.hongniang.com/data/upload/photo/20171012/59deb7a1c433dff1_mid.jpg', '30岁', '162CM', '未婚', '保密', '大学本科', '浙江杭州', '此号是之前一个朋友的，因为对方找到了另一半，我也来碰碰运气，本人1986，家里独女，工作稳定 在杭州。希望对方是孝顺 好脾气，有担当的男人，之前一段失败的感情让我有一段时间不在相信爱情。但是看到身边朋友有在这里找到。所以我再次拾起勇气。去寻找我的幸福。你在哪里？我未来的爱人 请你快快出现。不要在让我苦苦等下去了，我想好好爱你。想与你有一个温馨的家！', '女');
INSERT INTO `hongniang` VALUES ('131', '古月', 'Loveid:10655124', 'http://www.hongniang.com/data/upload/photo/20171012/59deb7d84832f_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb7d84832fff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb7d84832fff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb7d84832fff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb7d84832fff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb7d84832fff5_mid.jpg', '25岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '没有贴邮票的，请不要给我发信啦，因为我没有邮票，只能看自贴邮票的信。谢谢。\n　　爱过，痛过，终究一场梦。任世间纷纷扰扰，我仍相信爱情的存在。一屋，两人，三餐，四季。就是我想要的生活。不需要轰轰烈烈的爱情，只渴望两人平平淡淡的生活。深情不及久伴。\n　　自己的情况：外貌身材中上，正规单位，收入稳定。有自己的兴趣爱好和追求。喜欢旅游，喜欢美食。\n　　不将就，不错过。\n　　面包我自己挣，你，给我爱情就好。', '女');
INSERT INTO `hongniang` VALUES ('132', 'Life_', 'Loveid:10655143', 'http://www.hongniang.com/data/upload/photo/20171012/59deb7ee5e818_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb7ee5e818ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb7ee5e818ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb7ee5e818ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb7ee5e818ff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb7ee5e818ff5_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb7ee5e818ff6_mid.jpg', '29岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个独立的人 ，爱好广泛的我，喜欢电影,听歌,旅行。', '女');
INSERT INTO `hongniang` VALUES ('133', '娜娜', 'Loveid:10655154', 'http://www.hongniang.com/data/upload/photo/20171012/59deb7f9de03c_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb7f9de03cff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb7f9de03cff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb7f9de03cff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb7f9de03cff4_mid.jpg', '27岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个可爱,体贴的人 ，爱好广泛的我，喜欢淘宝，我的工作属于销售。', '女');
INSERT INTO `hongniang` VALUES ('134', '一生一世', 'Loveid:10655155', 'http://hongniang.com/data/upload/photo/20171012/59deb7fa1fe8b_mid.jpg,http://hongniang.com/data/upload/photo/20171012/59deb7fa1fe8bff1_mid.jpg,http://hongniang.com/data/upload/photo/20171012/59deb7fa1fe8bff2_mid.jpg', '26岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '曾经沧海桑田，如今过往云烟。彼此留一点余地或许更好。', '女');
INSERT INTO `hongniang` VALUES ('135', '紫樂', 'Loveid:10655156', 'http://hongniang.com/data/upload/photo/20171012/59deb7fa4b682_mid.jpg,http://hongniang.com/data/upload/photo/20171012/59deb7fa4b682ff1_mid.jpg,http://hongniang.com/data/upload/photo/20171012/59deb7fa4b682ff2_mid.jpg,http://hongniang.com/data/upload/photo/20171012/59deb7fa4b682ff3_mid.jpg', '27岁', '172CM', '未婚', '保密', '大专', '浙江杭州', '有些事，错过了，就是错过了，希望曾经喜欢过我的人，能找到适合自己的。\n　　拒绝家暴！！！\n　　在我眼里，爱情不仅仅需要的是信任，更多的是执着，对生活的执着，对希望的执着，对生命的执着，这都是支撑爱情的基础，让爱情之花从尘埃里开出来，绚烂绽放。昨天的事情今天不重播，今天的事情导演不叫cut，明天的事情我要和你一起去编辑，拍出奥斯卡都望尘莫及的经典大片。\n　　特此声明，头像照片是化妆后的，平时的我（生活照）不化妆的，请不要误解，也不要被假象所蒙蔽，我不是一个喜欢化妆的人，如果你要的是一个可以给你化妆后的各种刺激的人 或者 介意的人，请绕道，谢谢\n　　我是个动静结合的女孩^*(- -)*^，至于是动？是静？要看所在的环境和当时的心情( # ▽ # )o(︶︿︶)o 唉，我有很倔强的小孩子脾气，o(∩_∩)o 哈哈，但是不会无理取闹┈我不是女强人，也不是纯粹的小女人，我有我的性格，我的style。 \n　　还有就是，我是厨房白痴。我希望我的另一半是个高大的成熟男人，能容纳我的小孩子脾气，我的小错误，我的不懂事。希望他是个有大男子主义的人，但没有家暴━═☆如果你能接受，那么请……\n　　但是，请看清我的要求，如果你不够成熟，不够高，那么请你绕道，我希望，以后能穿高跟鞋。非诚勿扰--', '女');
INSERT INTO `hongniang` VALUES ('136', '雪儿', 'Loveid:10655164', 'http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171012/59deb7ffd4bbe_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171012/59deb7ffd4bbeff1_mid.jpg', '27岁', '160CM', '未婚', '保密', '高中及以下', '浙江杭州', '让我为你戴你上银白色的钻戒，让我为你穿上白色的礼服，想为早起的你挤牙膏，想为晚起的你做早餐，与你在夕阳下散步，让我守在你的身边一生一世。\n　　喜欢我就接受我的一切', '女');
INSERT INTO `hongniang` VALUES ('137', '锦末年', 'Loveid:10655173', 'http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171012/59deb80973096_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171012/59deb80973096ff1_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171012/59deb80973096ff2_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171012/59deb80973096ff3_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171012/59deb80973096ff4_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171012/59deb80973096ff5_mid.jpg', '27岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一名大学教师。\n　　虽说生活总是平平淡淡细水长流的，但我觉得偶尔添加一点浪漫的因素会使生活更加丰富多彩。\n　　佛说，前世五百次的回眸，才换来今生的擦肩而过。与你相遇，相识，相知，相守都是缘分。\n　　希望觅得一位爱我懂我的人，生活因默契而和谐。', '女');
INSERT INTO `hongniang` VALUES ('138', '琳子', 'Loveid:10655174', 'http://www.hongniang.com/data/upload/photo/20171012/59deb809ceccf_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb809ceccfff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb809ceccfff2_mid.jpg', '32岁', '168CM', '未婚', '保密', '大专', '浙江杭州', '有时候望着地平线的方向，我在想，自己一路走来，明天又将去向哪里呢。快乐过也失落过，一个人旅途太漫长，如果你愿意，我希望能拉着你的手，一起奔跑，一起去寻找我们的幸福。(男士们写信贴邮票是最基本的诚意）', '女');
INSERT INTO `hongniang` VALUES ('139', 'xltoto2016', 'Loveid:10655184', 'http://marry.hongniang.com/data/upload/photo/20171012/59deb81557d2f_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171012/59deb81557d2fff1_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171012/59deb81557d2fff2_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171012/59deb81557d2fff3_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171012/59deb81557d2fff4_mid.jpg', '25岁', '152CM', '未婚', '保密', '大专', '浙江杭州', '我是一个简单,细心的人。喜欢追追剧，喜欢大暖男哈哈', '女');
INSERT INTO `hongniang` VALUES ('140', '娟子', 'Loveid:10655193', 'http://www.hongniang.com/data/upload/photo/20171012/59deb81f95445_mid.jpg,http://www.hongniang.com/data/upload/photo/20171012/59deb81f95445ff1_mid.jpg', '28岁', '160CM', '未婚', '保密', '高中及以下', '浙江杭州', '匆匆走过28年的岁月，依然孑然一身。回首曾经的岁月，纯粹学校的环境，无缘认识很多的人,宁缺无滥的要求，把自己闭塞于开始的印象之中，对于感情缺乏主动而传统的性格，让自己成了守候一族。\n　　相信人间真善美的东西，总保持一份乐观，也许是因为偶尔盲目的乐观，有时看起来傻傻的喜欢把问题简单化，从简简单单的生活中体会生活的美好和温馨活泼开朗宽容，偶尔也有点固执喜欢跟朋友们一起热闹，也喜欢在安静的空间里做些简单的事情。\n　　喜欢听音乐，喜欢看书（看些不是很深刻的书)喜欢运动，空暇的时候打打羽毛球、跑跑步、登登山，贴近一下大自然，在不喧闹的田园中领略自然的魅力。\n　　爱情不是永远的激情，也许只是淡淡生活中的细水常流，爱情需要真诚、宽容、专一来灌溉，爱情更是婚姻的通行证。我渴望一份朴实的爱情。\n　　有人说，在对的时间遇见对的人，是一生幸福。在对的时间里，我望穿秋水，等待一份真的情，等待一个对的人。', '女');
