INSERT INTO `hongniang` VALUES ('321', '桺影摇曳臨風舞', 'Loveid:10656416', 'http://test.hongniang.com/data/upload/photo/20171016/59e41038beeb4_mid.jpg,http://test.hongniang.com/data/upload/photo/20171016/59e41038beeb4ff1_mid.jpg', '27岁', '162CM', '未婚', '保密', '大学本科', '浙江杭州', '我喜欢上网 看书 听音乐 。我在业余时间最大的消遣是上网 看书。我憧憬的生活是安稳的。我希望我未来的另一半最好是有孝心 包容 不以结婚为目的的找对象就是耍流氓.找不到喜欢的伞，我宁愿站着淋雨。', '女');
INSERT INTO `hongniang` VALUES ('322', '奇异果', 'Loveid:10655133', 'http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171012/59deb7e49c628_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171012/59deb7e49c628ff1_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171012/59deb7e49c628ff2_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171012/59deb7e49c628ff3_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171012/59deb7e49c628ff4_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171012/59deb7e49c628ff5_mid.jpg', '30岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '我喜欢购物。我在业余时间最大的消遣是买衣服。我憧憬的生活是王子与公主。我希望我未来的另一半最好是高富帅。真心希望在这里能遇到我的那个TA!想让我看信的请贴邮票！不贴邮票的请别给我发信,因为看不见。不善良的坏脑筋的最好绕道,谢谢。再说一次哦！偶没有邮票，不贴邮票真的看不见！', '女');
INSERT INTO `hongniang` VALUES ('323', '蝶舞倾城', 'Loveid:10654789', 'http://www.hongniang.com/data/upload/photo/20171011/59dd66ae5bb98_mid.jpg', '26岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个纯真,开朗,执着,孝顺的人 。', '女');
INSERT INTO `hongniang` VALUES ('324', '幸福句点.', 'Loveid:10654788', 'http://www.hongniang.com/data/upload/photo/20171011/59dd66ae2fddd_mid.jpg', '28岁', '164CM', '未婚', '保密', '大学本科', '浙江杭州', '我觉得两个人的爱情是两个人一起经营出来的，因为激情是短暂的，真情是永远的；两情相悦相吸是短暂的，真情相厮相守是永远的。所以我相信我们的爱情随着时间的推移，它就像陈年的酒一样越放越醇香。', '女');
INSERT INTO `hongniang` VALUES ('325', '李丽娣', 'Loveid:10654792', 'http://www.hongniang.com/data/upload/photo/20171011/59dd66aec89d7_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66aec89d7ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66aec89d7ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66aec89d7ff3_mid.jpg', '22岁', '163CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个细心的人 ，爱好广泛的我，喜欢听歌，我现在的生活状态和心情，可以说是“平平淡淡”。', '女');
INSERT INTO `hongniang` VALUES ('326', '微微的香', 'Loveid:10948362', '/public/images/woman.jpg', '53岁', '158CM', '丧偶带孩子', '5-10万元', '大专', '广西柳州', 'Ta很懒,什么都没留下', '女');
INSERT INTO `hongniang` VALUES ('327', '佳', 'Loveid:10654924', 'http://www.hongniang.com/data/upload/photo/20171011/59dd674a1b713_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd674a1b713ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd674a1b713ff2_mid.jpg', '24岁', '167CM', '未婚', '保密', '大学本科', '浙江杭州', '我喜欢旅游 逛街 吃美食 听歌 看电影 睡觉。我在业余时间最大的消遣是睡觉。我憧憬的生活是天天躺了吃 吃了睡。我希望我未来的另一半最好是幽默开朗。真心希望在这里能遇到我的那个TA!', '女');
