INSERT INTO `hongniang` VALUES ('332', '小夏', 'Loveid:10654787', 'http://hongniang.com/data/upload/photo/20171011/59dd66ade7348_mid.jpg,http://hongniang.com/data/upload/photo/20171011/59dd66ade7348ff1_mid.jpg', '21岁', '166CM', '未婚', '保密', '高中及以下', '浙江杭州', '我是一个大大咧咧,纯真的人 ，爱好广泛的我，喜欢瑜伽,听歌，我有些特长：力大无穷， 是不是很有趣呢？关于外貌，简单形容就是身材匀称，我的工作属于媒体业。', '女');
