INSERT INTO `hongniang` VALUES ('339', '李絮絮', 'Loveid:10654796', 'http://www.hongniang.com/data/upload/photo/20171011/59dd66b1674e4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66b1674e4ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66b1674e4ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66b1674e4ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66b1674e4ff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66b1674e4ff5_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66b1674e4ff6_mid.jpg', '27岁', '172CM', '未婚', '保密', '大专', '浙江杭州', '今天是2017年第一天，希望一切安好，希望我未来的男友也一切安好', '女');
INSERT INTO `hongniang` VALUES ('340', '芯照不宣', 'Loveid:10654923', 'http://marry.hongniang.com/data/upload/photo/20171011/59dd674a0ba80_mid.jpg', '34岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个独立的人 ，爱好广泛的我，喜欢瑜伽,摄影。', '女');
INSERT INTO `hongniang` VALUES ('341', '蹦跑的蜗牛', 'Loveid:10654927', 'http://www.hongniang.com/data/upload/photo/20171011/59dd674ab15f2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd674ab15f2ff1_mid.jpg', '22岁', '161CM', '未婚', '保密', '大学本科', '浙江杭州', '有一种爱，长久且让人心醉，有一种情，伤人且自伤。有一种蛊被称为一味相思，让人不由沉醉且相思入骨。爱情就是两个人在一起不离不弃，执子之手，与子偕老；爱情是无私的给予，没有任何条件；爱情是没有怨恨，无畏的等待。', '女');
INSERT INTO `hongniang` VALUES ('342', '时莉', 'Loveid:10655013', 'http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171012/59deb757debe2_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171012/59deb757debe2ff1_mid.jpg', '26岁', '159CM', '未婚', '保密', '大专', '浙江杭州', '我是世纪佳缘手机版用户，你知道表为什么是圆的吗？因为每次到头了，它都能再重新开始。可惜的是，我们的人生不是圆的，我们的生活是不能真正的从头开始的，所以我很珍惜自己生命中的每一个过客。在佳缘，我希望自己不是这里的一个过客，而是盼望在这里建成自己的家园，期待与我一样的另一半的到来。', '女');
