INSERT INTO `hongniang` VALUES ('363', '玲珑', 'Loveid:10654756', 'http://www.hongniang.com/data/upload/photo/20171011/59dd66a3a07ad_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66a3a07adff1_mid.jpg', '30岁', '154CM', '未婚', '保密', '高中及以下', '浙江杭州', '我是一个善良,正直,细心,顾家的人 。我想找一个顾家，宠我，爱我，无不良嗜好的人，以结婚为目的的交往,当然发信的时候请你们选择免费，或者附带邮票', '女');
INSERT INTO `hongniang` VALUES ('364', '壮壮', 'Loveid:10654759', 'http://www.hongniang.com/data/upload/photo/20171011/59dd66a479e65_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66a479e65ff1_mid.jpg', '30岁', '167CM', '未婚', '保密', '大学本科', '浙江杭州', '我燃起生命的火花，等待着你来陪我一起走过美好的明天，江山如此美丽，但是如果没有你的陪伴，那对我将会是毫无意义，只要有你的地方就会星光熠熠，我也只要有你才会觉得世界如此美丽、生命如此可爱。', '女');
