INSERT INTO `hongniang` VALUES ('366', '星晴', 'Loveid:10654762', 'http://www.hongniang.com/data/upload/photo/20171011/59dd66a515e9d_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66a515e9dff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66a515e9dff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66a515e9dff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66a515e9dff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66a515e9dff5_mid.jpg', '39岁', '156CM', '未婚', '保密', '大学本科', '浙江杭州', '在缘分的  天空里，  期待遇见，  期待缘分。  \n　　^_^  不经常    来这里，    来信请贴邮票，谢谢！', '女');
INSERT INTO `hongniang` VALUES ('367', 'viki', 'Loveid:10654767', 'http://www.hongniang.com/data/upload/photo/20171011/59dd66a79db87_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66a79db87ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66a79db87ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66a79db87ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66a79db87ff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66a79db87ff5_mid.jpg', '29岁', '158CM', '未婚', '保密', '大专', '浙江杭州', '我想找的他，希望是杭州本地人，年纪比我长几岁，性格活泼开朗，有点幽默感，喜欢笑，体贴，让我有安全感。如果你是那个他，请与我联系吧\n　　非诚勿扰!', '女');
INSERT INTO `hongniang` VALUES ('368', '三颗猫饼干', 'Loveid:10654768', 'http://www.hongniang.com/data/upload/photo/20171011/59dd66a7ded09_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66a7ded09ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66a7ded09ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66a7ded09ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66a7ded09ff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66a7ded09ff5_mid.jpg', '25岁', '166CM', '未婚', '保密', '大专', '浙江杭州', '家里在催我招对象我真的要出柜了！我的欧巴你在哪里啊，杭州本地优先，身高175以上优先，性格开朗幽默优先，车房无所谓。35岁以上大哥，无情趣正经男和非主流帅哥勿扰，小女子在这有理了。', '女');
INSERT INTO `hongniang` VALUES ('369', '厦晓薇', 'Loveid:10654760', 'http://hongniang.com/data/upload/photo/20171011/59dd66a4af89b_mid.jpg,http://hongniang.com/data/upload/photo/20171011/59dd66a4af89bff1_mid.jpg,http://hongniang.com/data/upload/photo/20171011/59dd66a4af89bff2_mid.jpg', '32岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '在生活中，我性格很活泼开朗，我的业余时间大都放在了旅游上，一直向往无忧无虑的生活，希望对方是一个爱我 疼我的男孩，缘分，其实是一种人与人之间无形的连结，也是某种必然相遇和无限的可能。我期待在这里遇见你。', '女');
INSERT INTO `hongniang` VALUES ('370', '好女人', 'Loveid:10654761', 'http://hongniang.com/data/upload/photo/20171011/59dd66a4db157_mid.jpg,http://hongniang.com/data/upload/photo/20171011/59dd66a4db157ff1_mid.jpg,http://hongniang.com/data/upload/photo/20171011/59dd66a4db157ff2_mid.jpg,http://hongniang.com/data/upload/photo/20171011/59dd66a4db157ff3_mid.jpg,http://hongniang.com/data/upload/photo/20171011/59dd66a4db157ff4_mid.jpg,http://hongniang.com/data/upload/photo/20171011/59dd66a4db157ff5_mid.jpg', '25岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个体贴,孝顺,温柔,开朗的人 。 希望找一个对我好的人', '女');
INSERT INTO `hongniang` VALUES ('371', '风过无痕', 'Loveid:10654775', 'http://www.hongniang.com/data/upload/photo/20171011/59dd66aa5f0a1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66aa5f0a1ff1_mid.jpg', '27岁', '164CM', '未婚', '保密', '大学本科', '浙江杭州', '岁月如同藏在手中的细沙，总是会从手指间偷偷的滑落，无有声息，却总能留下一些不易觉察的痕迹，也如花开花落，当花瓣离落之时，会有暗香残存！于是，在不经意间，发现人们在时间的流动中，各自憔悴，各自苍老，蓦然间，惊觉岁月留在自己身上的无情痕迹，不觉神伤！时光虽然无情，但我们可以让岁月的暗香长留心中！-人生在许多的不确定的变化中，有着生活的艰辛，岁月的磨练，在人生的道路', '女');
INSERT INTO `hongniang` VALUES ('372', 'lili', 'Loveid:10654778', 'http://www.hongniang.com/data/upload/photo/20171011/59dd66ab015ed_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66ab015edff1_mid.jpg', '29岁', '169CM', '未婚', '保密', '硕士', '浙江杭州', '我是一个简单,体贴的人 ，爱好广泛的我，喜欢话剧。', '女');
INSERT INTO `hongniang` VALUES ('373', '天使呼唤', 'Loveid:10654763', 'http://test.hongniang.com/data/upload/photo/20171011/59dd66a674779_mid.jpg,http://test.hongniang.com/data/upload/photo/20171011/59dd66a674779ff1_mid.jpg,http://test.hongniang.com/data/upload/photo/20171011/59dd66a674779ff2_mid.jpg,http://test.hongniang.com/data/upload/photo/20171011/59dd66a674779ff3_mid.jpg,http://test.hongniang.com/data/upload/photo/20171011/59dd66a674779ff4_mid.jpg,http://test.hongniang.com/data/upload/photo/20171011/59dd66a674779ff5_mid.jpg,http://test.hongniang.com/data/upload/photo/20171011/59dd66a674779ff6_mid.jpg', '31岁', '163CM', '未婚', '保密', '高中及以下', '浙江杭州', '我喜欢 电视，旅游。我在业余时间最大的消遣是上网。我憧憬的生活是平淡，快乐生活。我希望我未来的另一半最好是善良孝顺。真心希望在这里能遇到我的那个TA!', '女');
