INSERT INTO `hongniang` VALUES ('375', 'Atina', 'Loveid:10654764', 'http://www.hongniang.com/data/upload/photo/20171011/59dd66a6b8ea0_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66a6b8ea0ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66a6b8ea0ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66a6b8ea0ff3_mid.jpg', '29岁', '168CM', '未婚', '保密', '大学本科', '浙江杭州', '经济独立的服装店店主，如果你觉得你自己驾驭得了我，那你就试试', '女');
INSERT INTO `hongniang` VALUES ('376', '碧海婚纱我的他', 'Loveid:10654780', 'http://www.hongniang.com/data/upload/photo/20171011/59dd66ab2d548_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66ab2d548ff1_mid.jpg', '28岁', '160CM', '未婚', '保密', '大专', '浙江杭州', '也许世界很复杂，但我希望生活简单化，单纯化。 世界无完美的人，完美的人也看不上不完美的我。 所以，我将世界中纷繁复杂的品行在乱序中粗粗勾画，形成我所追求的那个他。 善良、包容、 才华、 幽默、 能看顺眼的外貌，以上五点的前提——相信这个世界有真爱。', '女');
INSERT INTO `hongniang` VALUES ('377', '清风', 'Loveid:10654769', 'http://www.hongniang.com/data/upload/photo/20171011/59dd66a827c7d_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66a827c7dff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66a827c7dff2_mid.jpg', '28岁', '160CM', '未婚', '保密', '高中及以下', '浙江杭州', '、我深深相信，会有那么一个人用尽全力爱上我的全部。我的哭，我的笑，我的任性，我的温柔，我的依赖，我的自私，我的天真，我的粗心，我的疯狂，我的安静，还有我同样用尽全力爱上你的全部的那颗心。', '女');
INSERT INTO `hongniang` VALUES ('378', '悠悠当空', 'Loveid:10654465', 'http://www.hongniang.com/data/upload/photo/20171010/59dc15bdd9ea6_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15bdd9ea6ff1_mid.jpg', '30岁', '163CM', '未婚', '保密', '硕士', '浙江杭州', '我是一个开朗,爱笑的女孩\n　　我休闲时喜欢看书,旅行,看电影\n　　我想找一个靠谱,诚信,幽默,有责任心的男孩', '女');
INSERT INTO `hongniang` VALUES ('379', '娟子', 'Loveid:10654466', 'http://www.hongniang.com/data/upload/photo/20171010/59dc15be1e992_mid.jpg', '32岁', '155CM', '未婚', '保密', '大专', '浙江杭州', '身材匀称.属于娇小类型,比较宅,性格开朗', '女');
INSERT INTO `hongniang` VALUES ('380', 'Anson.lee', 'Loveid:10654772', 'http://hongniang.com/data/upload/photo/20171011/59dd66a8b6c0d_mid.jpg,http://hongniang.com/data/upload/photo/20171011/59dd66a8b6c0dff1_mid.jpg', '34岁', '163CM', '未婚', '保密', '大学本科', '浙江杭州', '悲喜才是人生。\n　　幸福与否在于你对生活的态度。\n　　善于发现生活中的美好，做人做事无愧于心，坦荡荡。\n　　皱纹阻挡不了笑容的灿烂。一直用年轻的心态面对。\n　　希望对方是一个坦荡的人，有才能，有情趣，有责任心。\n　　照片还带密码的，来信请附密码。没有邮票，请有心联系的人来信贴邮票，谢谢。', '女');
INSERT INTO `hongniang` VALUES ('381', '无情', 'Loveid:10654771', 'http://www.hongniang.com/data/upload/photo/20171011/59dd66a8954f2_mid.jpg', '28岁', '167CM', '未婚', '保密', '高中及以下', '浙江杭州', '我喜欢的婚姻生活是这样的：两个人有各自热爱的事业，工作结束回家腻歪在沙发上，陪孩子或看电视，一起做饭，一起打扫房间，彼此微笑，晚上抱着睡去，早上彼此吻别去工作，一起旅行，一起看电影，一起逛街，有什么话首先会对彼此说起。简简单单，干干净净，如刚洗过的白衬衫。这样婚姻很难做到', '女');
INSERT INTO `hongniang` VALUES ('382', 'Caresse', 'Loveid:10654470', 'http://www.hongniang.com/data/upload/photo/20171010/59dc15bf87d5c_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15bf87d5cff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15bf87d5cff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15bf87d5cff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15bf87d5cff4_mid.jpg', '30岁', '164CM', '未婚', '保密', '高中及以下', '浙江杭州', '想遇到一个靠谱的人，开始一段靠谱的恋爱，收获一段靠谱的感情！面包我可以自己挣，你给我很多很多的爱就好！', '女');
INSERT INTO `hongniang` VALUES ('383', '卢小小', 'Loveid:10654773', 'http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171011/59dd66aa1c191_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171011/59dd66aa1c191ff1_mid.jpg', '28岁', '162CM', '未婚', '保密', '硕士', '浙江杭州', '985本硕，性格独立，比较理性\n　　现在在国企工作，程序员，工作基本不加班。 \n　　对ACG比较感兴趣，也会看看一些英剧。有点宅，平时一般健健身，做做饭。', '女');
INSERT INTO `hongniang` VALUES ('384', 'ＩＦ', 'Loveid:10654774', 'http://www.hongniang.com/data/upload/photo/20171011/59dd66aa3cf14_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66aa3cf14ff1_mid.jpg', '32岁', '160CM', '未婚', '保密', '大专', '浙江杭州', '我喜欢旅游。我在业余时间最大的消遣是看韩剧。我憧憬的生活是安定。我希望我未来的另一半最好是沉稳。真心希望在这里能遇到我的那个TA!', '女');
INSERT INTO `hongniang` VALUES ('385', '那一抹灿烂的阳光', 'Loveid:10654738', 'http://www.hongniang.com/data/upload/photo/20171011/59dd669d54b76_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd669d54b76ff1_mid.jpg', '26岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '也许我很平凡，但是我绝不缺乏生活的热情和生命的梦想，也许我会孤单，但是我会一路找寻你的踪迹。遇见你，将是我生命中最绚烂的时刻。', '女');
INSERT INTO `hongniang` VALUES ('386', '有风的日子', 'Loveid:10654739', 'http://www.hongniang.com/data/upload/photo/20171011/59dd669d77ac0_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd669d77ac0ff1_mid.jpg', '21岁', '164CM', '未婚', '保密', '大专', '浙江杭州', '喜欢一个人是种感觉，不喜欢一个人却是事实。事实容易解释，感觉却难以言喻。爱情中我相信感觉，如果他出现，我会第一时间抽他两巴掌，要问问，这些年，你死哪里去了，为什么不早出现…….然后抱着他痛哭一场。', '女');
