INSERT INTO `hongniang` VALUES ('391', '山西珠珠', 'Loveid:10654584', 'http://www.hongniang.com/data/upload/photo/20171010/59dc329574c43_mid.png,http://www.hongniang.com/data/upload/photo/20171010/59dc33d6c278a_mid.png', '30岁', '165CM', '未婚', '1-5万元', '中专', '广东深圳', '以前为了学习老妈不让谈恋爱，现在为了工作没时间恋爱，随着时间的推移，自己发现已经步入“剩女”的行列，其实自己对另一半的要求也不是很高，可以不是很帅，可以不是很富有，但是一定要有上进心，责任心，能够孝顺老人家也就差不多了。我对未来有很多憧憬和希望，但愿能和心爱的人一起实现.....', '女');
