INSERT INTO `hongniang` VALUES ('401', '一往情深深几许', 'Loveid:10654749', 'http://www.hongniang.com/data/upload/photo/20171011/59dd66a1080cf_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66a1080cfff1_mid.jpg', '24岁', '169CM', '未婚', '保密', '高中及以下', '浙江杭州', '我是一个开朗的人 ，关于外貌，简单形容就是唇红齿白,身材匀称，我的工作属于医务工作者，我现在的生活状态和心情，可以说是“平平淡淡”。', '女');
INSERT INTO `hongniang` VALUES ('402', '小小', 'Loveid:10654443', 'http://www.hongniang.com/data/upload/photo/20171010/59dc15a8b4b92_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15a8b4b92ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15a8b4b92ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15a8b4b92ff3_mid.jpg', '26岁', '168CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个大大咧咧,纯真,温柔,开朗的人 ，爱好广泛的我，喜欢电影,旅行。', '女');
INSERT INTO `hongniang` VALUES ('403', '雨镇冲散', 'Loveid:10654751', 'http://www.hongniang.com/data/upload/photo/20171011/59dd66a1380ce_mid.jpg', '28岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '不为结婚为目的的恋爱都是耍流氓，请你们打开心灵里面的那扇窗，让我闯进你的心灵之窗。', '女');
INSERT INTO `hongniang` VALUES ('404', '乐乐', 'Loveid:10654753', 'http://tie.hongniang.com/data/upload/photo/20171011/59dd66a2c351c_mid.jpg,http://tie.hongniang.com/data/upload/photo/20171011/59dd66a2c351cff1_mid.jpg', '24岁', '167CM', '未婚', '保密', '大专', '浙江杭州', '我想有这么一个男人，他不一定很高很帅，但是会让我把以后的时光放心的交给他；他不一定很有钱，但是会让我每天回家后吃上热热的饭菜；他不一定会很早计划好我们的未来，但是会在某天深情的对我说，我最爱的丫头，我们是时候该有个家......', '女');
INSERT INTO `hongniang` VALUES ('405', '杨莹阿', 'Loveid:10654445', 'http://www.hongniang.com/data/upload/photo/20171010/59dc15aa7712f_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15aa7712fff1_mid.jpg', '27岁', '163CM', '未婚', '保密', '大专', '浙江杭州', '希望在一起的每一对情侣都好好的 希望所有努力过的感情都不被辜负 从热恋到磨合再到长久是一件很不容易的事 里面难免有争吵有烦躁 可能感情会越来越平淡 也会无话不说到无话可说 会有新鲜感也会有难熬 毕竟在一起都是从不合适到合适 每个人的性格都不一样没有一下子的一见钟情 也没有从不吵架从不闹矛盾 互相磨合互相体谅互相理解互相包容互相信任 所有感情都应该认真对待 能在一起的就别轻易分开了', '女');
INSERT INTO `hongniang` VALUES ('406', '执着', 'Loveid:10654754', 'http://www.hongniang.com/data/upload/photo/20171011/59dd66a30d126_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66a30d126ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66a30d126ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171011/59dd66a30d126ff3_mid.jpg', '29岁', '168CM', '未婚', '保密', '大学本科', '浙江杭州', '有一种美酒，一小滴就叫人回味；有一种音乐，一小段就叫人陶醉；有一种人，一认识就让你感到温馨和信赖，那就是你！', '女');
INSERT INTO `hongniang` VALUES ('407', '茉莉花开', 'Loveid:10654446', 'http://www.hongniang.com/data/upload/photo/20171010/59dc15aab04e2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15aab04e2ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15aab04e2ff2_mid.jpg', '27岁', '161CM', '未婚', '保密', '大学本科', '浙江杭州', '外向，喜欢读书，爱好摄影。因为骨子里边有些文艺，希望自己未来的一半温文尔雅，我不是很优秀也不算很漂亮，享受着平淡的人生。注册，完全因为好奇心。', '女');
