INSERT INTO `hongniang` VALUES ('411', '次回予告---', 'Loveid:10654455', 'http://www.hongniang.com/data/upload/photo/20171010/59dc15af08241_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15af08241ff1_mid.jpg', '24岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '希望，有一份不沉闷的工作，在不是很老的年纪，遇见一个人，谈一场不慌不忙的恋爱，有一个不吵不闹的婚礼，生一个可爱的宝宝，平平安安的，度过我不算糟糕的一生……', '女');
