INSERT INTO `hongniang` VALUES ('413', 'dark angel', 'Loveid:10654458', 'http://www.hongniang.com/data/upload/photo/20171010/59dc15ba45e97_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15ba45e97ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15ba45e97ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15ba45e97ff3_mid.jpg', '35岁', '166CM', '未婚', '保密', '硕士', '浙江杭州', '喜欢跳舞，宅女。\n　　相信在世界的某个角落总会有一个人在等我。\n　　执子之手，与之偕老。', '女');
INSERT INTO `hongniang` VALUES ('414', '白纱裙*琼', 'Loveid:10654459', 'http://www.hongniang.com/data/upload/photo/20171010/59dc15ba9718e_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15ba9718eff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15ba9718eff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15ba9718eff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15ba9718eff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15ba9718eff5_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15ba9718eff6_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15ba9718eff7_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15ba9718eff8_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15ba9718eff9_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15ba9718eff10_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15ba9718eff11_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15ba9718eff12_mid.jpg', '26岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '用心，真心，对待每一天，即使有不开心，即使有难过，即使有心碎，但是明天的阳光还是会照亮黑夜，无论刮风还是下雨，人生就像一场戏，谁走入了谁的世界，谁又离开了，谁最后陪伴谁度过了余生。一切虽然是命运的安排，但一切也都把握在自己的手里。', '女');
INSERT INTO `hongniang` VALUES ('415', '喵喵喵', 'Loveid:10654444', 'http://www.hongniang.com/data/upload/photo/20171010/59dc15aa31b0b_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15aa31b0bff1_mid.jpg', '24岁', '162CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个靠谱,善良,简单,孝顺,体贴,宅的人 ，爱好广泛的我，喜欢追剧，我有些特长：特别能睡， 是不是很有趣呢？说说我的工作，我工作在知名企业，我现在的生活状态和心情，可以说是“奋斗中”。', '女');
INSERT INTO `hongniang` VALUES ('416', '水月', 'Loveid:10654461', 'http://www.hongniang.com/data/upload/photo/20171010/59dc15bb4b9d0_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15bb4b9d0ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15bb4b9d0ff2_mid.jpg', '29岁', '168CM', '未婚', '保密', '大学本科', '浙江杭州', '我是个比较宅的女孩子，就是那种周末呆在家一整天都不出屋那种，我家里人说所以活该我单身咯，注册这个也是碰碰运气吧，虽然觉得应该没啥可能，但是，谁知道呢，试试呗，说不定就有一个刚好跟我一样撞运气的呢。\n　　我不要求找个高富帅，就想找个阳光、开朗的，愿意包容我的一切，能喜欢我的优点，也能接受我的缺点，控制欲太强的亲们就请将我pass掉吧，因为我比较喜欢独立自由，不喜欢被人过分的约束。当然虽说不要求大富大贵，但至少能养活的了我哦，虽然我自己也能养活我自己，但是万一哪天我失业了呢，呵呵。\n　　哎，其实说实话我还是觉得网上交友蛮神奇的，感觉都不知道怎么沟通的呢~', '女');
INSERT INTO `hongniang` VALUES ('417', '吕梦海', 'Loveid:10654416', 'http://www.hongniang.com/data/upload/photo/20171010/59dc1599d475a_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1599d475aff1_mid.jpg', '26岁', '155CM', '未婚', '保密', '大学本科', '浙江杭州', '好的爱情可以让双方不断努力，不断成长，不断进步！', '女');
INSERT INTO `hongniang` VALUES ('418', '好像忘了呢', 'Loveid:10654447', 'http://hongniang.com/data/upload/photo/20171010/59dc15ab0ef4d_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc15ab0ef4dff1_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc15ab0ef4dff2_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc15ab0ef4dff3_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc15ab0ef4dff4_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc15ab0ef4dff5_mid.jpg', '26岁', '160CM', '未婚', '保密', '高中及以下', '浙江杭州', '如果你花心，请别近入我的花园。如果你假意，请别进入我的世界。如果我们的文字能会意，那么请珍惜缘分。如果你能读懂我的内心世界，我会恋上你，为你，我什么都愿意。', '女');
INSERT INTO `hongniang` VALUES ('419', '凌芝雪莲', 'Loveid:10654417', 'http://www.hongniang.com/data/upload/photo/20171010/59dc159a206db_mid.jpg', '27岁', '161CM', '未婚', '保密', '硕士', '浙江杭州', '我是一个诚信,顾家,善良,纯真,温柔的人 ，爱好广泛的我，喜欢跳舞,运动,麦霸，是个不折不扣的萌妹纸，关于外貌，简单形容就是身材匀称。', '女');
INSERT INTO `hongniang` VALUES ('420', '沐月', 'Loveid:10654418', 'http://www.hongniang.com/data/upload/photo/20171010/59dc159a425c4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc159a425c4ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc159a425c4ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc159a425c4ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc159a425c4ff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc159a425c4ff5_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc159a425c4ff6_mid.jpg', '27岁', '163CM', '未婚', '保密', '大专', '浙江杭州', '我是一个孝顺,顾家,开朗,细心的人 ，爱好广泛的我，喜欢旅行，说说我的工作，我工作在自己创业。', '女');
INSERT INTO `hongniang` VALUES ('421', '哦哈', 'Loveid:10654419', 'http://www.hongniang.com/data/upload/photo/20171010/59dc159aa041f_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc159aa041fff1_mid.jpg', '28岁', '162CM', '未婚', '保密', '大学本科', '浙江杭州', '立冬。 小雪。 大雪。 冬至。 小寒。 大寒。 \n　　在无法遇见第二个寂寞的人的寂寞冬天。 \n　　独自行走独自唱歌独自逛街独自看着一整个世界狂欢。 \n　　人们手牵手地逛着游乐园。 \n　　他是她的独一。 我是所有人的无二。 \n　　世界布满了我们相遇的几率。 \n　　我却始终无法遇见你。', '女');
INSERT INTO `hongniang` VALUES ('422', '妞妞2017', 'Loveid:10654453', 'http://www.hongniang.com/data/upload/photo/20171010/59dc15ad2fc44_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15ad2fc44ff1_mid.jpg', '36岁', '160CM', '未婚', '保密', '大专', '浙江杭州', '我是一个开朗,乐观,宅,简单,独立的人 ，关于外貌，简单形容就是苗条,身材匀称,时尚，我现在的生活状态和心情，可以说是“平平淡淡”。', '女');
