INSERT INTO `hongniang` VALUES ('425', '损星', 'Loveid:10654457', 'http://hongniang.com/data/upload/photo/20171010/59dc15af80c9d_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc15af80c9dff1_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc15af80c9dff2_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc15af80c9dff3_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc15af80c9dff4_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc15af80c9dff5_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc15af80c9dff6_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc15af80c9dff7_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc15af80c9dff8_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc15af80c9dff9_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc15af80c9dff10_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc15af80c9dff11_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc15af80c9dff12_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59d', '32岁', '167CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个执着,独立,乐观的人 ，爱好广泛的我，喜欢瑜伽,旅行,运动。', '女');
INSERT INTO `hongniang` VALUES ('426', '朱因', 'Loveid:10654460', 'http://marry.hongniang.com/data/upload/photo/20171010/59dc15bb0dbba_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171010/59dc15bb0dbbaff1_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171010/59dc15bb0dbbaff2_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171010/59dc15bb0dbbaff3_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171010/59dc15bb0dbbaff4_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171010/59dc15bb0dbbaff5_mid.jpg', '26岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '朋友说我离开地球太久了，所以想试试丰富一下自己的社交吧，多认识一些人。很慢热，就算是交朋友也跟不上很快的节奏。人跟人之间关系变亲密也需要一个过程，起码得互相有好感和共同的兴趣而且要聊得来吧。婚姻不是买菜，不是你说什么时候就什么时候买的，那些一上来就说我打算明年结婚，你考虑好的人，我觉得我们三观可能是不一样的。', '女');
