INSERT INTO `hongniang` VALUES ('429', 'yYOUnon1', 'Loveid:10654430', 'http://www.hongniang.com/data/upload/photo/20171010/59dc159eb337b_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc159eb337bff1_mid.jpg', '25岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个正直的人 ，我有些特长：力大无穷， 是不是很有趣呢？我生长在一个三口之家，我爱我家人，他们也爱我。', '女');
INSERT INTO `hongniang` VALUES ('430', '水色胭脂香满楼', 'Loveid:10654431', 'http://www.hongniang.com/data/upload/photo/20171010/59dc159eeffbf_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc159eeffbfff1_mid.jpg', '23岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '生命中，不断的有人离开或进入，看见的、看不见的，记住的、遗忘的；生命中，不断的有得失和失落，看不见的、看见的；遗忘的、记住的。但我希望有你在生命里。我或许不温柔、脾气不好、容易吃醋、容易心痛、容易胡思乱想、很任性、生气时不想说话、开心了会一直傻笑、受委屈会放在心里，但是我希望一个细微动作，一个飘忽眼神，抑或是一个转身的距离，相爱的人应该有着缘分的默契，找一个爱我懂我的人，与他一起漫步，与他一起读诗，共享人世繁华。', '女');
INSERT INTO `hongniang` VALUES ('431', '右尹', 'Loveid:10654432', 'http://www.hongniang.com/data/upload/photo/20171010/59dc159f4f93c_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc159f4f93cff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc159f4f93cff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc159f4f93cff3_mid.jpg', '22岁', '163CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个简单的人 ，关于外貌，简单形容就是大眼睛,微胖。', '女');
INSERT INTO `hongniang` VALUES ('432', '￡单只↘蝴蝶彡', 'Loveid:10654433', 'http://www.hongniang.com/data/upload/photo/20171010/59dc159fa7d7e_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc159fa7d7eff1_mid.jpg', '27岁', '164CM', '未婚', '保密', '大学本科', '浙江杭州', '做一个简单的人，走一段幸福的路。希望他睿智上进、平和宽容，能在同一水平线上交流，能一起细水长流地度过余生。', '女');
INSERT INTO `hongniang` VALUES ('433', '晴天', 'Loveid:10654436', 'http://www.hongniang.com/data/upload/photo/20171010/59dc15a1b20f8_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15a1b20f8ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15a1b20f8ff2_mid.jpg', '30岁', '160CM', '未婚', '保密', '大专', '浙江杭州', '有一种爱，长久且让人心醉，有一种情，伤人且自伤。爱情就是两个人在一起不离不弃，执子之手，与子偕老；爱情是无私的给予，没有任何条件；爱情是没有怨恨，无畏的等待。', '女');
