INSERT INTO `hongniang` VALUES ('438', '莉莉周', 'Loveid:10654439', 'http://www.hongniang.com/data/upload/photo/20171010/59dc15a7a2de9_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15a7a2de9ff1_mid.jpg', '26岁', '159CM', '未婚', '保密', '高中及以下', '浙江杭州', '我是一个正直,温柔的人 ，爱好广泛的我，喜欢逛街,健身,看书，我有些特长：特别能睡， 是不是很有趣呢？关于外貌，简单形容就是身材匀称，我现在的生活状态和心情，可以说是“房奴”。', '女');
INSERT INTO `hongniang` VALUES ('439', '梁温妮', 'Loveid:10654425', 'http://hongniang.com/data/upload/photo/20171010/59dc159d7ca11_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc159d7ca11ff1_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc159d7ca11ff2_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc159d7ca11ff3_mid.jpg', '27岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个温柔,靠谱,独立,善良,孝顺的人 。', '女');
INSERT INTO `hongniang` VALUES ('440', '﹏淺Sè时光つ', 'Loveid:10654428', 'http://www.hongniang.com/data/upload/photo/20171010/59dc159e43796_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc159e43796ff1_mid.jpg', '26岁', '164CM', '未婚', '保密', '大学本科', '浙江杭州', '我知道，生活不是童话，所以我不求童话般的结局，只希望拥有一个不完美但却真实的爱情故事。故事的主角：我和你。能在平凡中感受对方的心跳，就是最大的满足。', '女');
INSERT INTO `hongniang` VALUES ('441', '傻丫头', 'Loveid:10654393', 'http://www.hongniang.com/data/upload/photo/20171010/59dc159118891_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc159118891ff1_mid.jpg', '21岁', '159CM', '未婚', '保密', '大专', '浙江杭州', '是个不折不扣的美食家，关于外貌，简单形容就是漂亮，说说我的工作，我工作在外企，我的工作属于公务员，我生长在一个单亲家庭，我爱我家人，他们也爱我。', '女');
INSERT INTO `hongniang` VALUES ('442', '伊人如月', 'Loveid:10654434', 'http://test.hongniang.com/data/upload/photo/20171010/59dc15a124990_mid.jpg,http://test.hongniang.com/data/upload/photo/20171010/59dc15a124990ff1_mid.jpg,http://test.hongniang.com/data/upload/photo/20171010/59dc15a124990ff2_mid.jpg,http://test.hongniang.com/data/upload/photo/20171010/59dc15a124990ff3_mid.jpg,http://test.hongniang.com/data/upload/photo/20171010/59dc15a124990ff4_mid.jpg,http://test.hongniang.com/data/upload/photo/20171010/59dc15a124990ff5_mid.jpg,http://test.hongniang.com/data/upload/photo/20171010/59dc15a124990ff6_mid.jpg,http://test.hongniang.com/data/upload/photo/20171010/59dc15a124990ff7_mid.jpg', '28岁', '163CM', '未婚', '保密', '大专', '浙江杭州', '再丑的人也能结婚，再美的人也会单身！如果不能有结果，为何不独自把悲伤留下！咱们都是成年人，咱们有权利选取想要的，期待遇到最真诚的他！', '女');
INSERT INTO `hongniang` VALUES ('443', 'し一抹微笑゛', 'Loveid:10654399', 'http://www.hongniang.com/data/upload/photo/20171010/59dc159380dcf_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc159380dcfff1_mid.jpg', '25岁', '158CM', '未婚', '保密', '高中及以下', '浙江杭州', '我是一个粗枝大叶,温柔的人 ，爱好广泛的我，喜欢健身，是个不折不扣的学霸，我有些特长：过目不忘， 是不是很有趣呢？关于外貌，简单形容就是皮肤白皙，我生长在一个单亲家庭，我爱我家人，他们也爱我。', '女');
INSERT INTO `hongniang` VALUES ('444', '夏筱依', 'Loveid:10654400', 'http://www.hongniang.com/data/upload/photo/20171010/59dc1593c54ec_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1593c54ecff1_mid.jpg', '25岁', '158CM', '未婚', '保密', '大专', '浙江杭州', '我在等一个人，一个可以把我的寂寞画上休止符的人；一个可以陪我听遍所有悲伤的情歌却不会让我想哭的人；一个我可以在他身上找出一百个缺点却还是执意要爱的人；一个会对我说：我们有坑一起跳，有苦一起尝，有一辈子就一起过的人！', '女');
INSERT INTO `hongniang` VALUES ('445', 'Vivian', 'Loveid:10654401', 'http://www.hongniang.com/data/upload/photo/20171010/59dc15941df3c_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15941df3cff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15941df3cff2_mid.jpg', '22岁', '160CM', '未婚', '保密', '大专', '浙江杭州', '希望能和喜欢的人来一场\n　　说走就走的旅行。', '女');
INSERT INTO `hongniang` VALUES ('446', 'T T', 'Loveid:10654438', 'http://marry.hongniang.com/data/upload/photo/20171010/59dc15a25c40b_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171010/59dc15a25c40bff1_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171010/59dc15a25c40bff2_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171010/59dc15a25c40bff3_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171010/59dc15a25c40bff4_mid.jpg', '30岁', '158CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个诚信,体贴,简单,宅,文静的人 ，关于外貌，简单形容就是微胖，说说我的工作，我工作在在私企。', '女');
INSERT INTO `hongniang` VALUES ('447', '心情的温度.', 'Loveid:10654403', 'http://www.hongniang.com/data/upload/photo/20171010/59dc1594b3399_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1594b3399ff1_mid.jpg', '26岁', '163CM', '未婚', '保密', '大学本科', '浙江杭州', '真爱需要等待，但太长的等待，对爱情都是一种摧残。漫漫人生，滚滚红尘，年年岁岁花相似，岁岁年年人不同。今生等不了，就别再寄望来生。奈何桥一过，又成陌路。所以，珍惜相见，珍惜相爱，珍惜拥有，珍惜身边的人…', '女');
INSERT INTO `hongniang` VALUES ('448', '心剩半', 'Loveid:10654405', 'http://www.hongniang.com/data/upload/photo/20171010/59dc159663482_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc159663482ff1_mid.jpg', '26岁', '164CM', '未婚', '保密', '大学本科', '浙江杭州', '不要因为寂寞爱错人，更不要因为爱错人而寂寞一生，尝试信任才能得到幸福。缘分是本书，翻的不经意会错过，读的太认真会流泪。', '女');
INSERT INTO `hongniang` VALUES ('449', '落寞ω的夏天', 'Loveid:10654406', 'http://www.hongniang.com/data/upload/photo/20171010/59dc1596b6287_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1596b6287ff1_mid.jpg', '28岁', '166CM', '未婚', '保密', '大学本科', '浙江杭州', '得到了就要珍惜，珍惜现在所拥有的，莫等失去而惋惜，莫等失去而叹息！', '女');
INSERT INTO `hongniang` VALUES ('450', '宜修', 'Loveid:10654407', 'http://www.hongniang.com/data/upload/photo/20171010/59dc159707166_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc159707166ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc159707166ff2_mid.jpg', '23岁', '163CM', '未婚', '保密', '大专', '浙江杭州', '向往简简单单的生活，朋友圈不杂。我做饭你洗碗就好。', '女');
INSERT INTO `hongniang` VALUES ('451', '兜兜转转丶还是回到原点', 'Loveid:10654392', 'http://hongniang.com/data/upload/photo/20171010/59dc1590d5dce_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc1590d5dceff1_mid.jpg', '24岁', '163CM', '未婚', '保密', '大专', '浙江杭州', '爱我，要爱我一生一世；爱我，爱，只且爱我一个；爱我，必须爱我的一切缺点；爱我，必须懂我；我爱看小说，你可以不爱；我爱猜谜语，你必须配合，哪怕你不会；我爱猜谜语，如果你会，你要装不会，但是最后要会。', '女');
INSERT INTO `hongniang` VALUES ('452', '阳光女孩涵涵', 'Loveid:10654395', 'http://www.hongniang.com/data/upload/photo/20171010/59dc15929303c_mid.jpg', '24岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个文静,大大咧咧的人 ，爱好广泛的我，喜欢养猫，是个不折不扣的萌妹纸,美食家，关于外貌，简单形容就是皮肤白皙,漂亮,小酒窝。', '女');
INSERT INTO `hongniang` VALUES ('453', '果果', 'Loveid:10654397', 'http://www.hongniang.com/data/upload/photo/20171010/59dc1592e4590_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1592e4590ff1_mid.jpg', '22岁', '166CM', '未婚', '保密', '大专', '浙江杭州', '我是一个大大咧咧,靠谱,顾家的人 ，说说我的工作，我工作在在国企，我的工作属于建筑行业,公务员，我现在的生活状态和心情，可以说是“平平淡淡,努力挣钱”。', '女');
INSERT INTO `hongniang` VALUES ('454', '倾一夕思念', 'Loveid:10654398', 'http://www.hongniang.com/data/upload/photo/20171010/59dc159327461_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc159327461ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc159327461ff2_mid.jpg', '31岁', '170CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个温柔的人 ，爱好广泛的我，喜欢美食,养猫。', '女');
