INSERT INTO `hongniang` VALUES ('457', '也许早该结束', 'Loveid:10654402', 'http://www.hongniang.com/data/upload/photo/20171010/59dc159470569_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc159470569ff1_mid.jpg', '25岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '爱是责任，爱是一辈子的承诺，爱是相互的扶持，有伟大的爱情，有轰轰烈烈的爱情，然而，我从来就相信爱情应该渗透在生活中的点点滴滴，关心，鼓励，两个人不离不弃，平凡而不平淡，浪漫温馨。', '女');
INSERT INTO `hongniang` VALUES ('458', '晓晓', 'Loveid:10654367', 'http://www.hongniang.com/data/upload/photo/20171010/59dc1582ecdc3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1582ecdc3ff1_mid.jpg', '29岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '朋友们都说我性格不通人情、不懂世故、小任性、想的开、忘得快、，爱好手机、电脑、睡觉、K歌、逛街、发呆，我憧憬平静、安宁、无风无雨一般的生活，希望对方是一个我是长不大的孩子，需要人来教导……的男孩，我期待与你一起走过这段人生的历程，一起分享生活的酸甜苦涩。', '女');
INSERT INTO `hongniang` VALUES ('459', 'Tiffy', 'Loveid:10654404', 'http://test.hongniang.com/data/upload/photo/20171010/59dc15962450b_mid.jpg,http://test.hongniang.com/data/upload/photo/20171010/59dc15962450bff1_mid.jpg', '23岁', '158CM', '未婚', '保密', '大学本科', '浙江杭州', '也许世界很复杂，但我希望生活简单化，单纯化。 世界无完美的人，完美的人也看不上不完美的我。 所以，我将世界中纷繁复杂的品行在乱序中粗粗勾画，形成我所追求的那个他。 善良、包容、 才华、 幽默、 能看顺眼的外貌，以上五点的前提——相信这个世界有真爱。', '女');
INSERT INTO `hongniang` VALUES ('460', '妞妞', 'Loveid:10654368', 'http://www.hongniang.com/data/upload/photo/20171010/59dc158339ca2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc158339ca2ff1_mid.jpg', '43岁', '162CM', '未婚', '保密', '大学本科', '浙江杭州', '携子之手，与子偕老...', '女');
INSERT INTO `hongniang` VALUES ('461', 'zoe', 'Loveid:10654370', 'http://www.hongniang.com/data/upload/photo/20171010/59dc158395d9e_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc158395d9eff1_mid.jpg', '24岁', '161CM', '未婚', '保密', '大专', '浙江杭州', '我的性格比较温和，平时喜欢加班，看书，追剧什么的，我憧憬简单，充实，暖暖的一般的生活，希望对方是一个有主见，有稳定工作，顾家的男孩，缘分，是一种人与人之间无形的连结，也是某种必然相遇和无限的可能。我期待在这里遇见你。', '女');
INSERT INTO `hongniang` VALUES ('462', '欣儿', 'Loveid:10654372', 'http://www.hongniang.com/data/upload/photo/20171010/59dc15843015f_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15843015fff1_mid.jpg', '29岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个纯真,顾家,孝顺,执着,文静的人 ，爱好广泛的我，喜欢电影,逛街，关于外貌，简单形容就是大眼睛,小酒窝，说说我的工作，我工作在自己创业。', '女');
INSERT INTO `hongniang` VALUES ('463', '想你的星星会说话', 'Loveid:10654408', 'http://marry.hongniang.com/data/upload/photo/20171010/59dc15972c441_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171010/59dc15972c441ff1_mid.jpg', '26岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '快乐的日子，总是令人期待。美好的踪影，正在不远的地方，轻轻召唤，我从千里之外，遍寻你的足迹，只为了合上你的节拍，与你共度此生。', '女');
INSERT INTO `hongniang` VALUES ('464', '小姜', 'Loveid:10654373', 'http://www.hongniang.com/data/upload/photo/20171010/59dc158471b19_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc158471b19ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc158471b19ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc158471b19ff3_mid.jpg', '28岁', '157CM', '未婚', '保密', '大专', '浙江杭州', '我是一个顾家,靠谱,善良的人  ,希望找到一个能真正相互了解，希望能碰上一位心仪的对象，希望脚踏实地；做事认真负责，责任心强的那位，期待大家对我的关注，我会依依回信，看过我的简历的每一位，最后，希望大家都能找到自己心仪的那位。', '女');
INSERT INTO `hongniang` VALUES ('465', '浅夏', 'Loveid:10654376', 'http://www.hongniang.com/data/upload/photo/20171010/59dc1586a4985_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1586a4985ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1586a4985ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1586a4985ff3_mid.jpg', '27岁', '161CM', '未婚', '保密', '大学本科', '浙江杭州', '我喜欢看书。我在业余时间最大的消遣是散步、看小说。我憧憬的生活是安静、温馨、小情趣。我希望我未来的另一半最好是会照顾人、踏踏实实，有男子汉的担当。幽默风趣一点儿~~当然，我会尽全力给你最大的支持！真心希望在这里能遇到我的那个TA!', '女');
INSERT INTO `hongniang` VALUES ('466', '钭钭', 'Loveid:10654411', 'http://www.hongniang.com/data/upload/photo/20171010/59dc1597b125e_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1597b125eff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1597b125eff2_mid.jpg', '27岁', '158CM', '未婚', '保密', '大学本科', '浙江杭州', '世界上没有谁选择谁，只有谁遇到谁，所以我不选ABCD，只看着时间刚刚好的时候，出现在你面前，然后，牵着手，去哪里那里，然后，就是一辈子。', '女');
INSERT INTO `hongniang` VALUES ('467', '小溪', 'Loveid:10654377', 'http://www.hongniang.com/data/upload/photo/20171010/59dc1586ed066_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1586ed066ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1586ed066ff2_mid.jpg', '23岁', '164CM', '未婚', '保密', '高中及以下', '浙江杭州', '我是一个大大咧咧,善良,正直的人 。想找个合适的，不知道会不会朋友', '女');
INSERT INTO `hongniang` VALUES ('468', '半藏森林', 'Loveid:10654414', 'http://test.hongniang.com/data/upload/photo/20171010/59dc159983806_mid.jpg', '44岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '我喜欢古琴，手绘，瑜伽。我在业余时间最大的消遣是宅。我憧憬的生活是宅。我希望我未来的另一半最好是稳重踏实。真心希望在这里能遇到我的那个TA!', '女');
INSERT INTO `hongniang` VALUES ('469', '小珊', 'Loveid:10654415', 'http://hongniang.com/data/upload/photo/20171010/59dc1599975f0_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc1599975f0ff1_mid.jpg', '22岁', '163CM', '未婚', '保密', '大专', '浙江杭州', '我是一个粗枝大叶,可爱的人 ，我有些特长：不挑食， 是不是很有趣呢？说说我的工作，我工作在自己创业，我现在的生活状态和心情，可以说是“平平淡淡”。', '女');
INSERT INTO `hongniang` VALUES ('470', '老虎漫哒', 'Loveid:10654378', 'http://www.hongniang.com/data/upload/photo/20171010/59dc158745e92_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc158745e92ff1_mid.jpg', '31岁', '167CM', '未婚', '保密', '大专', '浙江杭州', '家应该像冰冷冬天里的一杯热茶，让人在疲惫的时候感到温暖，家应该像黑夜里鹅黄的灯光，让人知道心的那头始终有份期盼，两个人在一起，搜集一点一滴的幸福', '女');
INSERT INTO `hongniang` VALUES ('471', '薄荷', 'Loveid:10654380', 'http://www.hongniang.com/data/upload/photo/20171010/59dc1587b1ab3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1587b1ab3ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1587b1ab3ff2_mid.jpg', '26岁', '158CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个温柔,大大咧咧,独立,可爱,文静,善良,简单,宅的人 ，爱好广泛的我，喜欢电影、户外活动，大眼睛，我的工作属于教育行业。', '女');
INSERT INTO `hongniang` VALUES ('472', 'ANNE', 'Loveid:10654371', 'http://hongniang.com/data/upload/photo/20171010/59dc1583e0d25_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc1583e0d25ff1_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc1583e0d25ff2_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc1583e0d25ff3_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc1583e0d25ff4_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc1583e0d25ff5_mid.jpg', '31岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个细心,顾家,可爱,善良,简单,宅,温柔的人 ，爱好广泛的我，喜欢电影,淘宝,麦霸，是个不折不扣的美食家，关于外貌，简单形容就是大眼睛，我生长在一个高知家庭，我爱我家人，他们也爱我。', '女');
INSERT INTO `hongniang` VALUES ('473', '陈慕', 'Loveid:10654382', 'http://www.hongniang.com/data/upload/photo/20171010/59dc1588434ae_mid.jpg', '27岁', '167CM', '未婚', '保密', '大学本科', '浙江杭州', '那些要我微信不说话的人 请不要随意问微信好吗？你还需要我主动来问候你吗？你这样迟早也是被我删的人。请留个双方一点时间好吗', '女');
INSERT INTO `hongniang` VALUES ('474', '彤彤', 'Loveid:10654374', 'http://www.hongniang.com/data/upload/photo/20171010/59dc158614d13_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc158614d13ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc158614d13ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc158614d13ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc158614d13ff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc158614d13ff5_mid.jpg', '27岁', '170CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个顾家的人 ，爱好广泛的我，喜欢养猫,美食,摄影，关于外貌，简单形容就是身材匀称，我生长在一个高知家庭，我爱我家人，他们也爱我。', '女');
INSERT INTO `hongniang` VALUES ('475', '', 'Loveid:10654385', 'http://www.hongniang.com/data/upload/photo/20171010/59dc158a056de_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc158a056deff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc158a056deff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc158a056deff3_mid.jpg', '27岁', '168CM', '未婚', '保密', '大专', '浙江杭州', '这个世界本无完美的东西，为何要自寻烦恼一定要事事如意？来这世上就走一回，那么多人连个爱人都找不到，白走这一遭，特别', '女');
INSERT INTO `hongniang` VALUES ('476', '水色YOYO', 'Loveid:10654387', 'http://www.hongniang.com/data/upload/photo/20171010/59dc158f6301c_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc158f6301cff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc158f6301cff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc158f6301cff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc158f6301cff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc158f6301cff5_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc158f6301cff6_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc158f6301cff7_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc158f6301cff8_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc158f6301cff9_mid.jpg', '34岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '写信请有诚意，因为机会只有一次，我给人写信都会贴邮票，你如果连这点诚意都没有，请不要浪费时间～', '女');
INSERT INTO `hongniang` VALUES ('477', '水仙花', 'Loveid:10654375', 'http://hongniang.com/data/upload/photo/20171010/59dc15865562e_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc15865562eff1_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc15865562eff2_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc15865562eff3_mid.jpg', '43岁', '163CM', '未婚', '保密', '高中及以下', '浙江杭州', '我是一个善良,乐观,诚信,体贴的人 。希望在这平台找个爱我的疼我的伴侣！', '女');
