INSERT INTO `hongniang` VALUES ('480', '静听、忧伤', 'Loveid:10654348', 'http://www.hongniang.com/data/upload/photo/20171010/59dc157666895_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc157666895ff1_mid.jpg', '25岁', '164CM', '未婚', '保密', '大学本科', '浙江杭州', '没什么说的，来这里就是找个女朋友。找到一个她，为她停留。不再每次都孤单行走在大街，不再每天回来面对空空的冰冷墙壁，不再一个人躺在冬日寒冷的床上，也不再时刻面对亲人朋友的唠叨。你，不管在哪里，我等着！', '女');
INSERT INTO `hongniang` VALUES ('481', '纯净的水晶蓝.', 'Loveid:10654349', 'http://www.hongniang.com/data/upload/photo/20171010/59dc1576b4d9c_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1576b4d9cff1_mid.jpg', '27岁', '164CM', '未婚', '保密', '大学本科', '浙江杭州', '好好地爱一个人，好好地走过一生，这点渴望被生活所埋没，来到这里希望能遇到我爱的那个人，我会竭尽全力给你幸福。', '女');
INSERT INTO `hongniang` VALUES ('482', '微笑的力量', 'Loveid:10654381', 'http://hongniang.com/data/upload/photo/20171010/59dc1587ed4bd_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc1587ed4bdff1_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc1587ed4bdff2_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc1587ed4bdff3_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc1587ed4bdff4_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc1587ed4bdff5_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc1587ed4bdff6_mid.jpg', '38岁', '162CM', '未婚', '保密', '大专', '浙江杭州', '真想说时间都去哪了？总以为自己还年轻，总以为我还可以这样单着，可时间总是太匆匆，还么有来得及细数昨日就已经是2014年的4月了，一年的第一个季度已经就这样过去了。2014年我想要找个肩膀靠，想要牵手走到老，我想结婚了！如果你也有此想法的就来信聊聊。在佳缘上打酱油的请不要来信，我是来这里找未来老公的；没有照片的不要来信，这说明你也没有诚心来找；不在杭州不想留在杭州的不要来信，我不喜欢异地恋，我是真诚的想要寻找婚姻伴侣，期待你的来信和真诚的沟通。我没有邮票看不了信，如果你发的信我看不了就不要发了。', '女');
INSERT INTO `hongniang` VALUES ('483', '痴心永恒', 'Loveid:10654383', 'http://hongniang.com/data/upload/photo/20171010/59dc1588668c8_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc1588668c8ff1_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc1588668c8ff2_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc1588668c8ff3_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc1588668c8ff4_mid.jpg', '31岁', '155CM', '未婚', '保密', '大专', '浙江杭州', '10年起 我在杭州国企上班是毕业后第一份工作。我喜欢唱歌睡觉旅游上网等。我憧憬的生活是相扶相持，互疼互爱，携手一生，不离不弃。br /br /我希望我未来的另一半最好是脾气好，有潜力，孝顺，有责任心，精明，能干。非诚勿扰，谢谢。', '女');
INSERT INTO `hongniang` VALUES ('484', '斜阳下45°微笑╮', 'Loveid:10654350', 'http://www.hongniang.com/data/upload/photo/20171010/59dc1576ed6cc_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1576ed6ccff1_mid.jpg', '27岁', '164CM', '未婚', '保密', '大学本科', '浙江杭州', '我喜欢旅游,看电影，听音乐。我希望我未来的另一半性格最好是开朗，懂生活。真心希望在这里能遇到我的那个TA!非诚勿扰', '女');
INSERT INTO `hongniang` VALUES ('485', '软妹', 'Loveid:10654351', 'http://www.hongniang.com/data/upload/photo/20171010/59dc157c35484_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc157c35484ff1_mid.jpg', '23岁', '163CM', '未婚', '保密', '大学本科', '浙江杭州', '我喜欢玩游戏。我在业余时间最大的消遣是逛街。我憧憬的生活是有一个幸福的家庭。我希望我未来的另一半最好是对我好。真心希望在这里能遇到我的那个TA!', '女');
INSERT INTO `hongniang` VALUES ('486', '丹妮', 'Loveid:10654386', 'http://www.hongniang.com/data/upload/photo/20171010/59dc158f2b3c5_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc158f2b3c5ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc158f2b3c5ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc158f2b3c5ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc158f2b3c5ff4_mid.jpg', '35岁', '160CM', '未婚', '保密', '大专', '浙江杭州', '这样的女孩你喜欢吗？这就是我！性格简简单单的女孩！---尽管历经了许多坎坷，心里仍然装满了童话。勤快爱干净的女孩！----下下厨，做做饭。我喜欢偶尔给自己一点惊喜！快乐的女孩！----阳光沙滩神马的我最喜欢了！一点点小事情也可以很开心！我期待的你：你应该离我很近。也许就在等候车的时候遇见你。也许在外遛狗的时候遇见你。也许在吃晚饭的路上遇见你。你一定是个有修养的人，一定具备孝顺，忠诚，有责任心这些基本优点。我努力的等待！我总能遇到你！我的你 成熟稳重，收入不算太高，但是养活一个小家没问题。我的你比我高出半个头，牵我的手，是那么多温柔。我的你，懂我！疼我！懂得在我最孤独的时候守护着我。我在杭州市区工作，希望对方最好在杭州，不接受异地恋。', '女');
INSERT INTO `hongniang` VALUES ('487', '呆橙@', 'Loveid:10654352', 'http://www.hongniang.com/data/upload/photo/20171010/59dc157c7a77e_mid.jpg', '26岁', '175CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个大大咧咧的人 ，爱好广泛的我，喜欢健身,听歌。', '女');
INSERT INTO `hongniang` VALUES ('488', '木槿', 'Loveid:10654388', 'http://hongniang.com/data/upload/photo/20171010/59dc158fe16b0_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc158fe16b0ff1_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc158fe16b0ff2_mid.jpg', '29岁', '158CM', '未婚', '保密', '大专', '浙江杭州', '一个处女座的设计师,喜欢看书,比较宅..', '女');
INSERT INTO `hongniang` VALUES ('489', 'jinshunzi', 'Loveid:10654344', 'http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171010/59dc1575716c7_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171010/59dc1575716c7ff1_mid.jpg', '21岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '天空飘着云还有梦，看冬天的雪越来越远，咫尺天涯，一个温柔善良的女人，能等到你的到来吗？能否能给我个温暖的怀抱，让我飘泊的心灵能寻找到家。以后的岁月，我愿长伴你左右，风雨共度。与你相亲相爱、相依相守。', '女');
INSERT INTO `hongniang` VALUES ('490', '゛梦晓ヶ微光ヅ倾城', 'Loveid:10654345', 'http://www.hongniang.com/data/upload/photo/20171010/59dc1575ae36a_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1575ae36aff1_mid.jpg', '25岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '我喜欢玩，旅游。我在业余时间最大的消遣是玩电脑。我憧憬的生活是自由。我希望我未来的另一半最好是温和善良长像过的去。真心希望在这里能遇到我的那个TA!、', '女');
INSERT INTO `hongniang` VALUES ('491', 'Silence*缄默', 'Loveid:10654346', 'http://www.hongniang.com/data/upload/photo/20171010/59dc1575e9d41_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1575e9d41ff1_mid.jpg', '26岁', '163CM', '未婚', '保密', '大学本科', '浙江杭州', '蓝天、白云、阳光、沙滩、大海、春暖花开 ，开始寻找那个他，那个可以和我一起，带着相机，迎着阳光去看春暖花开的人！可以在我们的记忆里有阳光、沙滩、椰子树、夕阳西下、还有彼此', '女');
INSERT INTO `hongniang` VALUES ('492', '杨小鱼', 'Loveid:10654359', 'http://www.hongniang.com/data/upload/photo/20171010/59dc157f4fcd5_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc157f4fcd5ff1_mid.jpg', '22岁', '163CM', '未婚', '保密', '大专', '浙江杭州', '我是一个独立的人 ，是个不折不扣的女强人，关于外貌，简单形容就是小酒窝，说说我的工作，我工作在在私企，我现在的生活状态和心情，可以说是“有点寂寞”。', '女');
INSERT INTO `hongniang` VALUES ('493', 'Iris', 'Loveid:10654361', 'http://www.hongniang.com/data/upload/photo/20171010/59dc157ff14d5_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc157ff14d5ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc157ff14d5ff2_mid.jpg', '30岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '爱好广泛的我，喜欢瑜伽,画画,音乐会,看书。前半生总以为缘分自己会来，月老定不会忘记任何人，每个人的姻缘定是不会断线的，然后时间用事实告诉我，我错了；后半生，我想努力试试，尽力去找你，那个对的，适合的，只要彼此在，就是心安的你\n　　ps：我么有看信邮票~~~邮件略多不知道该为哪封信付费~~', '女');
INSERT INTO `hongniang` VALUES ('494', '琳琳', 'Loveid:10654362', 'http://www.hongniang.com/data/upload/photo/20171010/59dc158051f23_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc158051f23ff1_mid.jpg', '25岁', '162CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个可爱,体贴的人 ，爱好广泛的我，喜欢音乐会。', '女');
INSERT INTO `hongniang` VALUES ('495', '希望', 'Loveid:10654363', 'http://www.hongniang.com/data/upload/photo/20171010/59dc15808e7e7_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15808e7e7ff1_mid.jpg', '28岁', '158CM', '未婚', '保密', '大学本科', '浙江杭州', '希望找到那个能白头到老的人，一但牵手，永不分离', '女');
INSERT INTO `hongniang` VALUES ('496', '找对象', 'Loveid:10654365', 'http://www.hongniang.com/data/upload/photo/20171010/59dc1582293ce_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1582293ceff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1582293ceff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1582293ceff3_mid.jpg', '25岁', '170CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个粗枝大叶,大大咧咧,善良,顾家,体贴,乐观的人 。', '女');
INSERT INTO `hongniang` VALUES ('497', '云想衣裳', 'Loveid:10654158', 'http://www.hongniang.com/data/upload/photo/20171010/59dc151d32fda_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc151d32fdaff1_mid.jpg', '33岁', '158CM', '未婚', '保密', '大专', '浙江杭州', '我，安静，很安静，喜欢独处，\n　　我，内向，不喜社交，\n　　我，心灵手巧，记忆力超强，\n　　我，端庄，未婚无孩，样貌年轻秀气，经济稍差，无负担，\n　　我，觉得征婚不是徐志摩和林徽因的诗情画意，而是林徽因和梁思成的实实在在，\n　　想找没有孩子的男士，希望对方有经济基础，有一技之长。\n　　很想有家，有自己的孩子，有了归宿在尘世不觉得孤单。\n　　老派的思想，觉得女子无才便是德，觉得是贤妻良母相夫教子类型。\n　　父母在，不远游，游必有方。', '女');
INSERT INTO `hongniang` VALUES ('498', '最繁华时最悲凉', 'Loveid:10654353', 'http://marry.hongniang.com/data/upload/photo/20171010/59dc157c9bb17_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171010/59dc157c9bb17ff1_mid.jpg', '35岁', '164CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个开朗,诚信,靠谱的人 。', '女');
INSERT INTO `hongniang` VALUES ('499', '雨夜花べ', 'Loveid:10654354', 'http://test.hongniang.com/data/upload/photo/20171010/59dc157de8d59_mid.jpg,http://test.hongniang.com/data/upload/photo/20171010/59dc157de8d59ff1_mid.jpg', '26岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '我深深相信，会有那么一个人用尽全力爱上我的全部。我的哭，我的笑，我的任性，我的温柔，我的依赖，我的自私，我的天真，我的粗心，我的疯狂，我的安静，还有我同样用尽全力爱上你的全部的那颗心。', '女');
INSERT INTO `hongniang` VALUES ('500', '幽兰1027', 'Loveid:10654355', 'http://marry.hongniang.com/data/upload/photo/20171010/59dc157e39246_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171010/59dc157e39246ff1_mid.jpg', '24岁', '165CM', '未婚', '保密', '高中及以下', '浙江杭州', '爱好广泛的我，喜欢跳舞,美食，说说我的工作，我工作在知名企业，我的工作属于建筑行业，我现在的生活状态和心情，可以说是“单身求解救”。', '女');
INSERT INTO `hongniang` VALUES ('501', '心弋', 'Loveid:10654161', 'http://www.hongniang.com/data/upload/photo/20171010/59dc151dc86fa_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc151dc86faff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc151dc86faff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc151dc86faff3_mid.jpg', '30岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '拥有梦想只是一种智力，而实现梦想才是一种能力。\n　　也许…', '女');
INSERT INTO `hongniang` VALUES ('502', '小样', 'Loveid:10654356', 'http://marry.hongniang.com/data/upload/photo/20171010/59dc157e74821_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171010/59dc157e74821ff1_mid.jpg', '19岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个靠谱,顾家,纯真的人 ，爱好广泛的我，喜欢听歌。', '女');
INSERT INTO `hongniang` VALUES ('503', '千岛湖', 'Loveid:10654328', 'http://www.hongniang.com/data/upload/photo/20171010/59dc156e95a78_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc156e95a78ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc156e95a78ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc156e95a78ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc156e95a78ff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc156e95a78ff5_mid.jpg', '28岁', '164CM', '未婚', '保密', '大专', '浙江杭州', '大家好，我是杭州千岛湖人,家里还有个姐姐，在医院工作早已结婚。爸爸妈妈农民，跟随姐姐生活。本人目前在建德工作。我是一个善良，感性，独立、开朗的女孩，希望将来过安定、温馨的生活。对于我的另一半，我希望他爱我和我的家人，就像我爱他的家人一样，还希望他像棵大树一样能为我这颗小草遮风避雨。至于以后在哪个城市生活，我随另一半，他在哪，家就在哪。我不喜欢双城生活，因为我是个小女人。\n　　谢谢大家的关心，再见。', '女');
INSERT INTO `hongniang` VALUES ('504', '哈尼', 'Loveid:10654329', 'http://www.hongniang.com/data/upload/photo/20171010/59dc156f080b7_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc156f080b7ff1_mid.jpg', '25岁', '163CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个大大咧咧,开朗,孝顺的人 ，我的工作属于金融业。', '女');
INSERT INTO `hongniang` VALUES ('505', '唯唯小喵喵', 'Loveid:10654364', 'http://www.hongniang.com/data/upload/photo/20171010/59dc158206861_mid.jpg', '25岁', '161CM', '未婚', '保密', '大学本科', '浙江杭州', '有缘自会相见。能给过吗', '女');
INSERT INTO `hongniang` VALUES ('506', '粉色的回忆℡', 'Loveid:10654332', 'http://www.hongniang.com/data/upload/photo/20171010/59dc156facd5d_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc156facd5dff1_mid.jpg', '26岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '冷了，给自己加件外套；饿了，给自己买个面包；病了，给自己开个药单；失败了，给自己一个安慰。是啊，我总是一个人，受够了一个人的生活。我不想再给自己披上那件坚强的外套，我承认自己其实并不坚强。期待一位跟我一样并不坚强的伴侣，因为只有两个人相互扶持才能真正的坚强着。', '女');
INSERT INTO `hongniang` VALUES ('507', '快乐', 'Loveid:10654366', 'http://marry.hongniang.com/data/upload/photo/20171010/59dc1582798a7_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171010/59dc1582798a7ff1_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171010/59dc1582798a7ff2_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171010/59dc1582798a7ff3_mid.jpg', '30岁', '158CM', '未婚', '保密', '大学本科', '浙江杭州', '那些等待化了思念，说不清楚已经累积了多少。从桃花开，到李花落。只记得今早的鹊儿报了喜讯。不是那熟悉的清湖畔， 不是那绿油油的稻田旁。不是坐在机杼前。也不是站在柴门前翘首以望等你归来。', '女');
INSERT INTO `hongniang` VALUES ('508', '疯狂佳人', 'Loveid:10654333', 'http://www.hongniang.com/data/upload/photo/20171010/59dc157009125_mid.jpg', '23岁', '162CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个文静,诚信,执着的人 。', '女');
INSERT INTO `hongniang` VALUES ('509', 'シ夜雨紛紛', 'Loveid:10654335', 'http://www.hongniang.com/data/upload/photo/20171010/59dc1571a8b91_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1571a8b91ff1_mid.jpg', '27岁', '164CM', '未婚', '保密', '大学本科', '浙江杭州', '诚盼和有缘的你相识，并共同走到一起。幸福，我相信，是要靠两个人共同争取的。最开始需要的，就是一份坦诚和勇气。这也是我写下这些话的原因。', '女');
INSERT INTO `hongniang` VALUES ('510', '小人物', 'Loveid:10654159', 'http://www.hongniang.com/data/upload/photo/20171010/59dc151d508c4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc151d508c4ff1_mid.jpg', '27岁', '166CM', '未婚', '保密', '大学本科', '浙江杭州', '我喜欢瑜伽 理财。我在业余时间最大的消遣是理财。我憧憬的生活是一起看海。真心希望在这里能遇到我的那个TA!', '女');
INSERT INTO `hongniang` VALUES ('511', '捂耳听风灬', 'Loveid:10654337', 'http://www.hongniang.com/data/upload/photo/20171010/59dc157218449_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc157218449ff1_mid.jpg', '26岁', '164CM', '未婚', '保密', '大学本科', '浙江杭州', '网络？确实有时不真实，但总有一部分人群是为生活抱有希望和诚恳的人，不是来玩的，希望遇到有缘人！', '女');
INSERT INTO `hongniang` VALUES ('512', '猫姐', 'Loveid:10654162', 'http://hongniang.com/data/upload/photo/20171010/59dc151e02e72_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc151e02e72ff1_mid.jpg', '23岁', '158CM', '未婚', '保密', '大学本科', '浙江杭州', '如果一件东西，踮起脚就能够着了，你就去够；如果站在那里不断的使劲跳起来也还是够不着，那就别够了，没必要把自己搞的那么累。爱情，亦是如此吧。凡事要看开一些，看透一些，什么都在失去，什么都留不住，唯有当下的快乐与幸福最真实。', '女');
INSERT INTO `hongniang` VALUES ('513', 'sweetlover', 'Loveid:10654163', 'http://marry.hongniang.com/data/upload/photo/20171010/59dc151e30a16_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171010/59dc151e30a16ff1_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171010/59dc151e30a16ff2_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171010/59dc151e30a16ff3_mid.jpg', '27岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '好想有个人，在我难过的时候，能把他的肩膀借给我；好想有个人，在我每次痛哭流涕时，给我擦鼻涕；好想有个人，在我每次摔倒时抻出双手把我扶起；好想有个人，在我时刻需要的他时候，会出现在我生命里。', '女');
INSERT INTO `hongniang` VALUES ('514', '爱美人', 'Loveid:10654339', 'http://www.hongniang.com/data/upload/photo/20171010/59dc1572daafd_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1572daafdff1_mid.jpg', '24岁', '162CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个善良,细心,宅的人 。', '女');
INSERT INTO `hongniang` VALUES ('515', '△柠檬之夏', 'Loveid:10654340', 'http://www.hongniang.com/data/upload/photo/20171010/59dc157338f29_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc157338f29ff1_mid.jpg', '26岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '一个人的生活也是挺好的，只是很好奇，两个人的日子是不是也很让人期待呢~', '女');
INSERT INTO `hongniang` VALUES ('516', '木木', 'Loveid:10654341', 'http://www.hongniang.com/data/upload/photo/20171010/59dc157397f1a_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc157397f1aff1_mid.jpg', '24岁', '167CM', '未婚', '保密', '高中及以下', '浙江杭州', '我想要一份纯粹的爱情，很难。放不下骄傲，放不下身段，参杂太多人太多事，彼此撑着，最后以“爱不起”、“不适合”收场。陪我们走到最后的人，也许算不上是我们最爱的，但会是最合适的。这样也很好，不是吗？人生本不完美，也许懂得知足。', '女');
INSERT INTO `hongniang` VALUES ('517', '包某某', 'Loveid:10654330', 'http://www.hongniang.com/data/upload/photo/20171010/59dc156f3a36b_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc156f3a36bff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc156f3a36bff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc156f3a36bff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc156f3a36bff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc156f3a36bff5_mid.jpg', '22岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个执着,靠谱的人 ，关于外貌，简单形容就是身材匀称。', '女');
INSERT INTO `hongniang` VALUES ('518', 'cici', 'Loveid:10654331', 'http://marry.hongniang.com/data/upload/photo/20171010/59dc156f75128_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171010/59dc156f75128ff1_mid.jpg', '29岁', '155CM', '未婚', '保密', '大学本科', '浙江杭州', '我喜欢电影，摄影，徒步。我在业余时间最大的消遣是看电影，美剧。我憧憬的生活是游遍世界。我希望我未来的另一半最好是感觉吧。真心希望在这里能遇到我的那个TA!', '女');
INSERT INTO `hongniang` VALUES ('519', '午夜玫瑰', 'Loveid:10654334', 'http://www.hongniang.com/data/upload/photo/20171010/59dc1571536c6_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1571536c6ff1_mid.jpg', '22岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个独立,孝顺,执着的人 。', '女');
INSERT INTO `hongniang` VALUES ('520', '雨露', 'Loveid:10654130', 'http://www.hongniang.com/data/upload/photo/20171010/59dc150e1f5ec_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc150e1f5ecff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc150e1f5ecff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc150e1f5ecff3_mid.jpg', '25岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '没有人想放弃br / 不是因为不喜欢也不是因为不爱了br / 只是攒够了失望br / 把所有的关心和爱慕都一点点的消磨光了 本人爱玩时时彩，有共同兴趣的可以加深感情了解', '女');
INSERT INTO `hongniang` VALUES ('521', '︶ㄣ沉浮于世的微尘╮', 'Loveid:10654338', 'http://hongniang.com/data/upload/photo/20171010/59dc157281a9b_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc157281a9bff1_mid.jpg', '25岁', '164CM', '未婚', '保密', '大学本科', '浙江杭州', '千万人之中，总会遇到适合的人。期待遇到可以打开心门的人. 希望另一半乐观积极上进，可以指引自己.简单的话，不足以了解一个人。一切随缘分 非诚勿扰！', '女');
INSERT INTO `hongniang` VALUES ('522', '琉璃の浅唇', 'Loveid:10654133', 'http://www.hongniang.com/data/upload/photo/20171010/59dc1513da458_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1513da458ff1_mid.jpg', '26岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '爱情，需要相濡以沫，不要为了一个人而活，一个人去  承担两个人的爱情是很痛苦的，只有  两颗心去真心经营爱情，那才是真正  的爱情。', '女');
INSERT INTO `hongniang` VALUES ('523', '李娜', 'Loveid:10654135', 'http://www.hongniang.com/data/upload/photo/20171010/59dc1515a099e_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1515a099eff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1515a099eff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1515a099eff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1515a099eff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1515a099eff5_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1515a099eff6_mid.jpg', '29岁', '166CM', '未婚', '保密', '硕士', '浙江杭州', '我是一个大大咧咧的人 ，爱好广泛的我，喜欢听歌,运动，关于外貌，简单形容就是时尚，我的工作属于设计行业。', '女');
INSERT INTO `hongniang` VALUES ('524', '太阳雨', 'Loveid:10654140', 'http://www.hongniang.com/data/upload/photo/20171010/59dc1516c3bd0_mid.jpg', '34岁', '162CM', '未婚', '保密', '大学本科', '浙江杭州', '我喜欢看书。我在业余时间最大的消遣是电影。我憧憬的生活是两个人悠闲的日子，平时除了上上班，可以出去走走。我希望我未来的另一半首先是一个善良的人，人品是第一位的，三观要正，其它都是其次。真心希望在这里能遇到我的那个TA!', '女');
INSERT INTO `hongniang` VALUES ('525', '一期一会~', 'Loveid:10654142', 'http://www.hongniang.com/data/upload/photo/20171010/59dc151746558_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc151746558ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc151746558ff2_mid.jpg', '36岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '生命中，不断的有人离开或进入，看见的、看不见的，记住的、遗忘的；生命中，不断的有得失和失落，看不见的、看见的；遗忘的、记住的。但我希望有你在生命里。', '女');
INSERT INTO `hongniang` VALUES ('526', '', 'Loveid:10654342', 'http://www.hongniang.com/data/upload/photo/20171010/59dc1573d125a_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1573d125aff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc1573d125aff2_mid.jpg', '31岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个开朗,正直,简单的人 ，爱好广泛的我，喜欢摄影，是个不折不扣的美食家。', '女');
INSERT INTO `hongniang` VALUES ('527', '这点痛算不什麽', 'Loveid:10654343', 'http://hongniang.com/data/upload/photo/20171010/59dc1574231b9_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc1574231b9ff1_mid.jpg', '24岁', '166CM', '未婚', '保密', '大学本科', '浙江杭州', '不要因为怕被伤害就不再去爱。如果不曾心动，又怎么能够体会思念的美好？如果不曾真心爱过，又怎知痛也是一种爱到极致？不要太在乎是不是会再次受伤，因为你曾经拥有的快乐已经是经过所赋予你的最美好的礼物。受过…', '女');
INSERT INTO `hongniang` VALUES ('528', '林兰心', 'Loveid:10654129', 'http://hongniang.com/data/upload/photo/20171010/59dc150de3a93_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc150de3a93ff1_mid.jpg', '27岁', '164CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个孝顺,开朗,顾家,简单的人 ，爱好广泛的我，喜欢逛街。', '女');
INSERT INTO `hongniang` VALUES ('529', '季娇娇', 'Loveid:10654146', 'http://www.hongniang.com/data/upload/photo/20171010/59dc151985acc_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc151985accff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc151985accff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc151985accff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc151985accff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc151985accff5_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc151985accff6_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc151985accff7_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc151985accff8_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc151985accff9_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc151985accff10_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc151985accff11_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc151985accff12_mid.jpg', '27岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '我想要一套小房子，能做你的小妻子，一起提着菜篮子，穿过门前的小巷子，饭后用不着你洗盘子，可你得负责抹桌子，再要个胖胖的小孩子，可爱得就象小丸子，等你长出了白胡子，坐在家中老椅子，可会记得这好日子，和我美丽的花裙子。\n　　我爱笑，特别爱笑，我觉得笑容是这个世界上最温暖人心的呢~\n　　资料注册的早，目前已经买了房子和车子，只是在等着那个温暖的他出现~\n　　不喜欢耍帅，但希望你阳光、奋斗、孝顺、善良，要家庭和睦，希望你能用你温暖的笑容在每一个黑暗处温暖着我~', '女');
INSERT INTO `hongniang` VALUES ('530', '人生坎坷', 'Loveid:10654149', 'http://www.hongniang.com/data/upload/photo/20171010/59dc151a3d743_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc151a3d743ff1_mid.jpg', '45岁', '166CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个开朗,善良,温柔的人 。只是想找个简简单单彼此理解关爱对方的', '女');
INSERT INTO `hongniang` VALUES ('531', 'lemon', 'Loveid:10654132', 'http://hongniang.com/data/upload/photo/20171010/59dc151399590_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc151399590ff1_mid.jpg', '23岁', '160CM', '未婚', '保密', '大专', '浙江杭州', '我是一个靠谱的人 ，说说我的工作，我工作在知名企业，我的工作属于销售,金融业。', '女');
INSERT INTO `hongniang` VALUES ('532', '朵拉', 'Loveid:10654151', 'http://www.hongniang.com/data/upload/photo/20171010/59dc151a997d8_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc151a997d8ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc151a997d8ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc151a997d8ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc151a997d8ff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc151a997d8ff5_mid.jpg', '27岁', '163CM', '未婚', '保密', '高中及以下', '浙江杭州', '有一点成熟，也有一些孩子气，有时侯安静，有时又爱笑爱闹。爱吃，对海鲜以外所有好吃的菜品感兴趣，只是我的厨艺不太怎么样，还在尝试努力，如果你的手艺很好，我一定会偷着乐的。\n　　对味道比较敏感，所以不喜欢男朋友抽烟。平时猫在家里的时间多，有时间喜欢去旅行，假期的时候会找时间出去走走。我希望遇见你，带着我的阳光明媚走入你的五光十色，希望你会喜欢这样的我。\n　　最后我想说一句，不贴邮票的信件就请不要再发了，发了我也看不到，谢谢。', '女');
INSERT INTO `hongniang` VALUES ('533', '一瞬之间', 'Loveid:10654136', 'http://marry.hongniang.com/data/upload/photo/20171010/59dc1515de82e_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171010/59dc1515de82eff1_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171010/59dc1515de82eff2_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171010/59dc1515de82eff3_mid.jpg', '25岁', '166CM', '未婚', '保密', '大专', '浙江杭州', '我是一个独立,简单的人 ，爱好广泛的我，喜欢旅行，我生长在一个单亲家庭，我爱我家人，他们也爱我。', '女');
INSERT INTO `hongniang` VALUES ('534', '冰山雪莲', 'Loveid:10654138', 'http://www.hongniang.com/data/upload/photo/20171010/59dc15165df30_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15165df30ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc15165df30ff2_mid.jpg', '25岁', '163CM', '未婚', '保密', '大学本科', '浙江杭州', '这个社会最不缺的就是有能力的人，缺的是一片真情。不论你是达官贵人，还是平民百姓，我们来到这个世上的时候，什么都没有，当我们离开这个世上的时候，同样什么都没有。人生在世不过区区数十载，自在地活，随心地活，心中多一点正能量，内心才能温暖。只有心好，整个世界才能待你好；希望遇上简单、纯粹、正义良善的人，在茫茫人海中相识是一种缘分，且行且珍惜。', '女');
