INSERT INTO `hongniang` VALUES ('722', 'wangjin', 'Loveid:10654128', 'http://hongniang.com/data/upload/photo/20171010/59dc150da155c_mid.jpg,http://hongniang.com/data/upload/photo/20171010/59dc150da155cff1_mid.jpg', '21岁', '170CM', '未婚', '保密', '高中及以下', '浙江杭州', '期待找到这么个人：一上线就会去看他在不在,不在就一阵失落, 在,又不敢打扰!期待有这么个人,他的状态只要一换,我立刻就胡思乱想 揣测不安!忍不住去看他的情感博客!即使他什么新鲜事都没有!我很想为他而活，而他一直没有出现！', '女');
