INSERT INTO `hongniang` VALUES ('740', '简单', 'Loveid:10654116', 'http://www.hongniang.com/data/upload/photo/20171010/59dc150a9589e_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc150a9589eff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc150a9589eff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc150a9589eff3_mid.jpg', '26岁', '166CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个孝顺,文静,执着的人 ，爱好广泛的我，喜欢健身，我的工作属于自由职业，我生长在一个三口之家，我爱我家人，他们也爱我。我现在的生活状态和心情，都挺好的，以前大部分时间放在工作上了，想找个有责任心，上进心，爱心的人', '女');
INSERT INTO `hongniang` VALUES ('741', '猪', 'Loveid:10654118', 'http://www.hongniang.com/data/upload/photo/20171010/59dc150b1bff7_mid.jpg', '27岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '本来没想过自己会尝试网络情缘，但是听说这里不错，很好奇，也怀着很大的期望，真心希望在这里遇见我的有缘人。网络并非从来飘渺，重要的是我们都彼此真诚，你说呢？', '女');
INSERT INTO `hongniang` VALUES ('742', '', 'Loveid:10654121', 'http://www.hongniang.com/data/upload/photo/20171010/59dc150b629e1_mid.jpg', '26岁', '166CM', '未婚', '保密', '大学本科', '浙江杭州', '那些等待化了思念，说不清楚已经累积了多少。从桃花开，到李花落。只记得今早的鹊儿报了喜讯。不是那熟悉的清湖畔， 不是那绿油油的稻田旁。不是坐在机杼前。也不是站在柴门前翘首以望等你归来。', '女');
INSERT INTO `hongniang` VALUES ('743', '远昼', 'Loveid:10654108', 'http://www.hongniang.com/data/upload/photo/20171010/59dc15029b011_mid.jpg', '28岁', '167CM', '未婚', '保密', '大学本科', '浙江杭州', '简单的文字，当然不足以了解一个人，读懂一个人，那需要怎样的默契呢，想找到这样一个人，彼此相互了解，心与心的交流最重要。也许是方式方法不对，也许从未碰到。', '女');
INSERT INTO `hongniang` VALUES ('744', '小猪', 'Loveid:10654123', 'http://www.hongniang.com/data/upload/photo/20171010/59dc150bb9add_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc150bb9addff1_mid.jpg', '21岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个粗枝大叶的人 ，爱好广泛的我，喜欢养狗，我现在的生活状态和心情，可以说是“房奴”。', '女');
