INSERT INTO `hongniang` VALUES ('746', '糖果', 'Loveid:10654126', 'http://www.hongniang.com/data/upload/photo/20171010/59dc150d79fcb_mid.jpg,http://www.hongniang.com/data/upload/photo/20171010/59dc150d79fcbff1_mid.jpg', '28岁', '168CM', '未婚', '保密', '高中及以下', '浙江杭州', '我是一个体贴的人 ，我有些特长：力大无穷， 是不是很有趣呢？关于外貌，简单形容就是大眼睛，说说我的工作，我工作在在私企，我的工作属于公务员，我现在的生活状态和心情，可以说是“非诚勿扰”。', '女');
