INSERT INTO `hongniang` VALUES ('763', '咔糯', 'Loveid:10653877', 'http://www.hongniang.com/data/upload/photo/20171009/59dac2d189d6e_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2d189d6eff1_mid.jpg', '21岁', '155CM', '未婚', '保密', '大学本科', '浙江杭州', '杭州本地人，找杭州人，临平，下沙最好。\n　　外协勿扰。\n　　详情我们可加微信细聊~~~', '女');
INSERT INTO `hongniang` VALUES ('764', 'lu小姐', 'Loveid:10653857', 'http://www.hongniang.com/data/upload/photo/20171009/59dac2c47da25_mid.jpg', '24岁', '163CM', '未婚', '保密', '大专', '浙江杭州', '找杭州本地，不是会员，发的看不了，也看不了；有意的可以私聊我。怕碰到熟人所以不放照片，要看照片的也私聊。', '女');
INSERT INTO `hongniang` VALUES ('765', '柯柯', 'Loveid:10653867', 'http://www.hongniang.com/data/upload/photo/20171009/59dac2cb9ab0f_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2cb9ab0fff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2cb9ab0fff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2cb9ab0fff3_mid.jpg', '31岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个大大咧咧,诚信,执着,正直,独立,乐观,孝顺,靠谱,细心,体贴,开朗的人 ，爱好广泛的我，喜欢听歌，关于外貌，简单形容就是微胖，说说我的工作，我工作在外企，我的工作属于媒体业。', '女');
INSERT INTO `hongniang` VALUES ('766', '相依丶梦一生', 'Loveid:10653889', 'http://www.hongniang.com/data/upload/photo/20171009/59dac2d7c0de9_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2d7c0de9ff1_mid.jpg', '27岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '人生座右铭：学无止境，运动无极限！对待爱情：执子之手，与子偕老。', '女');
INSERT INTO `hongniang` VALUES ('767', '笑笑', 'Loveid:10653917', 'http://www.hongniang.com/data/upload/photo/20171009/59dac2fce1622_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2fce1622ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2fce1622ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2fce1622ff3_mid.jpg', '27岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '真想认识我的，请发”你好”即可。系统发的我就不回啦。我也不喜欢异地恋，:)希望能找浙江的，或在杭州有定居打算的，我是浙江的，所以比较在意这些。还有我是89的，资料有误，介意的亲慎点。br /br /于千万人之中,遇见你要遇见的人.于千万年之中,时间无涯的荒野里,没有早一步,也没有迟一步,遇上了也只能轻轻地说一句：“你也在这里吗?”——张爱玲的《爱》br /', '女');
INSERT INTO `hongniang` VALUES ('768', '十二月de奇迹', 'Loveid:10653866', 'http://dyn.hongniang.com/data/upload/photo/20171009/59dac2cb64094_mid.jpg,http://dyn.hongniang.com/data/upload/photo/20171009/59dac2cb64094ff1_mid.jpg', '26岁', '164CM', '未婚', '保密', '大学本科', '浙江杭州', '盼望着相见的那一天，温馨的絮语，甜蜜的亲吻，更多的欣喜，诚心的给予，衷心的祝愿、痴心的相恋，最美的心情，最动人的爱情，都是为你而珍藏！', '女');
INSERT INTO `hongniang` VALUES ('769', '李丹', 'Loveid:10653876', 'http://www.hongniang.com/data/upload/photo/20171009/59dac2d146a72_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2d146a72ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2d146a72ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2d146a72ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2d146a72ff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2d146a72ff5_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2d146a72ff6_mid.jpg', '26岁', '163CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个善良,正直的人 ，爱好广泛的我，喜欢电影。', '女');
INSERT INTO `hongniang` VALUES ('770', '小骄傲', 'Loveid:10653856', 'http://www.hongniang.com/data/upload/photo/20171009/59dac2c44e3ad_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2c44e3adff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2c44e3adff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2c44e3adff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2c44e3adff4_mid.jpg', '25岁', '166CM', '未婚', '保密', '大学本科', '浙江杭州', '也许我很平凡，但是我绝不缺乏生活的热情和生命的梦想，也许我会孤单，但是我会一路找寻你的踪迹。遇见你，将是我生命中最绚烂的时刻。', '女');
INSERT INTO `hongniang` VALUES ('771', '闫函', 'Loveid:10653987', 'http://www.hongniang.com/data/upload/photo/20171009/59dac337b9779_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac337b9779ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac337b9779ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac337b9779ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac337b9779ff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac337b9779ff5_mid.jpg', '29岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '有时候望着地平线的方向，我在想，自己一路走来，明天又将去向哪里呢。快乐过也失落过，一个人旅途太漫长，如果你愿意，我希望能拉着你的手，一起奔跑，一起去寻找我们的幸福。不真诚，请远离，不要浪费彼此时间，OK? 不回信代表不合适不要反复写', '女');
INSERT INTO `hongniang` VALUES ('772', 'yoki', 'Loveid:10653878', 'http://hongniang.com/data/upload/photo/20171009/59dac2d1a6d8f_mid.jpg,http://hongniang.com/data/upload/photo/20171009/59dac2d1a6d8fff1_mid.jpg,http://hongniang.com/data/upload/photo/20171009/59dac2d1a6d8fff2_mid.jpg,http://hongniang.com/data/upload/photo/20171009/59dac2d1a6d8fff3_mid.jpg,http://hongniang.com/data/upload/photo/20171009/59dac2d1a6d8fff4_mid.jpg,http://hongniang.com/data/upload/photo/20171009/59dac2d1a6d8fff5_mid.jpg,http://hongniang.com/data/upload/photo/20171009/59dac2d1a6d8fff6_mid.jpg', '28岁', '168CM', '未婚', '保密', '高中及以下', '浙江杭州', '柏拉图说:人生短短几十年，\n　　不要给自己留下了什么遗憾，\n　　想笑就笑，想哭就哭，\n　　该爱的时候就去爱，无谓压抑自己。\n　　人生的苦闷有二：一是欲望没有被满足，二是它得到了满足。', '女');
INSERT INTO `hongniang` VALUES ('773', '红颜复仇', 'Loveid:10653886', 'http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171009/59dac2d7557f6_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171009/59dac2d7557f6ff1_mid.jpg', '21岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个简单,靠谱,温柔的人 。', '女');
INSERT INTO `hongniang` VALUES ('774', '〃蓝色的蕾丝', 'Loveid:10655683', 'http://www.hongniang.com/data/upload/photo/20171013/59e01cd9d0f78_mid.jpg,http://www.hongniang.com/data/upload/photo/20171013/59e01cd9d0f78ff1_mid.jpg', '26岁', '164CM', '未婚', '保密', '大学本科', '浙江杭州', '找一个人开始爱情长跑，到爱情可以变成亲情的时候。我想你，牵我的手，为我庞起长发，走进婚姻的神殿。', '女');
INSERT INTO `hongniang` VALUES ('775', '誰、看淡了谎言', 'Loveid:10653887', 'http://www.hongniang.com/data/upload/photo/20171009/59dac2d794d11_mid.jpg', '26岁', '164CM', '未婚', '保密', '大学本科', '浙江杭州', '简单，阳光，喜欢旅行，笑起来两个酒窝，满满的正能量，讨厌复杂的人际交往。家庭背景传统，没有不良嗜好，独生的，没有经济压力。', '女');
