INSERT INTO `hongniang` VALUES ('777', 'Huan', 'Loveid:10653897', 'http://marry.hongniang.com/data/upload/photo/20171009/59dac2df3fa8b_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac2df3fa8bff1_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac2df3fa8bff2_mid.jpg', '25岁', '158CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个善良,乐观,靠谱,简单,可爱的人 ，爱好广泛的我，喜欢听歌，关于外貌，简单形容就是大眼睛,小酒窝，我生长在一个高知家庭，我爱我家人，他们也爱我。', '女');
INSERT INTO `hongniang` VALUES ('778', '粉涩糖果', 'Loveid:10653906', 'http://www.hongniang.com/data/upload/photo/20171009/59dac2efe3e2a_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2efe3e2aff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2efe3e2aff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2efe3e2aff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2efe3e2aff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2efe3e2aff5_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2efe3e2aff6_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2efe3e2aff7_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2efe3e2aff8_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2efe3e2aff9_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2efe3e2aff10_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2efe3e2aff11_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2efe3e2aff12_mid.jpg', '26岁', '166CM', '未婚', '保密', '大学本科', '浙江杭州', '如果不是百分百的诚意何必浪费彼此时间？征友时间截止至:2018年1月1号。\n　　【三观不正、不符合基本条件的勿扰，喜欢自以为是、不思进取、懒惰、不爱卫生、沉迷游戏、妈妈宝或者人品性格不行的请勿扰。】\n　　谦谦君子温润如玉，希望你是一位风度翩翩的绅士，这样我会崇拜爱慕你一生。', '女');
INSERT INTO `hongniang` VALUES ('779', '惠', 'Loveid:10653916', 'http://www.hongniang.com/data/upload/photo/20171009/59dac2fc693d4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2fc693d4ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2fc693d4ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2fc693d4ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2fc693d4ff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2fc693d4ff5_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2fc693d4ff6_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2fc693d4ff7_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2fc693d4ff8_mid.jpg', '29岁', '169CM', '未婚', '保密', '高中及以下', '浙江杭州', '我就是一个很普通的女生……br /br /希望找个对的人，相携余生', '女');
INSERT INTO `hongniang` VALUES ('780', '成了了', 'Loveid:10653571', 'http://www.hongniang.com/data/upload/photo/20171009/59dac1c840417_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1c840417ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1c840417ff2_mid.jpg', '27岁', '164CM', '未婚', '保密', '大专', '浙江杭州', '感觉跟选美的是的\n　　有时候挺迷茫的 不知道到底找什么样的 想要一个美好安稳的家 一个充满希望的未来 不需要太多的金钱和利益 更多希望是 有爱就够了 我追求顺其自然 不想勉强太多 如果你我都有想在一起的目标 前方在困难冲冲 我也想跟你一起去突破 想要看见一起努力后别的 就为了感同身受的处境 你好我好大家好 脾气你可以大男子主义 但是得知道心疼 体贴人儿 最好心胸宽大点 \n　　说完了', '女');
INSERT INTO `hongniang` VALUES ('781', '仙人掌', 'Loveid:10653936', 'http://marry.hongniang.com/data/upload/photo/20171009/59dac30880802_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac30880802ff1_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac30880802ff2_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac30880802ff3_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac30880802ff4_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac30880802ff5_mid.jpg', '28岁', '160CM', '未婚', '保密', '大专', '浙江杭州', '执子之手与子偕老', '女');
INSERT INTO `hongniang` VALUES ('782', '匆匆那年', 'Loveid:10653956', 'http://marry.hongniang.com/data/upload/photo/20171009/59dac317821ea_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac317821eaff1_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac317821eaff2_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac317821eaff3_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac317821eaff4_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac317821eaff5_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac317821eaff6_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac317821eaff7_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac317821eaff8_mid.jpg', '27岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '(补充，我性格很独立，不喜欢粘人废话特多的男人。当然幽默风趣不是废话，我举个废话例子：br /男：你吃了么？br /我：吃了。br /男：哦。br /……br /我：你呢？br /男：我也吃了。br /男：呵呵…)br /(另外：纯粹找人聊天解闷的也别找我，最近很烦，别浪费别人感情，这是缺德。)br /br /忽然发现留太多文字在这里也没什么意思，这种网站最大的弊端就是会让人眼花缭乱。br /br /收到信息，聊上两句，就变成僵尸了。因为这网站是个巨大的信息库，你可以同时跟n个人聊，走马观花。br /br /即便如此，认真筛选也是可以的，但太多的人其实是没有带心来的。br /br /说得有点严肃，但事实上我是个逗逼女汉子。伪文艺，满脑子诗和远方。br /br /我家境不好，但我深爱我农村里的父母，介意勿扰。br /br /我以前惧怕婚姻，但现在反倒略微有些渴望。我希望婚姻不会带走我的诗和远方，而是会让我和那个合适的人一起启程。', '女');
INSERT INTO `hongniang` VALUES ('783', '清欢', 'Loveid:10653976', 'http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171009/59dac326a5088_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171009/59dac326a5088ff1_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171009/59dac326a5088ff2_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171009/59dac326a5088ff3_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171009/59dac326a5088ff4_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171009/59dac326a5088ff5_mid.jpg', '43岁', '161CM', '未婚', '保密', '大专', '浙江杭州', '靠近我，温暖你.也许世界很复杂，但我希望生活简单\n　　细雨斜风作晓寒，淡烟疏柳媚晴滩。入淮清洛渐漫漫。\n　　雪沫乳花浮午盏，蓼茸蒿笋试春盘。人间有味是清欢。', '女');
INSERT INTO `hongniang` VALUES ('784', '楠楠', 'Loveid:10653575', 'http://www.hongniang.com/data/upload/photo/20171009/59dac1c9bda5e_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1c9bda5eff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1c9bda5eff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1c9bda5eff3_mid.jpg', '26岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个温柔,文静的人 ，爱好广泛的我，喜欢美食。', '女');
INSERT INTO `hongniang` VALUES ('785', '滴嘟', 'Loveid:10653578', 'http://www.hongniang.com/data/upload/photo/20171009/59dac1cbb833e_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1cbb833eff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1cbb833eff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1cbb833eff3_mid.jpg', '29岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '我想，最美好的状态就是，看过了世界的黑暗与痛苦，却依然相信它的单纯与美好。希望那时候，我们都变成了更好的自己。没有早一步，也没有晚一步的，就在那时候，遇到你。\n　　我没有什么很伟大的梦想，但是不管任何年纪，我都会一直努力成长下去，直到老来成为一个可爱又有趣，见多识广，坦诚大度的老太太。', '女');
INSERT INTO `hongniang` VALUES ('786', '小胖胖', 'Loveid:10653579', 'http://www.hongniang.com/data/upload/photo/20171009/59dac1cc0b8fc_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1cc0b8fcff1_mid.jpg', '31岁', '171CM', '未婚', '保密', '大学本科', '浙江杭州', '我喜欢看电影、逛街、汽车、上网、美食、旅游、睡觉。我在业余时间最大的消遣是上网、看电影、逛街。我憧憬的生活是简单纯净，丰衣足食，自由自在。我希望我未来的另一半最好是与我能够谈到一起吃到一起玩到一起，成熟专一有责任心。真心希望在这里能遇到我的那个TA!', '女');
INSERT INTO `hongniang` VALUES ('787', '凌凌香雪', 'Loveid:10653580', 'http://www.hongniang.com/data/upload/photo/20171009/59dac1cc40dc0_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1cc40dc0ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1cc40dc0ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1cc40dc0ff3_mid.jpg', '27岁', '156CM', '未婚', '保密', '大专', '浙江杭州', '年关将近，又到逼婚的密集性时刻，但我坚信，岁月终会在某个时间让我遇见对的那个人。在爱情里最棒的心态就是：我的一切付出都是一场心甘情愿，我对此绝口不提。你若投桃报李，我会十分感激。你若无动于衷，我也不灰心丧气。人生不过如此，直到有一天我不愿再这般爱你，那就一别两宽，各生欢喜。低质量的婚姻，不如高质量的单身。我若盛开，清风自来，心若浮沉，浅笑安然。', '女');
INSERT INTO `hongniang` VALUES ('788', '嫣然', 'Loveid:10653581', 'http://www.hongniang.com/data/upload/photo/20171009/59dac1cc9d518_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1cc9d518ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1cc9d518ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1cc9d518ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1cc9d518ff4_mid.jpg', '34岁', '166CM', '未婚', '保密', '大学本科', '浙江杭州', '看了电视后才来这里的\n　　希望可以遇到有缘的他\n　　很感谢关注我的人\n　　喜欢发快捷问候的就免了\n　　请附带邮票，否则就会错过你', '女');
INSERT INTO `hongniang` VALUES ('789', '兰兰', 'Loveid:10653582', 'http://www.hongniang.com/data/upload/photo/20171009/59dac1cce411c_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1cce411cff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1cce411cff2_mid.jpg', '42岁', '165CM', '未婚', '保密', '大专', '浙江杭州', '如何让我遇见你/在我最美丽的时刻/为这/我已在佛前求了五百年/求它让我们结一段尘缘/佛于是把我化作一棵树/长在你必经过的路旁......\n　　不知道前生的五百年能否在今生等到,我是一个喜欢做梦的女孩,对爱情,对幸福的生活充满了幻想和憧憬,希望有一个温暖的小家,家中有一个爱我的和我爱的人,我们彼此牵挂,彼此付出,甜甜蜜蜜,温馨无比。', '女');
INSERT INTO `hongniang` VALUES ('790', '悠悠', 'Loveid:10653583', 'http://www.hongniang.com/data/upload/photo/20171009/59dac1cd465c6_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1cd465c6ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1cd465c6ff2_mid.jpg', '35岁', '160CM', '未婚', '保密', '硕士', '浙江杭州', '我从哪里来，没有人知道。我去的地方，人人都要去……但在来去之间，在人间天堂，我带着期待，带着真诚，希望在某个街角与你邂逅。见到你，然后说，认识你，应该是在很久很久以前。跟你在一起，是幸福，是希望，是快乐，是两人之间的心有灵犀、心心相印。\n　　简单介绍下自己：83年，身高160，偏瘦，浙大硕士毕业，家在离杭州不远的一个城市。在杭市直事业单位工作，正常八小时基本上不加班，各方面福利待遇也不错。工作上态度积极，生活中乐观开朗，为人随和。闲暇时看看书，听听歌，爬爬山，生活简单快乐。长相上应该有点自信吧。但每个人的审美尺度不同，评价自然不同。\n　　对你的要求：身高170以上，本科以上学历，大方开朗，成熟稳重，身体健康，果断宽容，要有包容心，对事情有自己的见解和判断力，对工作有追求和规划。其他一切随缘。\n　　喜欢漫步\n　　喜欢摇摆着身子戴着耳麦听歌，一下左边，一下右边\n　　喜欢安静得坐在布满阳光的房间看书\n　　喜欢讲完故事然后笑\n　　然后欣喜地发现  这个时候身边正好有你\n　　ps：信有点多哦，请有意的贴邮票吧。谢谢。', '女');
INSERT INTO `hongniang` VALUES ('791', 'dew', 'Loveid:10653585', 'http://www.hongniang.com/data/upload/photo/20171009/59dac1cdc0527_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1cdc0527ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1cdc0527ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1cdc0527ff3_mid.jpg', '32岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '找爱开始的地方', '女');
INSERT INTO `hongniang` VALUES ('792', 'timi_jay', 'Loveid:10653588', 'http://www.hongniang.com/data/upload/photo/20171009/59dac1cfa1d7c_mid.jpg', '23岁', '169CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个宅,顾家的人 ，爱好广泛的我，喜欢弹钢琴,养猫，关于外貌，简单形容就是高挑,时尚，我的工作属于建筑行业,公务员。', '女');
INSERT INTO `hongniang` VALUES ('793', '公主', 'Loveid:10653572', 'http://hongniang.com/data/upload/photo/20171009/59dac1c87ec4d_mid.jpg,http://hongniang.com/data/upload/photo/20171009/59dac1c87ec4dff1_mid.jpg,http://hongniang.com/data/upload/photo/20171009/59dac1c87ec4dff2_mid.jpg', '37岁', '163CM', '未婚', '保密', '大学本科', '浙江杭州', '是我没有遇见缘分，还是没有遇见你，无论外面的世界如何纷繁复杂，只想和你过一种简单的生活，相濡以沫，白头到老。', '女');
INSERT INTO `hongniang` VALUES ('794', '冰雪蝉', 'Loveid:10653799', 'http://www.hongniang.com/data/upload/photo/20171009/59dac29b559d9_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac29b559d9ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac29b559d9ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac29b559d9ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac29b559d9ff4_mid.jpg', '28岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '择一城终老，遇一人白首。城已定在杭州，寻觅能够一起白首的你（非诚勿扰）', '女');
INSERT INTO `hongniang` VALUES ('795', '沈雪', 'Loveid:10653573', 'http://marry.hongniang.com/data/upload/photo/20171009/59dac1c8e88bf_mid.jpg', '27岁', '170CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个细心,文静,诚信的人 。', '女');
INSERT INTO `hongniang` VALUES ('796', '花样年华', 'Loveid:10653576', 'http://www.hongniang.com/data/upload/photo/20171009/59dac1cb3ea3a_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1cb3ea3aff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1cb3ea3aff2_mid.jpg', '32岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '我喜欢运动、股票、养花、旅游。我在业余时间最大的消遣是都有。我憧憬的生活是和心爱的人一起去旅行。我希望我未来的另一半最好是能把我看的很重。真心希望在这里能遇到我的那个TA!', '女');
INSERT INTO `hongniang` VALUES ('797', '陪伴', 'Loveid:10653838', 'http://www.hongniang.com/data/upload/photo/20171009/59dac2b80c7f7_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2b80c7f7ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2b80c7f7ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2b80c7f7ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2b80c7f7ff4_mid.jpg', '25岁', '165CM', '未婚', '保密', '大专', '浙江杭州', '爱生活，爱自己，爱家人，愿在这里能遇到你哦。一家四口，爸妈弟我，简简单单，爸妈健康有自己的事情做，已在杭州购房，弟弟在上学，我在上海上的大学，现在杭州从事设计工作，目前规划在杭州长期发展，所以也希望找到在杭州工作且在杭州发展的你哦，不喜欢异地恋...我性格比较温顺，随和，善解人意，有时候也比较有自己的想法，从小比较独立，越长大越依赖人啦！比较喜欢美文、摄影、绘画、旅行、和朋友聊天。希望你有上进心，会疼人，爱家人；希望可以相互理解相互包容，陪伴彼此支持彼此去做对方喜欢做的事情哦；希望是奔着结婚去了解彼此哦，不然就不要浪费彼此的时间啦。愿刚好成熟的你遇到刚好温柔的我...愿你迷路到我身旁…', '女');
INSERT INTO `hongniang` VALUES ('798', 'Angel', 'Loveid:10653550', 'http://www.hongniang.com/data/upload/photo/20171009/59dac1bfa838b_mid.jpg', '25岁', '170CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个细心,孝顺,诚信,文静,正直,温柔,靠谱的人 。', '女');
