INSERT INTO `hongniang` VALUES ('800', '沈十二', 'Loveid:10653786', 'http://www.hongniang.com/data/upload/photo/20171009/59dac28b1b869_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac28b1b869ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac28b1b869ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac28b1b869ff3_mid.jpg', '25岁', '170CM', '未婚', '保密', '大专', '浙江杭州', '不知道从什么时候开始，身边的朋友都已经有了归宿，惊觉自己已经到了成家立业的年纪了。可是忙碌的工作让我没有太多的机会认识异性朋友，还好有世纪佳缘，我是世纪佳缘手机版用户，期待在这里可以结束我的单身生活，心仪与我同时代的另一半。', '女');
INSERT INTO `hongniang` VALUES ('801', '蝴蝶', 'Loveid:10653798', 'http://marry.hongniang.com/data/upload/photo/20171009/59dac29b25ecb_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac29b25ecbff1_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac29b25ecbff2_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac29b25ecbff3_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac29b25ecbff4_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac29b25ecbff5_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac29b25ecbff6_mid.jpg', '29岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '种下梧桐，自有凤凰来栖；\n　　你若盛开，蝴蝶自来。\n　　无论是过去在学校，还是现在的工作，一直很努力。转眼奔三，就快沦为剩女的行列，我不在乎，我还是追求爱情，虽然爱情不是生活的全部，但宁缺毋滥。\n　　谁没有在年轻时谈过几场不成功的恋爱？我也不例外，没有恨，那是人生的插曲，即使遇人不淑，我还是继续追求适合我的爱情，过去的就永远翻篇。我希望他是我仰视的人，有自己热爱的事业。\n　　我偶尔也在检讨，其实我也不差，论工作，我热爱工作，收入足够养自己；论长相，长相对得起观众，属于耐看型。论性格，不服输且善解人意。\n　　小学中学大学同学大多结婚了，为什么我就没有找到合适的男朋友，或许是我太挑，或许是我不会弹恋爱，或许是属于我的缘分没到。\n　　考虑到南北地域和文化差异，我还是喜欢南方。', '女');
INSERT INTO `hongniang` VALUES ('802', 'xszhuyan', 'Loveid:10653816', 'http://www.hongniang.com/data/upload/photo/20171009/59dac2a6ae3d7_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2a6ae3d7ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac2a6ae3d7ff2_mid.jpg', '32岁', '155CM', '未婚', '保密', '大学本科', '浙江杭州', '有时候望着地平线的方向，我在想，自己一路走来，明天又将去向哪里呢。快乐过也失落过，一个人旅途太漫长，如果你愿意，我希望能拉着你的手，一起奔跑，一起去寻找我们的幸福', '女');
INSERT INTO `hongniang` VALUES ('803', '女青', 'Loveid:10653826', 'http://marry.hongniang.com/data/upload/photo/20171009/59dac2ad2f633_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac2ad2f633ff1_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac2ad2f633ff2_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac2ad2f633ff3_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac2ad2f633ff4_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac2ad2f633ff5_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac2ad2f633ff6_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac2ad2f633ff7_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac2ad2f633ff8_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac2ad2f633ff9_mid.jpg', '27岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '系统发信一律不回，身高172以下不回。本人在杭州，会在这里定居。我生在一个普通的工薪家庭，独女，性格比较独立。希望找到一个三观接近的人，互相欣赏，能一起平淡一起疯。我希望你有自己热爱的事业，对未来有务实的规划和努力；希望你家庭和睦，父母民主一些，大小事情能自己做主；外形方面要求不算高，但胖子和太瘦不能接受，其他看眼缘。性格上希望你外向一点，为人大方，最好善于主动的沟通; 经济实力的话有车，房子可以没有，有能力首付也可，房贷一起承担，希望这些都不是父母给你的；生活习惯不要酗酒嗜烟赌博，我是来认真找结婚对象的，请抱着同样想法的和我联系。', '女');
INSERT INTO `hongniang` VALUES ('804', 'ai', 'Loveid:10653557', 'http://www.hongniang.com/data/upload/photo/20171009/59dac1c375475_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1c375475ff1_mid.jpg', '26岁', '168CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个诚信,体贴,善良,可爱的人 ，爱好广泛的我，喜欢自拍,画画，是个不折不扣的美食家，关于外貌，简单形容就是大眼睛,漂亮，说说我的工作，我工作在自己创业。', '女');
INSERT INTO `hongniang` VALUES ('805', '诚信诚意', 'Loveid:10653837', 'http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171009/59dac2b7b4d4a_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171009/59dac2b7b4d4aff1_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171009/59dac2b7b4d4aff2_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171009/59dac2b7b4d4aff3_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20171009/59dac2b7b4d4aff4_mid.jpg', '26岁', '167CM', '未婚', '保密', '大学本科', '浙江杭州', '随缘，男生最好是杭州本地的，一定要在秔卌有房子，年龄30以下，有担当，有事业有责任性给予我安全感，不离不弃永结同心的迟一个人是你吗？', '女');
