INSERT INTO `hongniang` VALUES ('807', '芳心寂寞', 'Loveid:10652793', 'http://emz.hongniang.com/data/upload/photo/20170929/59cddd1400e8c_mid.png,http://emz.hongniang.com/data/upload/photo/20170929/59cddd2271546_mid.png,http://emz.hongniang.com/data/upload/photo/20170929/59cddd3219754_mid.png,http://emz.hongniang.com/data/upload/photo/20170929/59cddd429350f_mid.png', '28岁', '168CM', '未婚', '20-35万元', '大学本科', '浙江杭州', '擦肩而过，你我，并不是属于彼此的，无所谓的珍重与再见，无所谓的感受与苦涩已化作尘埃飘过，我们该珍惜现在。', '女');
INSERT INTO `hongniang` VALUES ('808', '石小浪', 'Loveid:10652966', 'http://marry.hongniang.com/data/upload/photo/20171002/59d1c085aca8e_mid.png,http://marry.hongniang.com/data/upload/photo/20171002/59d1c09f96388_mid.png', '19岁', '170CM', '未婚', '保密', '大专', '广东珠海', '我是来交朋友的，不是找男朋友的', '女');
INSERT INTO `hongniang` VALUES ('809', '可爱文', 'Loveid:10652973', 'http://esg.hongniang.com/data/upload/photo/20171002/59d1d6ea8d401_mid.png,http://esg.hongniang.com/data/upload/photo/20171002/59d1d8b83577a_mid.png', '26岁', '168CM', '保密', '20-35万元', '大学本科', '北京朝阳区', '如果让我在这里遇见你，会不会是个奇迹呢，曾经无数次幻想过未来另一半的样子，朦胧而亲切，找寻至今，我才相信，爱情终究是缘分，茫茫人海两个人的相识相爱，本身就是一种巧合，你会是我的那个巧合吗?', '女');
INSERT INTO `hongniang` VALUES ('810', '大美呀', 'Loveid:10653423', 'http://uqy.hongniang.com/data/upload/photo/20171008/59da1ab05ebb7_mid.png', '27岁', '167CM', '未婚', '保密', '硕士', '浙江杭州', '以前为了学习老妈不让谈恋爱，现在为了工作没时间恋爱，随着时间的推移，自己发现已经步入“剩女”的行列，其实自己对另一半的要求也不是很高，可以不是很帅，可以不是很富有，但是一定要有上进心，责任心，能够孝顺老人家也就差不多了。我对未来有很多憧憬和希望，但愿能和心爱的人一起实现.....', '女');
INSERT INTO `hongniang` VALUES ('811', '吴慧美子', 'Loveid:10653560', 'http://www.hongniang.com/data/upload/photo/20171009/59dac1c4228cd_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1c4228cdff1_mid.jpg', '22岁', '166CM', '未婚', '保密', '大专', '浙江杭州', '我是一个温柔,细心,体贴的人 ，关于外貌，简单形容就是大眼睛,苗条,身材匀称。', '女');
INSERT INTO `hongniang` VALUES ('812', 'goodwln', 'Loveid:10653561', 'http://www.hongniang.com/data/upload/photo/20171009/59dac1c46fdac_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1c46fdacff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1c46fdacff2_mid.jpg', '29岁', '156CM', '未婚', '保密', '高中及以下', '浙江杭州', '对整个世界来说，你是一个人，而对一个人来说，你就是整个世界。我会在这里等着你的到来，期待我们的爱情开花结果，期待把我们的小窝布置得浪漫温馨，一回到家就有幸福的感觉。', '女');
INSERT INTO `hongniang` VALUES ('813', '肋 骨 ╮', 'Loveid:10653562', 'http://www.hongniang.com/data/upload/photo/20171009/59dac1c4a443c_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1c4a443cff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1c4a443cff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1c4a443cff3_mid.jpg', '26岁', '160CM', '未婚', '保密', '大专', '浙江杭州', '如果爱我 请不要骗我\n　　如果你骗了我 请不要让我知道\n　　如果你骗了我被我知道了\n　　请收拾好你的行李 有多远滚多远', '女');
