INSERT INTO `hongniang` VALUES ('817', '玉丽', 'Loveid:10653563', 'http://www.hongniang.com/data/upload/photo/20171009/59dac1c4e346c_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1c4e346cff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1c4e346cff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1c4e346cff3_mid.jpg', '33岁', '163CM', '未婚', '保密', '高中及以下', '浙江杭州', '我的业余爱好，喜欢一个人在家听音乐，打扫卫生看看书，然后就是喜欢散步，还有户外活动还是比较喜欢的 ，喜欢旅游，想找个相依相偎一辈子的人。', '女');
INSERT INTO `hongniang` VALUES ('818', '燕子', 'Loveid:10653569', 'http://www.hongniang.com/data/upload/photo/20171009/59dac1c7a5940_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1c7a5940ff1_mid.jpg', '25岁', '160CM', '未婚', '保密', '大专', '浙江杭州', '我想要一份纯粹的爱情，很难。放不下骄傲，放不下身段，参杂太多人太多事，彼此撑着，最后以“爱不起”、“不适合”收场。陪我们走到最后的人，也许算不上是我们最爱的，但会是最合适的。这样也很好，不是吗？人生本不完美，也许懂得知足。', '女');
INSERT INTO `hongniang` VALUES ('819', '紫苏', 'Loveid:10653570', 'http://www.hongniang.com/data/upload/photo/20171009/59dac1c7e84cc_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1c7e84ccff1_mid.jpg', '20岁', '168CM', '未婚', '保密', '大学本科', '浙江杭州', '爱好广泛的我，喜欢自拍,弹钢琴，是个不折不扣的学霸，关于外貌，简单形容就是身材匀称，我现在的生活状态和心情，可以说是“静待缘分,努力挣钱”。', '女');
