INSERT INTO `hongniang` VALUES ('823', '娜娜', 'Loveid:10652280', 'http://www.hongniang.com/data/upload/photo/20170929/59cd9499c1c29_mid.jpg,http://www.hongniang.com/data/upload/photo/20170929/59cd9499c1c29ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170929/59cd9499c1c29ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170929/59cd9499c1c29ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170929/59cd9499c1c29ff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170929/59cd9499c1c29ff5_mid.jpg,http://www.hongniang.com/data/upload/photo/20170929/59cd9499c1c29ff6_mid.jpg,http://www.hongniang.com/data/upload/photo/20170929/59cd9499c1c29ff7_mid.jpg,http://www.hongniang.com/data/upload/photo/20170929/59cd9499c1c29ff8_mid.jpg,http://www.hongniang.com/data/upload/photo/20170929/59cd9499c1c29ff9_mid.jpg,http://www.hongniang.com/data/upload/photo/20170929/59cd9499c1c29ff10_mid.jpg', '31岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个简单,诚信,靠谱,独立的人 ，我现在的生活状态和心情，可以说是“正在减肥”。', '女');
INSERT INTO `hongniang` VALUES ('824', '夏', 'Loveid:10652281', 'http://www.hongniang.com/data/upload/photo/20170929/59cd949dbb2b0_mid.jpg,http://www.hongniang.com/data/upload/photo/20170929/59cd949dbb2b0ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170929/59cd949dbb2b0ff2_mid.jpg', '34岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '爱情就像是候车站牌，有人来有人去，我的心就是一个站牌，写着等待。不想再一个人孤独的走着，希望遇见生命中的另一半。', '女');
INSERT INTO `hongniang` VALUES ('825', '大熊猫', 'Loveid:10652283', 'http://www.hongniang.com/data/upload/photo/20170929/59cd949f527b5_mid.jpg,http://www.hongniang.com/data/upload/photo/20170929/59cd949f527b5ff1_mid.jpg', '27岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个独立,温柔的人 ，爱好广泛的我，喜欢听歌。 =', '女');
INSERT INTO `hongniang` VALUES ('826', '萧萧雨', 'Loveid:10652285', 'http://www.hongniang.com/data/upload/photo/20170929/59cd94a398ef4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170929/59cd94a398ef4ff1_mid.jpg', '27岁', '162CM', '未婚', '保密', '大学本科', '浙江杭州', '我喜欢看电视 打乒乓。我在业余时间最大的消遣是睡觉。我憧憬的生活是睡觉再睡觉。我希望我未来的另一半最好是诚信。真心希望在这里能遇到我的那个TA!', '女');
INSERT INTO `hongniang` VALUES ('827', '小怪兽', 'Loveid:10653564', 'http://marry.hongniang.com/data/upload/photo/20171009/59dac1c53abe7_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac1c53abe7ff1_mid.jpg', '26岁', '155CM', '未婚', '保密', '大专', '浙江杭州', '我是三没产品：没身材，没身材，没相貌。我平凡，就像一颗小草，但我还是以小草的样的毅力，生活着，我就是我，这个世上独一无二的我', '女');
INSERT INTO `hongniang` VALUES ('828', 'Mis♀Yeah', 'Loveid:10652286', 'http://www.hongniang.com/data/upload/photo/20170929/59cd94a41fe03_mid.jpg,http://www.hongniang.com/data/upload/photo/20170929/59cd94a41fe03ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170929/59cd94a41fe03ff2_mid.jpg', '27岁', '160CM', '未婚', '保密', '大专', '浙江杭州', '做一个有爱人的女子，找一个爱人，你最后的男人，你爱的，爱你的，真心的。尊重你的选择，看穿你的逞强，体贴你的孤单，保护你的自尊，心疼你的脆弱，善良  正直  有教养；不求帅气多金，只愿有聪明的头脑和上进心；你是他唯一的女人，最后的女人，让你无微不至的宠溺，给你白头偕老的爱情！', '女');
INSERT INTO `hongniang` VALUES ('829', '恋娇', 'Loveid:10653566', 'http://www.hongniang.com/data/upload/photo/20171009/59dac1c6c33b7_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1c6c33b7ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1c6c33b7ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1c6c33b7ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1c6c33b7ff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1c6c33b7ff5_mid.jpg,http://www.hongniang.com/data/upload/photo/20171009/59dac1c6c33b7ff6_mid.jpg', '31岁', '156CM', '未婚', '保密', '大专', '浙江杭州', '我是一个自恋，骄傲，任意，不羁，成熟，可爱等等的女子，而这些只展露在他面前，而他却不知身在何处~', '女');
INSERT INTO `hongniang` VALUES ('830', '珉记于心', 'Loveid:10653568', 'http://marry.hongniang.com/data/upload/photo/20171009/59dac1c754892_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac1c754892ff1_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac1c754892ff2_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac1c754892ff3_mid.jpg,http://marry.hongniang.com/data/upload/photo/20171009/59dac1c754892ff4_mid.jpg', '30岁', '162CM', '未婚', '保密', '大专', '浙江杭州', '寻找初恋的我\n　　一直都没有好好的谈过一次恋爱，很想找个人，谈一场轰轰烈烈的恋爱，可是社会实在太现实，无法找到真正的纯真的恋爱，所以，只能在有一定基础上去寻找了，我希望我的那个他可以体贴温柔，能包容我的坏坏脾气，有点小幽默，说这么多都是徒劳的，缘分可能就是这么神奇吧最后\n　　希望能找到爱我的那个人，和我爱的那个人\n　　请不要发我贴邮票的信息谢谢', '女');
INSERT INTO `hongniang` VALUES ('831', 'silvia的幸福在哪里', 'Loveid:10652288', 'http://www.hongniang.com/data/upload/photo/20170929/59cd94a8601dc_mid.jpg,http://www.hongniang.com/data/upload/photo/20170929/59cd94a8601dcff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170929/59cd94a8601dcff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170929/59cd94a8601dcff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170929/59cd94a8601dcff4_mid.jpg', '35岁', '160CM', '未婚', '保密', '大专', '浙江杭州', '我现在的资料没有参考价值，过段时间集中精力再完善。\n　　(爱情婚姻貌似比什么都难，现在这社会好像也没人拿这当首选。急不来没时间，但是也还是希望能有说不准什么时候时间就对了，一切自然都对了，也自然有时间)\n　　选择适合自己对的人就是？？？……………………………………我不介意年纪比我小的,比我大的,或离异的。所有不介意的前提是……这个没法具体形容，喜欢的自然就自然喜欢，不喜欢的怎么都不会喜欢……………不急结婚的可以相处看，着急结婚的，彼此认可充分了解前提下我也赞同闪婚，❴不放自己照片的不考虑❵…………………………………………………………………………………………………………………………………………………………………………………………………………………希望彼此坦诚，本人不喜欢伪君子。……………………………………………………………………………………………………………………………………………………我没有固定的想法一定要在哪里,那么我的姻缘在哪里呢？希望你能出现,在现实中我们遇上...愿能有对的时间对的人，愿我爱他，刚好他也爱我。……\n　　…………2017年,心思能不能安放好别的方面才能决定爱情婚姻能不能有。际遇自有安排,希望着急的时候能特别如意也特别快。写了这么多，给自己点个赞，赞！', '女');
INSERT INTO `hongniang` VALUES ('832', '洗刷刷', 'Loveid:10652289', 'http://www.hongniang.com/data/upload/photo/20170929/59cd94aa37142_mid.jpg,http://www.hongniang.com/data/upload/photo/20170929/59cd94aa37142ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170929/59cd94aa37142ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170929/59cd94aa37142ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170929/59cd94aa37142ff4_mid.jpg', '25岁', '159CM', '未婚', '保密', '高中及以下', '浙江杭州', '不求专心，但求用心，我希望他脾气好一点，有一颗上进心，责任心，孝心，最好干净清爽一些!善良一些，离过一次婚', '女');
