INSERT INTO `hongniang` VALUES ('841', '妞妞', 'Loveid:10651892', 'http://www.hongniang.com/data/upload/photo/20170928/59ccbac963b2a_mid.jpg,http://www.hongniang.com/data/upload/photo/20170928/59ccbac963b2aff1_mid.jpg', '22岁', '162CM', '未婚', '保密', '高中及以下', '浙江杭州', '我是一个文静的人 ，关于外貌，简单形容就是小酒窝，我的工作属于金融业，我现在的生活状态和心情，可以说是“努力挣钱”。', '女');
INSERT INTO `hongniang` VALUES ('842', '妮妮', 'Loveid:10651894', 'http://www.hongniang.com/data/upload/photo/20170928/59ccbacbcf340_mid.jpg,http://www.hongniang.com/data/upload/photo/20170928/59ccbacbcf340ff1_mid.jpg', '26岁', '163CM', '未婚', '保密', '大学本科', '浙江杭州', '是我没有遇见缘分，还是没有遇见你，无论外面的世界如何纷繁复杂，只想和你过一种简单的生活，相濡以沫，白头到老。', '女');
INSERT INTO `hongniang` VALUES ('843', 'kelly', 'Loveid:10652287', 'http://test.hongniang.com/data/upload/photo/20170929/59cd94a67b8b3_mid.jpg,http://test.hongniang.com/data/upload/photo/20170929/59cd94a67b8b3ff1_mid.jpg,http://test.hongniang.com/data/upload/photo/20170929/59cd94a67b8b3ff2_mid.jpg,http://test.hongniang.com/data/upload/photo/20170929/59cd94a67b8b3ff3_mid.jpg,http://test.hongniang.com/data/upload/photo/20170929/59cd94a67b8b3ff4_mid.jpg', '28岁', '160CM', '未婚', '保密', '硕士', '浙江杭州', '做个简单的自我介绍：周岁29，硕士毕业，现在一家母婴公司做产品设计。性格随和，安静和外向的时候都有，总之我不是有什么特殊脾气的类型。', '女');
INSERT INTO `hongniang` VALUES ('844', '双双', 'Loveid:10651895', 'http://www.hongniang.com/data/upload/photo/20170928/59ccbacc267ab_mid.jpg,http://www.hongniang.com/data/upload/photo/20170928/59ccbacc267abff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170928/59ccbacc267abff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170928/59ccbacc267abff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170928/59ccbacc267abff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170928/59ccbacc267abff5_mid.jpg,http://www.hongniang.com/data/upload/photo/20170928/59ccbacc267abff6_mid.jpg', '26岁', '174CM', '未婚', '保密', '大学本科', '浙江杭州', '所谓幸福，就是有一颗感恩的心，一个健康的身体，一份称心的工作，一位深爱你的爱人，一帮值得信赖的朋友。', '女');
INSERT INTO `hongniang` VALUES ('845', '彬彬', 'Loveid:10651897', 'http://www.hongniang.com/data/upload/photo/20170928/59ccbad077682_mid.jpg,http://www.hongniang.com/data/upload/photo/20170928/59ccbad077682ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170928/59ccbad077682ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170928/59ccbad077682ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170928/59ccbad077682ff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170928/59ccbad077682ff5_mid.jpg,http://www.hongniang.com/data/upload/photo/20170928/59ccbad077682ff6_mid.jpg,http://www.hongniang.com/data/upload/photo/20170928/59ccbad077682ff7_mid.jpg,http://www.hongniang.com/data/upload/photo/20170928/59ccbad077682ff8_mid.jpg', '27岁', '171CM', '未婚', '保密', '高中及以下', '浙江杭州', '我从事美容业多年，一直游走时尚的前端，让女人靓丽展现“香，而不俗！很少去看泡沫剧，不追星，也不八卦。每天必看所有养生，美容有关的东西。\n　　休息时间就会游游泳、练练肚皮舞，学着养身，有自己的独立，有自己的人生规划！\n　　我相信“缘分”也一直在寻找一个两情相悦的人一起牵手走向幸福的生活！或许，你就是我在等的人！', '女');
INSERT INTO `hongniang` VALUES ('846', '龙凤配', 'Loveid:10651898', 'http://www.hongniang.com/data/upload/photo/20170928/59ccbad3a665e_mid.jpg,http://www.hongniang.com/data/upload/photo/20170928/59ccbad3a665eff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170928/59ccbad3a665eff2_mid.jpg', '23岁', '167CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个靠谱的人 ，爱好广泛的我，喜欢话剧，我有些特长：狂吃不胖， 是不是很有趣呢？', '女');
INSERT INTO `hongniang` VALUES ('847', '一抹微笑', 'Loveid:10651903', 'http://www.hongniang.com/data/upload/photo/20170928/59ccbad71fba4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170928/59ccbad71fba4ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170928/59ccbad71fba4ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170928/59ccbad71fba4ff3_mid.jpg', '28岁', '167CM', '未婚', '保密', '大学本科', '浙江杭州', '也许世界很复杂，但我希望生活简单化，单纯化。 世界无完美的人，完美的人也看不上不完美的我。 所以，我将世界中纷繁复杂的品行在乱序中粗粗勾画，形成我所追求的那个他。 善良、包容、 才华、 幽默、 能看顺眼的外貌，以上五点的前提——相信这个世界有真爱。', '女');
