INSERT INTO `hongniang` VALUES ('850', '粉儿丶吖', 'Loveid:10651905', 'http://www.hongniang.com/data/upload/photo/20170928/59ccbad8be55e_mid.jpg', '22岁', '168CM', '未婚', '保密', '大学本科', '浙江杭州', '再怎么美好也抵不过遗忘\n　　如果你喜欢我就联系我，你又不是我，你怎么知道我们合不合适呢，联系了，我们就有50%的几率可以在一起，不联系什么都没了。所以我希望你可以联系我，看什么看，说的就是你', '女');
INSERT INTO `hongniang` VALUES ('851', '妖妖懒虫', 'Loveid:10652297', '/public/images/woman.jpg', '26岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '我相信，只要用心经营，肯定可以幸福的白头到老\n　　我相信，两个人只要观点一致，幸福是很简单的事情！', '女');
INSERT INTO `hongniang` VALUES ('852', '林曦', 'Loveid:10651893', 'http://hongniang.com/data/upload/photo/20170928/59ccbac9d9643_mid.jpg,http://hongniang.com/data/upload/photo/20170928/59ccbac9d9643ff1_mid.jpg,http://hongniang.com/data/upload/photo/20170928/59ccbac9d9643ff2_mid.jpg,http://hongniang.com/data/upload/photo/20170928/59ccbac9d9643ff3_mid.jpg,http://hongniang.com/data/upload/photo/20170928/59ccbac9d9643ff4_mid.jpg,http://hongniang.com/data/upload/photo/20170928/59ccbac9d9643ff5_mid.jpg', '26岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '大家好，我叫林曦，自己开家服装，今年27了，我性格开朗，心地善良，工作努力，平时喜欢读书，脾气有点不好，性子急，说话直，希望能遇到一个能包容我的另一半。', '女');
