INSERT INTO `hongniang` VALUES ('855', '小胖', 'Loveid:10651912', 'http://www.hongniang.com/data/upload/photo/20170928/59ccbade05082_mid.jpg,http://www.hongniang.com/data/upload/photo/20170928/59ccbade05082ff1_mid.jpg', '21岁', '158CM', '未婚', '保密', '大学本科', '浙江杭州', '也许世界很复杂，但我希望生活简单化，单纯化。 世界无完美的人，完美的人也看不上不完美的我。 所以，我将世界中纷繁复杂的品行在乱序中粗粗勾画，形成我所追求的那个他。 善良、包容、 才华、 幽默、 能看顺眼的外貌，以上五点的前提——相信这个世界有真爱。', '女');
