INSERT INTO `hongniang` VALUES ('858', '随心', 'Loveid:10651901', 'http://marry.hongniang.com/data/upload/photo/20170928/59ccbad4a6c28_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170928/59ccbad4a6c28ff1_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170928/59ccbad4a6c28ff2_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170928/59ccbad4a6c28ff3_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170928/59ccbad4a6c28ff4_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170928/59ccbad4a6c28ff5_mid.jpg', '38岁', '158CM', '未婚', '保密', '大专', '浙江杭州', '希望找一个可以互相尊重，在乎我的人，不管前面是什么，都可以一起面对。br / 一个人的开心想与你分享，一个人的悲伤想你一起分担！我们将是一个整体，互相的关爱，手牵手寻找我们的幸福，简单就好！br /br / 希望看我的你也是怀着真诚的心，我是个简单的人，希望你也是简简单单，一起追求简单的幸福，喜欢就是喜欢，不喜欢就是不喜欢。非诚勿扰哦！br /br / 也祝愿每一个怀着真诚的心来到这里的人都能找到自己的幸福。！br /br / 如果你有诚意，来信请附邮票哦，本人没有的哦，非诚勿扰！br /br / 再次说明，非诚勿扰！', '女');
INSERT INTO `hongniang` VALUES ('859', 'LATTE', 'Loveid:10651902', 'http://www.hongniang.com/data/upload/photo/20170928/59ccbad70ea7d_mid.jpg', '28岁', '155CM', '未婚', '保密', '大学本科', '浙江杭州', '会是个有点慢热的人，应该不太会闪婚，因为熟悉一个人需要时间，想闪婚的还是不要找我好了。我会认真对待感情，希望你也是。如若不，请远离，谢谢。', '女');
INSERT INTO `hongniang` VALUES ('860', '小真', 'Loveid:10651339', 'http://www.hongniang.com/data/upload/photo/20170927/59cafdc77ab18_mid.jpg', '29岁', '163CM', '未婚', '保密', '大专', '浙江杭州', '独处久了，每当空下来就觉得心好空，好想有个家。 我喜欢旅行和音乐。我在业余时间最大的消遣是听音乐 上网 逛街。我憧憬的生活是执子之手与子偕老。我希望我未来的另一半最好是性格好，成熟稳重，斯文型的It或者金融男。真心希望在这里能遇到我的那个TA!', '女');
INSERT INTO `hongniang` VALUES ('861', '怡云梦语', 'Loveid:10651340', 'http://www.hongniang.com/data/upload/photo/20170927/59cafdc78e50e_mid.jpg,http://www.hongniang.com/data/upload/photo/20170927/59cafdc78e50eff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170927/59cafdc78e50eff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170927/59cafdc78e50eff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170927/59cafdc78e50eff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170927/59cafdc78e50eff5_mid.jpg', '28岁', '158CM', '未婚', '保密', '高中及以下', '浙江杭州', '介意不要用不是自己本人照片的人，要真实不要欺骗，真正的感情是两个人能在最艰苦中相守，即使分开也是一种必然的考验。珍惜每一次来之不易的际遇。-------  一生只谈一次恋爱最好，一次就一生。【请帖邮票】', '女');
INSERT INTO `hongniang` VALUES ('862', '古采尼', 'Loveid:10651343', 'http://www.hongniang.com/data/upload/photo/20170927/59cafdcb3ade6_mid.jpg,http://www.hongniang.com/data/upload/photo/20170927/59cafdcb3ade6ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170927/59cafdcb3ade6ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170927/59cafdcb3ade6ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170927/59cafdcb3ade6ff4_mid.jpg', '29岁', '163CM', '未婚', '保密', '大专', '浙江杭州', '希望寻找到一个善良、幽默风趣、可爱、阳光帅气又带点成熟的能够和我一起牵手的人。执子之手，与子偕老。', '女');
