INSERT INTO `hongniang` VALUES ('867', '随遇而安、', 'Loveid:10651351', 'http://www.hongniang.com/data/upload/photo/20170927/59cafdda60862_mid.jpg,http://www.hongniang.com/data/upload/photo/20170927/59cafdda60862ff1_mid.jpg', '25岁', '173CM', '未婚', '保密', '大学本科', '浙江杭州', '朋友们都说我性格我端庄而不失时髦，稳重中又带着点调皮。，我的业余时间都放在了看书、健身、郊游。上，一直向往我一直都是个没什么大志向的人，就希望若干年以后，能有个房子不必太大，中午日光倾城的时候就躺在…', '女');
INSERT INTO `hongniang` VALUES ('868', '赛赛', 'Loveid:10651353', 'http://www.hongniang.com/data/upload/photo/20170927/59cafddb4f059_mid.jpg,http://www.hongniang.com/data/upload/photo/20170927/59cafddb4f059ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170927/59cafddb4f059ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170927/59cafddb4f059ff3_mid.jpg', '28岁', '158CM', '未婚', '保密', '高中及以下', '浙江杭州', '我想有这么一个男人，他不一定很高很帅，但是会让我把以后的时光放心的交给他；他不一定很有钱，但是会让我每天回家后吃上热热的饭菜；他不一定会很早计划好我们的未来，但是会在某天深情的对我说，我最爱的丫头，我们是时候该有个家了。没有邮票，麻烦发免费邮件哈...谢谢', '女');
INSERT INTO `hongniang` VALUES ('869', '叶', 'Loveid:10651342', 'http://www.hongniang.com/data/upload/photo/20170927/59cafdc9e6b8f_mid.jpg,http://www.hongniang.com/data/upload/photo/20170927/59cafdc9e6b8fff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170927/59cafdc9e6b8fff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170927/59cafdc9e6b8fff3_mid.jpg', '25岁', '163CM', '未婚', '保密', '大专', '浙江杭州', '长相一般，学历一般，家庭一般，不求大富大贵，只想找个视我如宝的人简单度过这一生。', '女');
INSERT INTO `hongniang` VALUES ('870', '落了汤的鸟儿', 'Loveid:10651344', 'http://www.hongniang.com/data/upload/photo/20170927/59cafdccda5c1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170927/59cafdccda5c1ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170927/59cafdccda5c1ff2_mid.jpg', '30岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '随着年龄越来越大，不太喜欢华而不实的东西了。一个人的真诚务实更能让我心动，我是身高控，喜欢比较高一点的男生，真要死，至今还没嫁出去，我这可恶的身高控。', '女');
INSERT INTO `hongniang` VALUES ('871', '旧时年华丶', 'Loveid:10651888', 'http://www.hongniang.com/data/upload/photo/20170928/59ccbac61bc03_mid.jpg,http://www.hongniang.com/data/upload/photo/20170928/59ccbac61bc03ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170928/59ccbac61bc03ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170928/59ccbac61bc03ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170928/59ccbac61bc03ff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170928/59ccbac61bc03ff5_mid.jpg', '23岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '一见钟情很多人，两情相悦一些人，相濡以沫一个人。\n　　说一下我的情况，我现在住在杭州，有自己的工作，我想找一个温柔、体贴、大方的男人，不在乎你的外表，当然不能太丑T_T，经济方面也不是太差，不需要你有房有车，如果真的有眼缘，可以去你那里。\n　　以前谈过几次恋爱，因为种种原因最后都无疾而终了，谁没有一点过去呢？\n　　有喜欢我的可以给我来信，最好贴上邮票，不然我看不了。\n　　当然能送点礼物是最好的o(∩_∩)o', '女');
INSERT INTO `hongniang` VALUES ('872', '心灵', 'Loveid:10651889', 'http://www.hongniang.com/data/upload/photo/20170928/59ccbac7daef2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170928/59ccbac7daef2ff1_mid.jpg', '24岁', '162CM', '未婚', '保密', '高中及以下', '浙江杭州', '是我没有遇见缘分，还是没有遇见你，无论外面的世界如何纷繁复杂，只想和你过一种简单的生活，相濡以沫，白头到老。', '女');
INSERT INTO `hongniang` VALUES ('873', '赵艳', 'Loveid:10651345', 'http://marry.hongniang.com/data/upload/photo/20170927/59cafdcee1466_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170927/59cafdcee1466ff1_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170927/59cafdcee1466ff2_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170927/59cafdcee1466ff3_mid.jpg', '34岁', '167CM', '未婚', '保密', '大专', '浙江杭州', '希望他是 踏实 健康 阳光，知道自己要想要找什么样的人做妻子，有清晰定位的人，我们把自己剩下，往往对方都在看对方不好 其实忽略了自己\n　　他在杭州工作和生活，有婚房，想成家也对成家有打算的，说到做到有责任心', '女');
