INSERT INTO `hongniang` VALUES ('907', '青草地第理想', 'Loveid:10651337', 'http://www.hongniang.comwww.hongniang.com/data/upload/photo/20170927/59cafdc3ee876_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20170927/59cafdc3ee876ff1_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20170927/59cafdc3ee876ff2_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20170927/59cafdc3ee876ff3_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20170927/59cafdc3ee876ff4_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20170927/59cafdc3ee876ff5_mid.jpg', '34岁', '163CM', '未婚', '保密', '大学本科', '浙江杭州', '希望能找一个外形和性格都阳光的男生，大气、正直、善良。\n　　关于爱情和婚姻的理解，很认同杨澜的一段话“婚姻的纽带，不是孩子，不是金钱，而是关于精神的共同成长，在最无助和软弱的时候，有他（她）托起你的下巴，扳直你的脊梁，令你坚强，并陪伴你左右，共同承受命运。那时候，你们之间除了爱，还有肝胆相照的义气，不离不弃的默契，以及铭心刻骨的恩情。”', '女');
INSERT INTO `hongniang` VALUES ('908', '笑笑', 'Loveid:10651338', 'http://www.hongniang.com/data/upload/photo/20170927/59cafdc5b2520_mid.jpg,http://www.hongniang.com/data/upload/photo/20170927/59cafdc5b2520ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170927/59cafdc5b2520ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170927/59cafdc5b2520ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170927/59cafdc5b2520ff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170927/59cafdc5b2520ff5_mid.jpg', '36岁', '162CM', '未婚', '保密', '大学本科', '浙江杭州', '一起努力，快乐生活，互相尊重、珍惜彼此缘分!给对方一个平淡而不寻味的美丽人生!寻找简单的幸福。', '女');
INSERT INTO `hongniang` VALUES ('909', '叶子', 'Loveid:10651060', 'http://www.hongniang.com/data/upload/photo/20170926/59c9a35ce97a7_mid.jpg,http://www.hongniang.com/data/upload/photo/20170926/59c9a35ce97a7ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170926/59c9a35ce97a7ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170926/59c9a35ce97a7ff3_mid.jpg', '30岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '从事于IT行业，在杭州有份相对稳定的工作；本人乐观派，直爽而善良，有自己的性格但不娇气；\n　　喜欢热闹、喜欢安静、喜欢傻笑、喜欢交朋友、喜欢一人反思、喜欢不断追求...\n　　动静皆宜的我比较“慢热”，但易相处；工作认真严谨，孝顺父母，待人诚恳。\n　　爱好画画、书法、摄影、瑜伽、各种运动、旅游...\n　　我理想中的TA：在杭州工作，有责任心、包容心、孝顺心；会分担家务的男生；彼此有共同的价值观、生活观；另外，身高1.73以上 ^_^ 非诚勿扰，离异者请绕道，谢谢\n　　(  PS:谢谢大家的关注，我不是VIP用户，大部分的信件看不到哦，欢迎有缘份而坦诚\n　　的朋友们加我，彼此之间多些了解，谢谢！)', '女');
INSERT INTO `hongniang` VALUES ('910', '我只是很低调', 'Loveid:10651061', 'http://www.hongniang.com/data/upload/photo/20170926/59c9a35e62414_mid.jpg,http://www.hongniang.com/data/upload/photo/20170926/59c9a35e62414ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170926/59c9a35e62414ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170926/59c9a35e62414ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170926/59c9a35e62414ff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170926/59c9a35e62414ff5_mid.jpg,http://www.hongniang.com/data/upload/photo/20170926/59c9a35e62414ff6_mid.jpg', '24岁', '166CM', '未婚', '保密', '大专', '浙江杭州', '我只是一个普普通通的女孩，只想要找一个爱我的他，拥有属于我们的小小幸福！偶尔牵手看看电影相约日出日落。', '女');
INSERT INTO `hongniang` VALUES ('911', '盆盆', 'Loveid:10651047', 'http://marry.hongniang.com/data/upload/photo/20170926/59c9a34331dce_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170926/59c9a34331dceff1_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170926/59c9a34331dceff2_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170926/59c9a34331dceff3_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170926/59c9a34331dceff4_mid.jpg', '24岁', '158CM', '未婚', '保密', '大学本科', '浙江杭州', '不要为了寂寞去恋爱，时间是个魔鬼，天长日久，如果你是个多情的人，即使不爱对方，到时候也会产生感情，最后你怎么办？', '女');
INSERT INTO `hongniang` VALUES ('912', '茶韵', 'Loveid:10651257', 'http://www.hongniang.com/data/upload/photo/20170927/59cafd5a803fcff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170927/59cafd5a803fcff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170927/59cafd5a803fc_mid.jpg', '40岁', '155CM', '未婚', '保密', '高中及以下', '浙江杭州', '我是一个独立,大大咧咧的人 ，爱好广泛的我，喜欢美食。', '女');
INSERT INTO `hongniang` VALUES ('913', '蓝雨', 'Loveid:10651258', 'http://www.hongniang.com/data/upload/photo/20170927/59cafd5b3e986ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170927/59cafd5b3e986_mid.jpg', '27岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个善良,纯真,简单的人 。', '女');
INSERT INTO `hongniang` VALUES ('914', '放慢心跳', 'Loveid:10651259', 'http://www.hongniang.com/data/upload/photo/20170927/59cafd5b81068ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170927/59cafd5b81068_mid.jpg', '31岁', '163CM', '未婚', '保密', '大学本科', '浙江杭州', '我喜欢旅游。我在业余时间最大的消遣是上网 K歌。我憧憬的生活是有奋斗的理想。我希望我未来的另一半最好是真心相爱。真心希望在这里能遇到我的那个TA!', '女');
INSERT INTO `hongniang` VALUES ('915', '简单', 'Loveid:10651056', 'http://www.hongniang.comwww.hongniang.com/data/upload/photo/20170926/59c9a35a69ece_mid.jpg', '40岁', '161CM', '未婚', '保密', '大学本科', '浙江杭州', '从前我以为，有的梦想并不一定要去实现，它因为遥不可及而更加美丽。而现在，去实现梦想的过程让我觉得幸福。\n　　来到杭州，放弃居住多年的城市，告别温馨的朋友圈子，实现了江南梦，我觉得幸福；放弃多年的工作，丢掉或许高职但让人疲倦的职位，选择从头开始，每天富有创新和惊奇的工作让我觉得幸福。\n　　我很爱现在的工作，也很爱现在居住的城市，想在这里寻找更多的幸福。\n　　我很宅，在家里的时候，大部分的时间是看书看电视和装扮我的小窝，也会想一些新奇的菜式提高下厨艺，下一步想学做蛋糕。\n　　如果要出门的话，首选空气好风景好的地方逛逛，爬爬山旅旅游BBQ什么的，不喜欢闹市和喧哗。\n　　我很感性，经常看着电视或者书就湿了眼睛，明明知道那是故意煽情的招数，还是每每控制不了泪腺。\n　　我欣赏美好的东西，但不会强求拥有；我乐观且直爽，更多地看到善良与简单。了解我的朋友说我有点“笨”，我永远也学不会八面玲珑，实在没那个脑子。\n　　我在书香门第成长，自己也是拿了硕士学位的“书呆呆”，特别喜欢小孩，相信自己将来会是一个好妈妈，会是他/她最好的家庭教师。\n　　我的感情经历很苍白，可能因为我的迟钝和慢热，可能因为我的内向和宅，也可能因为工作占据了我大部分的时间，圈子太小，还因为我开窍真的很晚很晚。\n　　现在的我，热切期待一份感情，让幸福变得圆满。\n　　我心目中的TA是这样子的：\n　　比我大，比我健谈，和我一样诚实敦厚，顾家有担当，孝顺喜欢小孩。\n　　如果你是这样的人，和我联系好吗？', '女');
INSERT INTO `hongniang` VALUES ('916', 'tears', 'Loveid:10651057', 'http://www.hongniang.com/data/upload/photo/20170926/59c9a35a8233d_mid.jpg,http://www.hongniang.com/data/upload/photo/20170926/59c9a35a8233dff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170926/59c9a35a8233dff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170926/59c9a35a8233dff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170926/59c9a35a8233dff4_mid.jpg', '29岁', '163CM', '未婚', '保密', '大专', '浙江杭州', '你若不离不弃，我必生死相依\' 来信请贴邮票\'要不然看不到\'谢谢', '女');
INSERT INTO `hongniang` VALUES ('917', '可可', 'Loveid:10651311', 'http://www.hongniang.com/data/upload/photo/20170927/59cafda4dd498_mid.jpg,http://www.hongniang.com/data/upload/photo/20170927/59cafda4dd498ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170927/59cafda4dd498ff2_mid.jpg', '29岁', '168CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个孝顺,诚信,宅的人 ，爱好广泛的我，喜欢逛街，说说我的工作，我工作在自己创业。', '女');
INSERT INTO `hongniang` VALUES ('918', '横横', 'Loveid:10651312', 'http://www.hongniang.com/data/upload/photo/20170927/59cafda5c8d7e_mid.jpg,http://www.hongniang.com/data/upload/photo/20170927/59cafda5c8d7eff1_mid.jpg', '22岁', '159CM', '未婚', '保密', '大专', '浙江杭州', '很多人问，某星座和某星座配吗？究竟哪个星座与我最相配……其实我一直想说：只有不相配的人，没有不相配的星座。真的爱，就勇敢的去面对性格的差异，并解决双方的摩擦，而不是逃避和沮丧。你要相信：你的爱需要你来守护！', '女');
INSERT INTO `hongniang` VALUES ('919', '萍萍', 'Loveid:10650859', 'http://www.hongniang.com/data/upload/photo/20170925/59c876531606e_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c876531606eff1_mid.jpg', '37岁', '163CM', '未婚', '保密', '大专', '浙江杭州', '我在等一个人，一个可以把我的寂寞画上休止符的人；一个可以陪我听遍所有悲伤的情歌却不会让我想哭的人；一个我可以在他身上找出一百个缺点却还是执意要爱的人；一个会对我说：我们有坑一起跳，有苦一起尝，有一辈子就一起过的人！', '女');
