INSERT INTO `hongniang` VALUES ('921', '静枫冷静的在斐济', 'Loveid:10651063', 'http://www.hongniang.com/data/upload/photo/20170926/59c9a361410d1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170926/59c9a361410d1ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170926/59c9a361410d1ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170926/59c9a361410d1ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170926/59c9a361410d1ff4_mid.jpg', '26岁', '167CM', '未婚', '保密', '大学本科', '浙江杭州', '如果让我在这里遇见你，会不会是个奇迹呢，曾经无数次幻想过未来另一半的样子，朦胧而亲切，找寻至今，我才相信，爱情终究是缘分，茫茫人海两个人的相识相爱，本身就是一种巧合，你会是我的那个巧合吗？', '女');
