INSERT INTO `hongniang` VALUES ('926', '大愚', 'Loveid:10651310', 'http://yumaoqiu.hongniang.com/data/upload/photo/20170927/59cafda45df6e_mid.jpg,http://yumaoqiu.hongniang.com/data/upload/photo/20170927/59cafda45df6eff1_mid.jpg', '25岁', '153CM', '未婚', '保密', '大学本科', '浙江杭州', '有点认生，所以不能很快适应旁边有个你，但是如果你和我一样有诚意，有一点共同爱好，有一些好感，有发展下去的想法，那么我会勇敢一点。', '女');
INSERT INTO `hongniang` VALUES ('927', '秋后的丰收', 'Loveid:10651032', 'http://www.hongniang.com/data/upload/photo/20170926/59c9a339c2dfc_mid.jpg,http://www.hongniang.com/data/upload/photo/20170926/59c9a339c2dfcff1_mid.jpg', '25岁', '158CM', '未婚', '保密', '大专', '浙江杭州', '我是一个执着,靠谱,顾家,诚信的人 ，爱好广泛的我，喜欢美食，是个不折不扣的学霸，我有些特长：整理癖， 是不是很有趣呢？关于外貌，简单形容就是时尚。', '女');
