INSERT INTO `hongniang` VALUES ('930', '别轻言放弃', 'Loveid:10650855', 'http://marry.hongniang.com/data/upload/photo/20170925/59c8764a0da9f_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170925/59c8764a0da9fff1_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170925/59c8764a0da9fff2_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170925/59c8764a0da9fff3_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170925/59c8764a0da9fff4_mid.jpg', '31岁', '162CM', '未婚', '保密', '大学本科', '浙江杭州', '我没有漂亮的脸蛋儿 苗条的身材 很高的学历 丰厚的年薪 显赫的家世背景 但我善良 开朗 孝顺 愿意为自己的另一半付出一生的女生！\n　　我认为不管是什么身份的人都希望自己能被真爱拥抱 真爱是不能被放弃的 能放弃的也不是真爱 我也一样 渴望被真爱拥抱 \n　　年纪慢慢大了，身边的朋友同学都是陆续的结婚了，单身的我越来越觉得这件事情的紧迫，如果有人愿意珍惜我就请联络我。希望能早日建立自己的家庭。\n　　如果我是你的菜 就别轻言放弃我', '女');
INSERT INTO `hongniang` VALUES ('931', '哈密瓜快乐的在恒河', 'Loveid:10650858', 'http://www.hongniang.com/data/upload/photo/20170925/59c8765046115_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c8765046115ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c8765046115ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c8765046115ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c8765046115ff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c8765046115ff5_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c8765046115ff6_mid.jpg', '26岁', '155CM', '未婚', '保密', '大专', '浙江杭州', '一个人的日子很丰富，但是两个人的日子会更精彩。希望遇到我的真名天子一起去运动、出游、看比赛、研究美食。相携与共，共享人世繁华！', '女');
