INSERT INTO `hongniang` VALUES ('937', '果酸', 'Loveid:10651031', 'http://www.hongniang.com/data/upload/photo/20170926/59c9a33971521_mid.jpg,http://www.hongniang.com/data/upload/photo/20170926/59c9a33971521ff1_mid.jpg', '21岁', '167CM', '未婚', '保密', '大专', '浙江杭州', '我的工作属于教育行业，我现在的生活状态和心情，可以说是“静待缘分,静待缘分”。', '女');
