INSERT INTO `hongniang` VALUES ('941', '呵呵哒', 'Loveid:10651043', 'http://www.hongniang.com/data/upload/photo/20170926/59c9a33e786c3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170926/59c9a33e786c3ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170926/59c9a33e786c3ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170926/59c9a33e786c3ff3_mid.jpg', '26岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个简单,执着,纯真,宅,诚信,文静,大大咧咧的人 ，爱好广泛的我，喜欢瑜伽,健身,运动,养狗,摄影,自拍,麦霸，是个不折不扣的萌妹纸,胖纸,学霸，关于外貌，简单形容就是苗条,大眼睛,身材匀称,小酒窝，我的工作属于教育行业,医务工作者,IT业。', '女');
INSERT INTO `hongniang` VALUES ('942', '兔兔', 'Loveid:10651044', 'http://hongniang.com/data/upload/photo/20170926/59c9a33f99cbf_mid.jpg,http://hongniang.com/data/upload/photo/20170926/59c9a33f99cbfff1_mid.jpg', '22岁', '166CM', '未婚', '保密', '高中及以下', '浙江杭州', '如果一件东西，踮起脚就能够着了，你就去够；如果站在那里不断的使劲跳起来也还是够不着，那就别够了，没必要把自己搞的那么累。爱情，亦是如此吧。凡事要看开一些，看透一些，什么都在失去，什么都留不住，唯有当下的快乐与幸福最真实。', '女');
