INSERT INTO `hongniang` VALUES ('1123', 'Rosie', 'Loveid:10650828', 'http://www.hongniang.com/data/upload/photo/20170925/59c875e198db9_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875e198db9ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875e198db9ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875e198db9ff3_mid.jpg', '23岁', '163CM', '未婚', '保密', '大学本科', '浙江杭州', '谁说爱情是寂寞者的谎言，忠诚者的戏言，单身汉的慌不择言。爱情是永恒的，一分钟也永恒，一秒钟也永恒，它在记忆中备份着也足够。', '女');
INSERT INTO `hongniang` VALUES ('1124', '小妮子', 'Loveid:10650835', 'http://www.hongniang.com/data/upload/photo/20170925/59c875edb3687_mid.jpg', '30岁', '170CM', '未婚', '保密', '大专', '浙江杭州', '想认认真真的，找个男人，谈恋爱，结婚，生子，相守到老。\n　　非诚勿扰', '女');
INSERT INTO `hongniang` VALUES ('1125', 'lucky', 'Loveid:10650831', 'http://www.hongniang.com/data/upload/photo/20170925/59c875e45f2a3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875e45f2a3ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875e45f2a3ff2_mid.jpg', '24岁', '166CM', '未婚', '保密', '大学本科', '浙江杭州', '我喜欢养宠物。我在业余时间最大的消遣是上网睡觉。我憧憬的生活是幸福。我希望我未来的另一半最好是稳重 幽默。真心希望在这里能遇到我的那个TA!', '女');
INSERT INTO `hongniang` VALUES ('1126', 'sunshine', 'Loveid:10650838', 'http://www.hongniang.com/data/upload/photo/20170925/59c875f22ce2e_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875f22ce2eff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875f22ce2eff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875f22ce2eff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875f22ce2eff4_mid.jpg', '26岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个开朗,大大咧咧的人 ，爱好广泛的我，喜欢淘宝,麦霸，关于外貌，简单形容就是时尚,大眼睛，说说我的工作，我工作在在私企。', '女');
