INSERT INTO `hongniang` VALUES ('1128', '涵洁儿', 'Loveid:10650845', 'http://www.hongniang.com/data/upload/photo/20170925/59c8763675d95_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c8763675d95ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c8763675d95ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c8763675d95ff3_mid.jpg', '28岁', '158CM', '未婚', '保密', '大专', '浙江杭州', '我是一个直率大方随性的女孩，喜欢看言情小说，喜欢优美的文字，喜欢细腻的感情。呵呵~', '女');
