INSERT INTO `hongniang` VALUES ('1131', '圆圆', 'Loveid:10650841', 'http://www.hongniang.com/data/upload/photo/20170925/59c875f647653_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875f647653ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875f647653ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875f647653ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875f647653ff4_mid.jpg', '29岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一名普通的中学教师，性格应该属于温柔型的吧。平时圈子很小，每天面对一群天真可爱的学生，致使我自己的心境也非常纯净、平和。可是到了这个年龄，总希望能有另一半跟我同甘共苦点什么。孤独的时候，真的想有个人在旁边，借我个肩膀，或聆听我的倾诉。寻寻觅觅，有点艰辛，但是我相信，缘分会让我在这里遇上你~', '女');
