INSERT INTO `hongniang` VALUES ('1133', 'Thea的秋天', 'Loveid:10650830', 'http://www.hongniang.com/data/upload/photo/20170925/59c875e34abc2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875e34abc2ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875e34abc2ff2_mid.jpg', '27岁', '162CM', '未婚', '保密', '大专', '浙江杭州', '互相信任，彼此尊重，视对方为唯一。互相陪伴，互相扶持，不离不弃，平淡的过完一生。上述都是我理想中的婚姻，只能说尽量做到。 最好不要吸烟，离异的暂时不考虑，来信请贴上邮票哈，我会尽量回复的。', '女');
INSERT INTO `hongniang` VALUES ('1134', '艾,欣儿', 'Loveid:10650834', 'http://marry.hongniang.com/data/upload/photo/20170925/59c875ec01983_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170925/59c875ec01983ff1_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170925/59c875ec01983ff2_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170925/59c875ec01983ff3_mid.jpg', '29岁', '168CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个温柔,纯真的人 ，爱好广泛的我，喜欢摄影,逛街,美食，是个不折不扣的女强人，关于外貌，简单形容就是大眼睛。', '女');
INSERT INTO `hongniang` VALUES ('1135', '相遇难相见', 'Loveid:10650829', 'http://hongniang.com/data/upload/photo/20170925/59c875e24e1ec_mid.jpg,http://hongniang.com/data/upload/photo/20170925/59c875e24e1ecff1_mid.jpg,http://hongniang.com/data/upload/photo/20170925/59c875e24e1ecff2_mid.jpg', '25岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '有时候望着地平线的方向，我在想，自己一路走来，明天又将去向哪里呢。快乐过也失落过，一个人旅途太漫长，如果你愿意，我希望能拉着你的手，一起奔跑，一起去寻找我们的幸福。', '女');
