INSERT INTO `hongniang` VALUES ('1137', '千惠伊人', 'Loveid:10650846', 'http://www.hongniang.com/data/upload/photo/20170925/59c876381568d_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c876381568dff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c876381568dff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c876381568dff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c876381568dff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c876381568dff5_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c876381568dff6_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c876381568dff7_mid.jpg', '27岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '我一直等待着你,如果你来拉住了我的手,我们就再也不松开,无论何时何地,何种境遇!拉着手，我们一起登山,看海,阅读,跳舞,相偎,远行.一起分享,一同承担!', '女');
INSERT INTO `hongniang` VALUES ('1138', '童话故事', 'Loveid:10650851', 'http://www.hongniang.com/data/upload/photo/20170925/59c87644a9fed_mid.jpg', '43岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '找一个人开始爱情长跑，到爱情可以变成亲情的时候。我想你，牵我的手，为我庞起长发，走进婚姻的神殿。', '女');
INSERT INTO `hongniang` VALUES ('1139', '咖啡奶茶', 'Loveid:10650839', 'http://fy.hongniang.com/data/upload/photo/20170925/59c875f3d4d74_mid.jpg,http://fy.hongniang.com/data/upload/photo/20170925/59c875f3d4d74ff1_mid.jpg,http://fy.hongniang.com/data/upload/photo/20170925/59c875f3d4d74ff2_mid.jpg,http://fy.hongniang.com/data/upload/photo/20170925/59c875f3d4d74ff3_mid.jpg,http://fy.hongniang.com/data/upload/photo/20170925/59c875f3d4d74ff4_mid.jpg', '28岁', '160CM', '未婚', '保密', '硕士', '浙江杭州', '我是一个孝顺,文静,温柔,可爱的人 。', '女');
INSERT INTO `hongniang` VALUES ('1140', '', 'Loveid:10650842', 'http://hongniang.com/data/upload/photo/20170925/59c875f88e83d_mid.jpg,http://hongniang.com/data/upload/photo/20170925/59c875f88e83dff1_mid.jpg,http://hongniang.com/data/upload/photo/20170925/59c875f88e83dff2_mid.jpg,http://hongniang.com/data/upload/photo/20170925/59c875f88e83dff3_mid.jpg,http://hongniang.com/data/upload/photo/20170925/59c875f88e83dff4_mid.jpg', '26岁', '172CM', '未婚', '保密', '大学本科', '浙江杭州', '（首先注明老的和丑的都不要给我发信）我，一个温婉眉梢的女孩子，不人云亦云，不以物喜不以己悲，柔弱却坚强，温柔且坚定，随着年龄的增长，让我越来越觉得女孩子由内到外的气质美才可以与时间抗衡，外在的美貌都是暂时的。\n　　同时我也希望自己一直做一个纯洁善良，微笑待人，勇敢真诚，不让物欲迷住眼睛，更不能变得粗俗急功近利，理智同时不要欺骗自己的心的真实女孩。我喜欢旅行，背着背包，带个帽子，去每个可以放松心灵的地方，近距离接触大自然，发现最原始，最纯洁的美。\n　　对待另一半，没有什么具体的要求，只希望能够简简单单的找到一个爱我真正懂我的人，我不需要他多金，多帅，我只希望他人品好，有责任心，有担当，心胸宽广，如果遇到了，即便你没什么钱，我也愿意跟着你，帮助你，一起奋斗。我不希望自己做什么女强人，但我希望自己成为老公背后那个贤惠善良，优秀美丽的好女人。人生不过几十年，最重要的还是要活的开心，过的幸福。', '女');
INSERT INTO `hongniang` VALUES ('1141', 'CICI', 'Loveid:10650852', 'http://www.hongniang.com/data/upload/photo/20170925/59c87644bfc85_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c87644bfc85ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c87644bfc85ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c87644bfc85ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c87644bfc85ff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c87644bfc85ff5_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c87644bfc85ff6_mid.jpg', '25岁', '163CM', '未婚', '保密', '硕士', '浙江杭州', '最重要的是能让彼此开心', '女');
INSERT INTO `hongniang` VALUES ('1142', 'linda', 'Loveid:10650853', 'http://www.hongniang.com/data/upload/photo/20170925/59c87647a2e2d_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c87647a2e2dff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c87647a2e2dff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c87647a2e2dff3_mid.jpg', '37岁', '164CM', '未婚', '保密', '大学本科', '浙江杭州', '不要因为寂寞爱错人，更不要因为爱错人而寂寞一生，尝试信任才能得到幸福。缘分是本书，翻的不经意会错过，读的太认真会流泪。', '女');
