INSERT INTO `hongniang` VALUES ('1145', '穿着校服逛坟场', 'Loveid:10650849', 'http://www.hongniang.com/data/upload/photo/20170925/59c87640e1acb_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c87640e1acbff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c87640e1acbff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c87640e1acbff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c87640e1acbff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c87640e1acbff5_mid.jpg', '26岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '喜欢干干净净，但不喜欢外表干净内心肮脏的人，喜欢幽默感，但不喜欢油嘴滑舌，喜欢大大方方，各种大方哈哈！！', '女');
