INSERT INTO `hongniang` VALUES ('1147', '桃桃', 'Loveid:10650854', 'http://marry.hongniang.com/data/upload/photo/20170925/59c8764959845_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170925/59c8764959845ff1_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170925/59c8764959845ff2_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170925/59c8764959845ff3_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170925/59c8764959845ff4_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170925/59c8764959845ff5_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170925/59c8764959845ff6_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170925/59c8764959845ff7_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170925/59c8764959845ff8_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170925/59c8764959845ff9_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170925/59c8764959845ff10_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170925/59c8764959845ff11_mid.jpg', '37岁', '168CM', '未婚', '保密', '大学本科', '浙江杭州', '本人性格温柔，善解人意，与人交往开朗随和。身高168cm，苗条修长。喜爱电影阅读画画书法旅游，也喜欢爬山打羽毛球瑜伽，初识给人性格印象偏静，但熟悉之后是个喜欢逗B的人。偶尔兴致来了还喜欢研究个菜谱摆弄一下，但我不是很厉害的厨娘，一切都是为了兴致。我欣赏的男生希望具有以下条件：开朗乐观、积极向上，对生活有规划，有梦想有追求。性格坦诚、通情达理。在生活中可以相依相伴有商有量。 真诚善良是我的优点，马虎随和是我的缺点。 有意请来信，无照不复，非诚勿扰！', '女');
