INSERT INTO `hongniang` VALUES ('1164', '￠朝ぐ比ダ奈い', 'Loveid:10650800', 'http://www.hongniang.com/data/upload/photo/20170925/59c875b9102eb_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875b9102ebff1_mid.jpg', '29岁', '163CM', '未婚', '保密', '大专', '浙江杭州', '- - 呜呜呜~~ 长胖咯 好吧 还是喜欢吃 怎么滴 胖就胖撒 有空缝缝汉服 或者 出去溜达溜达 - - 约上小姐妹 跑茶楼混一天 咩哈哈 茶楼滴boss啊 遇到我们 乃要亏本了咯。', '女');
INSERT INTO `hongniang` VALUES ('1165', '等我许多年', 'Loveid:10650804', 'http://www.hongniang.com/data/upload/photo/20170925/59c875bf2c141_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875bf2c141ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875bf2c141ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875bf2c141ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875bf2c141ff4_mid.jpg', '37岁', '165CM', '未婚', '保密', '大专', '浙江杭州', '我是个简单的人，我的情况也很简单，杭州人，事业单位，家族背景良好，别的资料里也都有写，我的照片跟我本人相似度大概有百分之九十。\n　　我的父母都是很好的人非常好相处，因为我的个人问题让他们操心至今。曾经有过一段短暂的婚史，没有孩子，资料写了就改不了，不介意的话可以联系我。\n　　當然知道 太陽出來時 雪人就會融化 心里還是會忍不住難過 我要赶在雪融之前 熱情的擁抱你 大聲告訴你 我想永遠和你在一起 我只要一棵树 一棵让我愿意放弃整片森林的树\n　　The furthest distance in the world \n　　The furthest distance in the world\n　　Is not between life and death\n　　But when I stand in front of you\n　　Yet you don\'\'t know that\n　　I love you \n　　The furthest distance in the world\n　　Is not when i stand in front of you \n　　Yet you can\'\'t see my love\n　　But when undoubtedly knowing the love from both\n　　Yet cannot be together \n　　The furthest distance in the world\n　　Is not being apart while being in love\n　　But when plainly can not resist the yearning\n　　Yet pretnending you have never been in my heart \n　　The furthest distance in the world\n　　Is not pretnending you have never been in my heart\n　　But using one\'\'s indifferent heart \n　　To sig an uncrossable river\n　　For the one who loves you', '女');
