INSERT INTO `hongniang` VALUES ('1170', '浪漫情哥', 'Loveid:10650810', 'http://www.hongniang.com/data/upload/photo/20170925/59c875c7796c3_mid.jpg', '26岁', '160CM', '未婚', '保密', '大学本科', '浙江杭州', '人生的路，说长不长，说短不短，每段路有每段路的风景，每段路有每段路的担当。一路上会有风和日丽，也会有雨雪风霜；会有艰难险阻，也会有一马平川。有人相伴也罢，一人独行也罢，人这一辈子，总有些事情需要你去…', '女');
