INSERT INTO `hongniang` VALUES ('1177', '孤单', 'Loveid:10650815', 'http://www.hongniang.com/data/upload/photo/20170925/59c875cdf27f1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875cdf27f1ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875cdf27f1ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875cdf27f1ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875cdf27f1ff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875cdf27f1ff5_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875cdf27f1ff6_mid.jpg', '33岁', '160CM', '未婚', '保密', '大专', '浙江杭州', '一个平凡的人，带点任性，小脾气，希望找到能包容，疼爱我的人', '女');
INSERT INTO `hongniang` VALUES ('1178', '小美', 'Loveid:10650802', 'http://hongniang.com/data/upload/photo/20170925/59c875ba5e68c_mid.jpg,http://hongniang.com/data/upload/photo/20170925/59c875ba5e68cff1_mid.jpg,http://hongniang.com/data/upload/photo/20170925/59c875ba5e68cff2_mid.jpg,http://hongniang.com/data/upload/photo/20170925/59c875ba5e68cff3_mid.jpg,http://hongniang.com/data/upload/photo/20170925/59c875ba5e68cff4_mid.jpg', '32岁', '163CM', '未婚', '保密', '大专', '浙江杭州', '自我介绍：本人身高162，体重52公斤，性格温和，长相尚可，有时安静乖巧、有时活泼开朗。\n　　缺点：\n　　一、心太软， 二、不会赚大钱\n　　三、老爱落下东西 四、不喜欢人家跟我抢电视遥控器\n　　五、即使吵架时也不会骂人 {很少与人争吵，我讲理）； \n　　优点：\n　　一、明事理,善解人意 二、比较实在\n　　三、温柔不喜欢大声讲话， 四、酒吧KTV不喜去，\n　　五、杂七杂八赌博的朋友不交， 六、节约不喜浪费\n　　七、做家务勤快八、爱家。\n　　我呢厨艺还在学习中，也学着去关心人，不喜欢跟人家争风吃醋。平时节假日在家搞搞卫生，上上网，逛逛超市，或者短途旅游，有些小姿，偶尔一个人或叫上个朋友品个下午茶。以前谈过恋爱，失败了，但对感情还是抱着纯真的态度。\n　　希望对方：成熟稳重、开明、善良、有一定经济基础的，事业家庭兼顾的，要在浙江定居的男士为伴。希望我们的结合会为我们带来幸福的婚姻生活，平淡而不平凡，不论贫富，不离不弃\n　　注明：我老家是安徽的。(我没有邮票看不了你的来信,来信请贴邮票.没有邮票的也不必给我发信了)', '女');
INSERT INTO `hongniang` VALUES ('1179', '韵韵', 'Loveid:10650817', 'http://www.hongniang.com/data/upload/photo/20170925/59c875d463569_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875d463569ff1_mid.jpg', '28岁', '165CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个诚信,文静,体贴,孝顺,温柔,善良,独立的人 ，爱好广泛的我，喜欢淘宝,自拍,逛街,话剧,瑜伽,旅行,听歌，关于外貌，简单形容就是身材匀称。', '女');
