INSERT INTO `hongniang` VALUES ('1187', '机器猫', 'Loveid:10650789', 'http://www.hongniang.com/data/upload/photo/20170925/59c875a001243_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875a001243ff1_mid.jpg', '23岁', '159CM', '未婚', '保密', '大专', '浙江杭州', '爱的最高境界是习惯。我想习惯一个男人的鼾声，从不适应到习惯再到没有他的鼾声就睡不着觉；我想让一个男人习惯我，我的任性、撒娇，甚至无理取闹……在我眼中，如果一个人会为了另一个人去改变，去迁就这便是最好的爱情。', '女');
