INSERT INTO `hongniang` VALUES ('1190', '遇见', 'Loveid:10650790', 'http://www.hongniang.com/data/upload/photo/20170925/59c875a094d3d_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875a094d3dff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875a094d3dff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875a094d3dff3_mid.jpg', '22岁', '168CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个简单,执着,宅,可爱,温柔的人 ，是个不折不扣的美食家，关于外貌，简单形容就是大眼睛。', '女');
