INSERT INTO `hongniang` VALUES ('1195', '林畇', 'Loveid:10647656', 'http://www.hongniang.com/data/upload/photo/20170918/59bfbf1e10d64_mid.png,http://www.hongniang.com/data/upload/photo/20170918/59bfc27a50a77_mid.png,http://www.hongniang.com/data/upload/photo/20170918/59bfc28a0683e_mid.png,http://www.hongniang.com/data/upload/photo/20170918/59bfc29575a73_mid.png,http://www.hongniang.com/data/upload/photo/20170918/59bfc2a84c50f_mid.png', '33岁', '165CM', '未婚', '20-35万元', '大学本科', '福建泉州', '想找一个真心相待的对象\n我今年已经25了 从事采购助理\n负责进货入库、协助采购事宜并电脑系统作业\n没有什么专长 就是一个打工的\n没有什么特别爱好 朋友也不多\n之前被一个垃圾男人骗过钱 觉得信任很难\n就想找个能真心陪伴我 聊聊天也好的对象.....', '女');
