INSERT INTO `hongniang` VALUES ('1198', '不离不弃', 'Loveid:10648204', 'http://www.hongniang.comwww.hongniang.com/data/upload/photo/20170919/59c0a5823383c_mid.png', '32岁', '163CM', '未婚', '20-35万元', '大专', '浙江杭州', '感情久了，就不是爱了、而是依赖；失去那阵，那不是痛、而是不舍。爱一个人和被一个人爱都是很幸福的事，可世间的事就是这样公平，有得必有失。正如你爱一个人，得到了他，却失去了那神秘向往的感觉，得不到他，却得到了任心灵想象的自由。所以，当你爱上一个人的时候，一定要想清楚，你要怎么做才是最完美也最不让你后悔的。', '女');
