INSERT INTO `hongniang` VALUES ('1205', '西瓜嘟嘟', 'Loveid:10650797', 'http://www.hongniang.com/data/upload/photo/20170925/59c875b2cfd87_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875b2cfd87ff1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875b2cfd87ff2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875b2cfd87ff3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875b2cfd87ff4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170925/59c875b2cfd87ff5_mid.jpg', '28岁', '163CM', '未婚', '保密', '大专', '浙江杭州', '我是一位戏曲演员呵呵可能你们不是很了解，平时的我有点小可爱可有时也蛮女人的哈哈本来就是女人哦，也许我很平凡，但是我绝不缺乏生活的热情和生命的梦想，我喜欢比较成熟一点健壮点的有时也会有点小可爱的男友，因为我也比较丰满哈哈，可以接受微胖的来吧，我理想的男友是要求属鸡或属鼠的，但脾气一定要好', '女');
