INSERT INTO `hongniang` VALUES ('1208', '游敏玲', 'Loveid:10609444', 'http://www.hongniang.comwww.hongniang.com/data/upload/photo/20170711/59644d11a2087_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20170711/59644d11a2087_1_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20170711/59644d11a2087_2_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20170711/59644d11a2087_3_mid.jpg,http://www.hongniang.comwww.hongniang.com/data/upload/photo/20170711/59644d11a2087_4_mid.jpg', '20岁', '160CM', '未婚', '15-20万元', '大专', '浙江宁波', '我是一个多愁善感的人，时而成熟稳重，时而逗逼，和人相处比较慢热，生活积极乐观向上，偶尔小宅偶尔是个行动派，遇到喜欢的会奋不顾身', '女');
INSERT INTO `hongniang` VALUES ('1209', '会员10610427', 'Loveid:10610427', 'http://gag.hongniang.com/data/upload/photo/20170712/5965862245470_mid.jpg', '23岁', '164CM', '未婚', '20-35万元', '中专', '浙江宁波', '内心独白：本人1993中国制造，长163cm，净重51kg，采用人工智能系统，各部分零件齐全，运转稳定，经25年运行，属国家免检品，手续齐全，。现因发展需要，诚招志同道合者（仅限男性），共同研制开发第二代产品~~非诚勿扰哟', '女');
INSERT INTO `hongniang` VALUES ('1210', '小毛驴喝酒', 'Loveid:10610431', 'http://www.hongniang.com/data/upload/photo/20170712/5965862b55901_mid.jpg,http://www.hongniang.com/data/upload/photo/20170712/5965862b55901_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170712/5965862b55901_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170712/5965862b55901_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170712/5965862b55901_4_mid.jpg', '28岁', '160CM', '未婚', '50-100万元', '中专', '浙江宁波', '她很适合你哦，赶紧去看看吧！', '女');
