INSERT INTO `hongniang` VALUES ('1212', '岸芷葶兰', 'Loveid:10644122', 'http://test.hongniang.com/data/upload/photo/20170909/59b397c86c815_mid.png,http://test.hongniang.com/data/upload/photo/20170909/59b3987738f75_mid.png,http://test.hongniang.com/data/upload/photo/20170910/59b504449053e_mid.png', '25岁', '168CM', '未婚', '20-35万元', '大学本科', '福建泉州', '匆匆走过25年的岁月，依然孑然一身。回首曾经的岁月，纯粹学校的环境，无缘认识很多的人宁缺无滥的要求，把自己闭塞于开始的印象之中，对于感情缺乏主动而传统的性格，让自己成了守候一族。\n相信人间真善美的东西，总保持一份乐观，也许是因为偶尔盲目的乐观，有时看起来傻傻的喜欢把问题简单化，从简简单单的生活中体会生活的美好和温馨活泼开朗宽容，偶尔也有点固执喜欢跟朋友们一起热闹，也喜欢在安静的空间里做些简单的事情。\n喜欢音乐，K歌喜欢看书，看些不是很深刻的书-)喜欢运动，篮球、羽毛球、乒乓球技术水平不高，空暇的时候经常玩一下喜欢贴近自然，在不喧闹的田园中领略自然的魅力。\n爱情是不是永远的激情，而是淡淡生活中的细水常流，爱情需要真诚、宽容、专一来灌溉，爱情更是婚姻的通行证。我渴望一份朴实的爱情。\n有人说，在对的时间遇见对的人，是一生幸福。在对的时间里，我望穿秋水，等待一份真的情，等待一个对的人。', '女');
INSERT INTO `hongniang` VALUES ('1213', '张芸', 'Loveid:10644203', 'http://www.hongniang.com/data/upload/photo/20170910/59b4e144a3939_mid.png', '27岁', '162CM', '未婚', '20-35万元', '大学本科', '四川成都', '范例 以前为了学习老妈不让谈恋爱，现在为了工作没时间恋爱，随着时间的推移，自己发现已经步入“剩女”的行列，其实自己对另一半的要求也不是很高，可以不是很帅，可以不是很富有，但是一定要有上进心，责任心，能够孝顺老人家也就差不多了。我对未来有很多憧憬和希望，但愿能和心爱的人一起实现.....', '女');
INSERT INTO `hongniang` VALUES ('1214', '微微一笑666', 'Loveid:10645881', 'http://www.ocg.hongniang.com/data/upload/photo/20170913/59b8a5adb0be8_mid.png', '29岁', '158CM', '未婚', '10-15万元', '大学本科', '山东青岛', '希望对方成熟稳重，有一颗孝心、细心，懂得照顾我，并且有稳定的事业。\n婚后能接受与父母同住，和我在同一个地方，不接受异地恋。\n希望对方会做一点饭，能接受共同承担家务。', '女');
INSERT INTO `hongniang` VALUES ('1215', '冰是沉默的水', 'Loveid:10645894', 'http://marry.hongniang.com/data/upload/photo/20170913/59b8d0ad8b231_mid.png', '29岁', '164CM', '未婚', '15-20万元', '大学本科', '湖南长沙', '以前为了学习老妈不让谈恋爱，现在为了工作没时间恋爱，随着时间的推移，自己发现已经步入“剩女”的行列，其实自己对另一半的要求也不是很高，可以不是很帅，可以不是很富有，但是一定要有上进心，责任心，能够孝顺老人家也就差不多了。我对未来有很多憧憬和希望，但愿能和心爱的人一起实现....', '女');
INSERT INTO `hongniang` VALUES ('1216', '张不二', 'Loveid:10645934', 'http://marry.hongniang.com/data/upload/photo/20170913/59b926f652567_mid.png', '25岁', '160CM', '未婚', '10-15万元', '大学本科', '广东深圳', '我呢，性格有点大大咧咧~不太在意细节，却有时候又特别在意~希望你能容忍我偶尔的小脾气，工作方面希望你能帮到我，希望是能匹配到的，我希望另外一半是幽默风趣的，且说话能用逻辑说服我~详细的快来私聊吧。', '女');
