INSERT INTO `hongniang` VALUES ('1584', '矿矿', 'Loveid:10608367', 'http://www.hongniang.com/data/upload/photo/20170711/5964308547e8e_mid.jpg,http://www.hongniang.com/data/upload/photo/20170711/5964308547e8e_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170711/5964308547e8e_2_mid.jpg', '26岁', '160CM', '未婚', '20-35万元', '大学本科', '浙江宁波', '我希望我爱的人能够热爱生活，善待自己及他人。世界之大，我希望他眼中不拘泥于眼前方寸之间，能看得见世界的美好。我希望他是一个心胸开阔，有主见，有决断力的人。如果热爱走山访水，希望我们能够一起感受自然。另外简单介绍下自己，我个子小小，梦想是到160cm，今生是不可能了，哈哈。以前做过3年外贸，如果我感到尴尬就会一直努力找话题，实在是找不出了，我就做回了本专业，现在是一只辛勤的程序猿。前不久收养了两只小奶猫，现在每天做个勤劳的铲屎官，懒觉都睡不了，?……另外，我是单亲家庭，我知道有些人会介意这些，不过我自己认为这并不是什么大惊小怪的事情。我爸妈在我高考后离婚了，小时候不理解过，到现在的我很感激他们之前为我一直忍耐。我自小在外婆外公和四个舅舅的关心爱护下长大，小时候我一直都是家里唯一的孩子，所以现在我也觉得自己会有点娇气有点作，到这也是我的幸运。感谢我的长辈们对我的关心爱护。愿他们身体康健，长命百岁。', '女');
