INSERT INTO `hongniang` VALUES ('1672', '馨香', 'Loveid:10607822', 'http://fy.hongniang.com/data/upload/photo/20170711/596423af8386d_mid.jpg,http://fy.hongniang.com/data/upload/photo/20170711/596423af8386d_1_mid.jpg,http://fy.hongniang.com/data/upload/photo/20170711/596423af8386d_2_mid.jpg', '38岁', '167CM', '未婚', '15-20万元', '大学本科', '浙江宁波', '来到宁波一年多了，38年的独身想法，到这边经不起敲打，瞬间让我改变，想找个专一有担当的人来陪我走完后半，我是个温柔的女人，能够做一个贤妻，喜欢运动，旅行，美食，不喜欢固定的模式人生，天真单纯的人生简单而有乐趣。这就是我～', '女');
INSERT INTO `hongniang` VALUES ('1673', 'murphy', 'Loveid:10607823', 'http://www.hongniang.com/data/upload/photo/20170711/596423c1ac4a2_mid.jpg', '32岁', '159CM', '未婚', '15-20万元', '大学本科', '浙江宁波', '对于“你”来说，我是陌生的。所以，我如实填写了个人资料，把真实的自己呈现在这里。除了这些你看到的，我还想告诉你，我虽是八零后女孩，但没有娇生惯养的不良习惯；我会把家收拾的井井有条，会做可口的饭菜；懂得关心照顾家人和朋友，是个很让人放心的女孩。对于我来说，“你”是未知的。人生旅途依旧孤单的时候，我努力让自己更健康，更快乐。未来有一天，当我走累了想要休息的时候，抬头看见你站在不远微笑着向我挥手，大声对我说，我在这里等你很久了！我会心一笑，走向你，然后和你牵手走完一生。这个让我会心一笑的人，虽然我不知道你什么时候出现，但我会守侯，因为我相信你的存在……', '女');
