INSERT INTO `hongniang` VALUES ('1683', 'Nicole妮可尔', 'Loveid:10607699', 'http://www.hongniang.com/data/upload/photo/20170711/5964201703727_mid.jpg,http://www.hongniang.com/data/upload/photo/20170711/5964201703727_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170711/5964201703727_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170711/5964201703727_3_mid.jpg', '29岁', '159CM', '未婚', '15-20万元', '大学本科', '浙江宁波', '我大多时候是活泼开朗的，和我在一起，你绝对不会闷，我总能带给你欢笑，也绝对能和你的哥们打成一片，有时是个乐天派，很少烦恼，我相信天无绝人之路，我的生活每天都很美好，并且我也是温柔的，虽然偶尔会有点小任性。对于我来说现在的工作，正是我所擅长和喜爱的领域，我总是会尽心尽力的做好。与人相处中我相信人性本善，更愿意相信他人而非猜忌。和朋友或恋人在一起的时候我们会提出不同意见，然后讨论出最佳方案。更多时候，我觉得比起钱、权或名望来说，我更希望得到尊重，这让我能够感受到自己的价值所在。希望Ta是积极乐观的，凡事都会看到其好的一面，不钻牛角尖，同时也是稳重老实的，要把家庭摆在第一位，最好能兼顾是风趣幽默的，不会让约会气氛变冷。我未来的另一半，至少要具备有责任心、“宽容\"、“体贴”的品质。在寻找另一半的时候，我最关心对方的人品性格。当我和恋人意见不和时，如果我是对的 ，我会解释给Ta听，但是我并不喜欢为一点小事产生争执。我的另一半会不会做饭，对我来说比较重要，希望他能在我很忙或很疲惫的时候，帮我做上几个简单的家常菜。', '女');
