INSERT INTO `hongniang` VALUES ('1936', '豆豆爱吃鱼', 'Loveid:10601498', 'http://www.hongniang.com/data/upload/photo/20170706/595d92935643b_mid.jpg', '25岁', '155CM', '未婚', '100万元以上', '大学本科', '浙江杭州', '小女纸性格开朗，处事乐观，理性与感性兼顾。且双商不低。91年的羊咩咩。有份稳定且热爱的职业。家中独女。属外貌协会，喜欢阳光帅气干净的男孩子。比我大6岁以内可接受。与我三观要和。也要心地善良且人品好（衣品也要好）。不乱来。不喜抽烟，不喜喝酒。洁身自好为首。要遇见喜欢的人已经如此难，更何况是要牵手一生的呢？\r\nPS:喜欢打王者荣耀啊，最好能组队上王者啊！！', '女');
