INSERT INTO `hongniang` VALUES ('1940', '沫溪箬', 'Loveid:10601504', 'http://www.hongniang.com/data/upload/photo/20170706/595d92a34bf38_mid.jpg,http://www.hongniang.com/data/upload/photo/20170706/595d92a34bf38_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170706/595d92a34bf38_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170706/595d92a34bf38_3_mid.jpg', '25岁', '166CM', '未婚', '100万元以上', '大学本科', '浙江杭州', '本科音乐学专业毕业学士学位，善良、孝顺、通情达理的92年白羊座女孩，爱美食，旅游，golf，音乐，目前自主创业从事互联网传媒行业，此前金融白领基金合伙人，希望遇见绅士有责任心有事业，会照顾人，对生活有品质要求的男士共度余生，晚点遇见你，余生都是你，期望一年内结婚', '女');
INSERT INTO `hongniang` VALUES ('1941', '温柔的小老虎', 'Loveid:10601489', 'http://www.hongniang.comwww.hongniang.com/data/upload/photo/20170706/595d927e1f3ea_mid.jpg', '29岁', '150CM', '未婚', '15-20万元', '高中及以下', '浙江温州', '性格温和，顾家，不爱出门，宅家里的。未婚，交一男友，现怀孕两个多月了。男友不想要，本人想留着自己带，有意愿留言，其他勿扰！', '女');
INSERT INTO `hongniang` VALUES ('1942', 'xzzq', 'Loveid:10601492', 'http://www.hongniang.com/data/upload/photo/20170706/595d927fe67cd_mid.jpg,http://www.hongniang.com/data/upload/photo/20170706/595d927fe67cd_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170706/595d927fe67cd_2_mid.jpg', '24岁', '165CM', '未婚', '15-20万元', '大学本科', '浙江温州', '希望能遇上一个合适的另一半，三观一定要正的那种，因为将来需要共同面对很多事情', '女');
INSERT INTO `hongniang` VALUES ('1943', '安安', 'Loveid:10601494', 'http://www.hongniang.com/data/upload/photo/20170706/595d9283bac7b_mid.jpg,http://www.hongniang.com/data/upload/photo/20170706/595d9283bac7b_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170706/595d9283bac7b_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170706/595d9283bac7b_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170706/595d9283bac7b_4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170706/595d9283bac7b_5_mid.jpg,http://www.hongniang.com/data/upload/photo/20170706/595d9283bac7b_6_mid.jpg', '30岁', '158CM', '未婚', '15-20万元', '大学本科', '浙江台州', '我普通的不能在普通，我也是一个情绪化的人。不会太压抑自己感情。高兴的时候缠人的甜蜜，难过的时候会泪如雨下。同时也会发脾气。现实社会的人们越来越挑剔和自私。___这世间男女非常的多。多得走在街上伸手就可触及。随时可得相拥相抱，渡过漫漫长夜。但是那个愿意拿出恩慈与灵魂的人，那个在清晨醒来握手便会觉得幸福的人，又会有几个。', '女');
