INSERT INTO `hongniang` VALUES ('1965', '沈姑娘', 'Loveid:10601313', 'http://www.hongniang.com/data/upload/photo/20170706/595d8ed321410_mid.jpg,http://www.hongniang.com/data/upload/photo/20170706/595d8ed321410_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170706/595d8ed321410_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170706/595d8ed321410_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170706/595d8ed321410_4_mid.jpg', '24岁', '157CM', '未婚', '15-20万元', '大学本科', '浙江杭州', '我是个小鸟依人的女孩子，性格文静，温柔，喜欢向自己爱的人撒娇，但绝不会无理取闹。平时喜欢看看书，看看电影，偶尔和朋友逛街，吃饭。我希望对方成熟稳重，有责任心，事业稳定，家庭经济条件尚可就行。', '女');
