INSERT INTO `hongniang` VALUES ('1969', '逗逗', 'Loveid:10601332', 'http://www.hongniang.com/data/upload/photo/20170706/595d8f32d4b4d_mid.jpg,http://www.hongniang.com/data/upload/photo/20170706/595d8f32d4b4d_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170706/595d8f32d4b4d_2_mid.jpg', '32岁', '162CM', '未婚', '20-35万元', '大学本科', '浙江杭州', '我是做电商的，时间还算比较自由，应该能在赚钱的同时兼顾好家庭。 对于婚姻，我希望是有安全感的，找老公不要太帅太有钱的，也不要不过日子对生活没计划不求上进的。希望对方是个邻家男孩型的暖男，会体贴人，重情且稳重，对感情认真且专一，脾气性格比较好的。 喜欢抽烟喝酒去夜场玩的请绕道，我只想踏踏实实的过日子。(理想老公代表人物：黄磊)', '女');
