INSERT INTO `hongniang` VALUES ('1988', '麦氏咖啡', 'Loveid:10601384', 'http://www.hongniang.com/data/upload/photo/20170706/595d90854a501_mid.jpg,http://www.hongniang.com/data/upload/photo/20170706/595d90854a501_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170706/595d90854a501_2_mid.jpg', '29岁', '160CM', '未婚', '15-20万元', '大学本科', '浙江湖州', '理想中的他：阳光、清爽的外形，\r\n礼貌而又优雅的形态，\r\n睿智而又理性的头脑，\r\n幽默风趣的个性，\r\n富有爱心，孝心，责任心与上进心。\r\n希望能在正规的平台找到对的他，执指之手，与子偕老！', '女');
INSERT INTO `hongniang` VALUES ('1989', '梦梦', 'Loveid:10601208', 'http://www.hongniang.com/data/upload/photo/20170706/595d8c7742d06_mid.jpg,http://www.hongniang.com/data/upload/photo/20170706/595d8c7742d06_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170706/595d8c7742d06_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170706/595d8c7742d06_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170706/595d8c7742d06_4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170706/595d8c7742d06_5_mid.jpg,http://www.hongniang.com/data/upload/photo/20170706/595d8c7742d06_6_mid.jpg', '31岁', '168CM', '未婚', '保密', '大学本科', '浙江杭州', '我是一个温柔有点呆萌的女孩子。平时比较宅，出门的话会迷路…工作原因生活中没有朋友。每天陪着我的只有妈妈和我家的狗狗。感觉很孤单，希望能在这里找到愿意疼爱我呵护我的那个人（我是真诚的，希望你也是）！最后谢谢大家的厚爱，没想到一天内这么多人发信息给我。很感谢大家！可是很多人真的不符合我要求呢。我也不想耽误谁，如果你觉得我不可能会喜欢你的话可能就是真的不会喜欢。所以不用给我写信了好吗？今天虽然收到好多信但是没有合适我的。好多人我都没回复，在这里说声抱歉，希望我们都早日找到有缘人！', '女');
