INSERT INTO `hongniang` VALUES ('2017', '果儿果', 'Loveid:10601142', 'http://www.hongniang.com/data/upload/photo/20170706/595d8a5592117_mid.jpg,http://www.hongniang.com/data/upload/photo/20170706/595d8a5592117_1_mid.jpg', '31岁', '167CM', '未婚', '20-35万元', '大学本科', '浙江杭州', '我在某种意义上算是杭飘，因为目前为止，我在这座城市里还没有亲人。我喜欢西湖，尤其是夜晚的西湖，一直期盼着冬日的夜里，捧着一杯热巧克力，挽着他的手，西湖边散步，聊聊家常，说说理想，假日里，一起山上晒晒太阳。希望在奔波忙碌的同时，不要忘记我们是在生活，而不是活着。他可以不帅，但要心存美好。如今的我年纪不小了，家人经常问起我的个人问题，比较着急，所以我不打算谈马拉松般的感情。。。幸好我至今还相信爱情。感谢您读完我这段零散的文字，谢谢！非诚勿扰吧。', '女');
