INSERT INTO `hongniang` VALUES ('2066', '小易', 'Loveid:10596292', 'http://www.hongniang.com/data/upload/photo/20170704/595af3f51dd70_mid.jpg', '28岁', '164CM', '未婚', '50-100万元', '大学本科', '浙江金华', '目前在金华东阳一所乡村国际学校任教，是一名乡村女教师，经常带着学生全国全世界各地游学做活动。平日工作在东阳，周末回杭州。未来计划回杭州。希望工作之外，能找到有趣的人一起同行。不是会员，无法查看邮件。', '女');
INSERT INTO `hongniang` VALUES ('2067', '哇哈哈', 'Loveid:10598700', 'http://www.hongniang.com/data/upload/photo/20170705/595c3b3860111_mid.jpg', '25岁', '164CM', '未婚', '20-35万元', '大专', '浙江杭州', '属羊的.四川人.不知不觉年龄就大了，很多同龄女生都有两孩子了，很有危机感。前年来到的杭州，目前在物业公司上班，属于三无人员.无车.无房.无存款.比较天真比较傻，心地善良.孝顺，有时候会很懒.间歇性的勤快.其实像我这样的人应该很好结婚.可是我一直举棋不定应该找老家的还是现在就居住的地方的.就这样想了两年.缺一个能让我定下心来的人。不喜欢比我矮的.对钱看得很重很扣的男生.其他也没有太大要求.看起来适合顺眼就喜欢了.', '女');
