INSERT INTO `hongniang` VALUES ('2071', '欣呀', 'Loveid:10596297', 'http://www.hongniang.com/data/upload/photo/20170704/595af4044070a_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595af4044070a_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595af4044070a_2_mid.jpg', '37岁', '168CM', '未婚', '15-20万元', '大学本科', '浙江金华', '各种形形色色，哪怕再多的不真诚，也会有真诚的人出现，你怎么对我，我怎么对你，话不用说太好，唯有真诚。现目前考虑的是先交友，直接谈感情的勿扰。', '女');
INSERT INTO `hongniang` VALUES ('2072', 'EastofEden', 'Loveid:10598723', 'http://www.hongniang.com/data/upload/photo/20170705/595c3ba756aa4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170705/595c3ba756aa4_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170705/595c3ba756aa4_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170705/595c3ba756aa4_4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170705/595c3ba756aa4_5_mid.jpg,http://www.hongniang.com/data/upload/photo/20170705/595c3ba756aa4_6_mid.jpg,http://www.hongniang.com/data/upload/photo/20170705/595c3ba756aa4_7_mid.jpg,http://www.hongniang.com/data/upload/photo/20170705/595c3ba756aa4_8_mid.jpg,http://www.hongniang.com/data/upload/photo/20170705/595c3ba756aa4_9_mid.jpg,http://www.hongniang.com/data/upload/photo/20170705/595c3ba756aa4_10_mid.jpg,http://www.hongniang.com/data/upload/photo/20170705/595c3ba756aa4_11_mid.jpg,http://www.hongniang.com/data/upload/photo/20170705/595c3ba756aa4_12_mid.jpg,http://www.hongniang.com/data/upload/photo/20170705/595c3ba756aa4_13_mid.jpg,http://www', '30岁', '162CM', '未婚', '15-20万元', '大专', '浙江杭州', '一个气球，阴差阳错结缘了仙人掌，在一起磕磕碰碰N年。弄的自己身上伤痕累累，但气球一直坚持着，终于有一天气球受不了，离开仙人掌。\r\n后来气球遇到了棉花，棉花对气球的每一个拥抱都是那么的温暖，气球的心暖暖的，气球才明白：不是努力坚持和忍耐就能换来温暖，是要选择对的，适合的，就会变的很轻松很幸福。再付出，也得遇上感恩的人。再真诚，也得遇上有心的人。再谦让，也得遇上珍惜你的人！属于自己的世界应该精彩，美好的年纪理应不该辜负......我是一个单亲妈妈，至于我如何会成为单亲母亲的，不要太好奇，如果了解我的人愿意倾听我的故事，可以再联系互相了解，非诚勿扰，孩子对我很重要，希望想了解我的，你能看在眼里，会疼在心中......介意的就止步于此……受过伤女人有时像刺猬，让人不敢靠近，也不愿再勇敢，不过就让我在此能迈出第一步吧……', '女');
