INSERT INTO `hongniang` VALUES ('2115', '木子言', 'Loveid:10596139', 'http://www.hongniang.com/data/upload/photo/20170704/595aefd41dc4b_mid.jpg', '32岁', '155CM', '未婚', '100万元以上', '大专', '浙江金华', '多久没看过，远空的繁星；多久没听过，花开的声音；每天像时钟，转动个不停；流逝着时光，重复着生命；是否还记得，最初的约定；是否还怀念，错过的曾经；趁酒精还没，把青春耗尽；快点去寻找，丢失的梦境；就带着梦想去旅行；背包里只装着憧憬；比阳光纯净，比蝴蝶轻盈；走过的背影，是别人的风景；心若有梦永远年轻；不管阴或晴，不问远和近；未来不确定，才更值得前进。', '女');
