INSERT INTO `hongniang` VALUES ('2125', '爱如暖阳', 'Loveid:10595834', 'http://www.hongniang.com/data/upload/photo/20170704/595ae8a67fd66_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae8a67fd66_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae8a67fd66_2_mid.jpg', '35岁', '158CM', '未婚', '50-100万元', '大学本科', '浙江金华', '小女子属清秀型，比较苗条，性格比较温和，少语，想找个有安全感的，早点让父母如意\r\n心目中的对象最好是斯文型，有稳定工作，市区有房！', '女');
INSERT INTO `hongniang` VALUES ('2126', '会员10595835', 'Loveid:10595835', 'http://www.hongniang.com/data/upload/photo/20170704/595ae8a80170c_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae8a80170c_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae8a80170c_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae8a80170c_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae8a80170c_4_mid.jpg', '35岁', '164CM', '未婚', '保密', '大学本科', '浙江金华', '我正在寻找浙江金华,年龄在32-42岁,月薪在元以上的男性', '女');
INSERT INTO `hongniang` VALUES ('2127', 'Carmina', 'Loveid:10595836', 'http://www.hongniang.com/data/upload/photo/20170704/595ae8b4c1a42_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae8b4c1a42_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae8b4c1a42_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae8b4c1a42_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae8b4c1a42_4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae8b4c1a42_5_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae8b4c1a42_6_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae8b4c1a42_7_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae8b4c1a42_8_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae8b4c1a42_9_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae8b4c1a42_10_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae8b4c1a42_11_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae8b4c1a42_12_mid.jpg,http://www.', '33岁', '156CM', '未婚', '50-100万元', '大学本科', '浙江金华', '我，简简单单的一个女孩，生长在一个温馨幸福的快乐家庭，家里有我最爱的爸爸妈妈和弟弟。 喜欢平平淡淡的生活，可以为一点点小事而感动。工作之余，喜欢和朋友打打球，爬爬山，也可以双休日都宅在家里，整理房间，种种花草。 期待中的你，成熟稳重，有孝心、责任心、事业心。你可以不带我去坐游艇，吃法餐。但是希望你可以每天早晨为我跑几条街，去买我最爱吃的豆浆和油条。哈哈，是不是觉得要求高了，不过我只是打个比方哦，要的只是那种被在乎的感觉。如果你是《金太郎的幸福生活》中的男主角亮亮，我会更爱你的哦！ 未来要和我结婚的那位：也不知道你现在和谁在谈恋爱呢，别跟人家浪费感情了，找个时间咱俩认识一下呗！', '女');
INSERT INTO `hongniang` VALUES ('2128', '丰富的单纯', 'Loveid:10595838', 'http://www.hongniang.com/data/upload/photo/20170704/595ae8ea08468_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae8ea08468_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae8ea08468_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae8ea08468_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae8ea08468_4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae8ea08468_5_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae8ea08468_6_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae8ea08468_7_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae8ea08468_8_mid.jpg', '31岁', '164CM', '未婚', '20-35万元', '大学本科', '浙江金华', '最好的爱情不是麦田里千挑万选的那一颗最大的麦穗，因为缘分往往不等你选择就与你擦肩而去；最好的爱情像两滴水，在恰好的时间恰好的地点恰好的距离，相互吸引，倏然融合为一滴。择偶条件：人品是前提，朝三暮四的别找我，我没时间陪你玩。\r\n具体要求：睿智、沉稳、儒雅、幽默、有气质、懂生活、有品位、有事业心，有责任感\r\n（这些条条框框只是理想中完美恋人的形象，现实中看对眼了可以适当打个折）', '女');
INSERT INTO `hongniang` VALUES ('2129', '会员10595839', 'Loveid:10595839', 'http://www.hongniang.com/data/upload/photo/20170704/595ae8f3d38d6_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae8f3d38d6_1_mid.jpg', '31岁', '165CM', '未婚', '15-20万元', '大学本科', '浙江金华', '一年又一年，发现自己总是差个他，希望借此网站能找到相伴一生的那个他，他应有上进心，有爱心，成熟稳重，爱生活，会照顾自己同时也会照顾他人，有稳定收入的优质男。我期待着一份纯粹，忠贞，一辈子不分手恋爱式的婚姻，我对感情单纯而执着，浪漫也平凡真实。虽然周围总有人说：“在这世界上找一个爱你的同时你爱的男人太难，你要求太高了！”但我始终相信终有一天优秀的你会找到我，我也相信自己坚信的总会等到你终会变成终于等到你！非诚勿扰！谢谢', '女');
