INSERT INTO `hongniang` VALUES ('2323', 'Jessie', 'Loveid:10595701', 'http://www.hongniang.com/data/upload/photo/20170704/595ae651b8554_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae651b8554_1_mid.jpg', '30岁', '158CM', '未婚', '15-20万元', '大学本科', '浙江市辖区', '开始看眼缘，最主要的还得相处才知道是否合适。我不漂亮也不丑，属于丢人群中便随大流的那种。我顾家，爱整洁，喜欢动物花草，性格外向却又，谢绝夜夜泡吧K歌爱抽烟花里胡哨的男人。我不要求他太帅太有钱，只要有责任心，对人有耐性，有点宅脾气温和。我不确定自己能否接受大大大肚腩，尽管男人三十总像吹气球般发福。我只知道爱惜自己身材的男人一定特别有毅力，有上进心。如果可以，我希望我们能够经常去健身房或者饭后散步。我们健康，才能更长久地陪伴彼此。', '女');
