INSERT INTO `hongniang` VALUES ('2326', '赫本', 'Loveid:10595708', 'http://www.hongniang.com/data/upload/photo/20170704/595ae681a504d_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae681a504d_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae681a504d_2_mid.jpg', '28岁', '162CM', '未婚', '15-20万元', '大学本科', '浙江市辖区', '我希望可以碰到个 互相信任 互相尊重  互相理解 互相包容 聊的来 可以不帅 可以不富 但是一点要有上进心 责任心 能够孝顺老人家乜就差不多了 爱情无关物质 无关合适 门当户对 年龄 遇到对的人什么都不在乎 女人要的就是找个疼她的 爱护她的 懂她的 希望未来有个小家 有辆车子 有宝宝  我会做一个内外兼顾的良妻', '女');
