INSERT INTO `hongniang` VALUES ('2344', '比扬', 'Loveid:10595772', 'http://hongniang.com/data/upload/photo/20170704/595ae7e123e02_mid.jpg,http://hongniang.com/data/upload/photo/20170704/595ae7e123e02_1_mid.jpg', '27岁', '160CM', '未婚', '20-35万元', '硕士', '浙江杭州', '希望我们价值观相同，生活习惯相似。希望我们能一同经历一些事。希望你真诚踏实有上进心。希望我和你一起的时候能够一同进步，相互扶持。我有点理想主义小情怀，但能拥抱现实，喜欢看书，摄影，没事的时候喜欢爬山骑行徒步。家在余杭，在杭州租房工作。非诚勿扰。', '女');
INSERT INTO `hongniang` VALUES ('2345', '多来A梦诺', 'Loveid:10595775', 'http://www.hongniang.com/data/upload/photo/20170704/595ae7ed4f003_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae7ed4f003_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae7ed4f003_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae7ed4f003_3_mid.jpg', '26岁', '168CM', '未婚', '100万元以上', '硕士', '浙江杭州', '女儿已到婚嫁年龄还没有心仪之人，为母盼婿心切加入珍爱。但既怕错过了好时光又怕遇人不淑，忐忑中开通了会员，上传了几张素颜生活照。如你年龄身高合适，学历一本及以上，自认比较优秀那么请来打扰我，以诚交友，非诚勿扰。家住湘湖工作在滨江。', '女');
