INSERT INTO `hongniang` VALUES ('2386', '蜗居的snail', 'Loveid:10595251', 'http://www.hongniang.com/data/upload/photo/20170703/595a033566251_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/595a033566251_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/595a033566251_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/595a033566251_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/595a033566251_4_mid.jpg', '34岁', '161CM', '未婚', '50-100万元', '大专', '浙江市辖区', '一日，出门旅行，在午夜的大街上，当地接待的一朋友突然问我，要是我把你丢在这里自己\r\n走了，你怎么办，很不经思考的就回答，打车回酒店啊，还能丢了不成。\r\n朋友愕然，说，我女朋友就想不到。突然一丝悲哀，还是笑着说，因为她有你照顾，所以不\r\n需要想这些。\r\n多年了，一直一个人行走在路上，只有影子不离不弃一直跟着。\r\n是时候了，想找个人，陪我走以后的路。', '女');
