INSERT INTO `hongniang` VALUES ('2389', '尔玛伊人', 'Loveid:10595272', 'http://www.hongniang.com/data/upload/photo/20170703/595a038656306_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/595a038656306_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/595a038656306_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/595a038656306_3_mid.jpg', '26岁', '162CM', '未婚', '20-35万元', '大专', '浙江市辖区', '今年20多，除了每天工作，就是吃饭睡觉，没有一点儿兴趣爱好，不过偶尔看看电影逛逛街啥的，至今还是一个人，有人说我眼光高，其实我对自己的另一半没啥太多了要求，没人能够了解我，除了父母，我也想找一个爱我，疼我的人，可是至今仍未出现，所以我还得继续我的单身生活，这就是我……', '女');
