INSERT INTO `hongniang` VALUES ('2392', '梨子', 'Loveid:10595347', 'http://www.hongniang.com/data/upload/photo/20170703/595a050d793c2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/595a050d793c2_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/595a050d793c2_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/595a050d793c2_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/595a050d793c2_4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/595a050d793c2_5_mid.jpg', '31岁', '156CM', '未婚', '15-20万元', '高中及以下', '浙江市辖区', '我祖籍是湖南的，籍贯在湖北。体型娇小玲珑的我，有一些可爱的味道，也有一些成熟的风韵。我想寻找一位这样的贤良君子：年龄在29~37岁之间，思想成熟，最好没有婚史，性格开朗，不吝啬，品德优良。相貌过得去就好。待人诚恳，谦和礼貌。有孝心、责任心！\r\n　　　最重要的还是两个人一定要性格合得来，对感情真诚！\r\n　　　不求条件最好的，但求找个最合适自己的！因为快过年了，所以如有意请从速与我联系或通过红娘联系我，期待你的到来，非诚勿扰，谢谢！', '女');
