INSERT INTO `hongniang` VALUES ('2395', '忘记', 'Loveid:10595399', 'http://www.hongniang.com/data/upload/photo/20170703/595a062ae95b1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/595a062ae95b1_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/595a062ae95b1_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/595a062ae95b1_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/595a062ae95b1_4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/595a062ae95b1_5_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/595a062ae95b1_6_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/595a062ae95b1_7_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/595a062ae95b1_8_mid.jpg', '30岁', '156CM', '未婚', '20-35万元', '中专', '浙江市辖区', '我正在寻找浙江金华,年龄在28-35岁,月薪在12000元以上的男性', '女');
INSERT INTO `hongniang` VALUES ('2396', '黎黎', 'Loveid:10595409', 'http://www.hongniang.com/data/upload/photo/20170703/595a064430a3d_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/595a064430a3d_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/595a064430a3d_2_mid.jpg', '30岁', '168CM', '未婚', '15-20万元', '中专', '浙江市辖区', '不论世界如何变化，我们都要竭力成为一个靠谱的人。不论他人如何相待，我们都要尽力成为一个温柔的人。对工作事业有原则，对人际关系有底线，对家人至亲温柔有爱。\r\n在冷漠的世界里，愿我们转角遇到爱。在虚妄的人生里，我们都应当彼此坦诚相待，彼此温柔相爱。', '女');
