INSERT INTO `hongniang` VALUES ('2401', '会员10595440', 'Loveid:10595440', 'http://www.hongniang.com/data/upload/photo/20170703/595a070bcb3f9_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/595a070bcb3f9_1_mid.jpg', '38岁', '158CM', '未婚', '100万元以上', '硕士', '浙江杭州', '凡是皆有偶然的凑巧，结果却又如宿命的必然。于我这样一个爱幻想的人来说，生活本该浪漫。而于一个传统的女人来说，浪漫被磨得现实，我也欣然接受这样的生活！\r\n　　橡树和木棉的平等独立，这是任何人际交往中的大原则和大前提，而婚姻生活其实更多的琐碎杂事。相较与金婚银婚，十多年的婚姻生活，不长，但是这些年的美好回忆和不堪往事，让我晓得生活不是童话，没有王子与公主，生活也不是韩剧，没有那么多的跌宕起伏，也不是小说，没有那么多的海誓山盟，我们有的只是在一起，夫唱妇随也好，妇唱夫随亦可，平平淡淡，细水长流。\r\n　　人与人在一起，我一直觉得：爱情也好，友情也好，久而久之都会转化为亲情！爱到平淡，才是浓烈，爱到亲人，才是永恒！', '女');
INSERT INTO `hongniang` VALUES ('2402', '会员10595443', 'Loveid:10595443', 'http://www.hongniang.com/data/upload/photo/20170703/595a071698efc_mid.jpg', '27岁', '155CM', '未婚', '15-20万元', '硕士', '浙江金华', '我是个非常简单的人，爱幻想，更多追求精神上的东西，想让自己变得美好。人生苦短，善待别人就是善待自己，想做个温暖人心的人，让身边的人感觉幸福，我就幸福。', '女');
