INSERT INTO `hongniang` VALUES ('2439', '鲑鲑鱼', 'Loveid:10595058', 'http://www.hongniang.com/data/upload/photo/20170703/5959ffe746112_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959ffe746112_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959ffe746112_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959ffe746112_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959ffe746112_4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959ffe746112_5_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959ffe746112_6_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959ffe746112_7_mid.jpg', '26岁', '170CM', '未婚', '20-35万元', '大专', '浙江金华', '何以琛等待了赵默笙七年，也误会了七年，思念了七年，甚至可以说是错过了七年，遗憾了七年，寂寞了七年……而赵默笙误会了何以琛七年，也想念了七年，错过了七年，甚至可以说是回忆了七年，漂泊了七年，孤独了七年……何以琛与赵默笙的爱情佳话或许仅仅只存在于浪漫唯美的爱情小说中，小说中的七年，改变的只是男女主角的不同心境，而现实中的七年，却足可以让男女主角各自转身去奔向另一个人的怀抱，何以琛说：“当一个人曾经出现在你的生命中，那么其他人都会变成将就，我不愿意将就”。可是如果可以不将就，谁愿意将就……但是现实中的爱情，又有多少人在将就着幸福，不将就着等待……而等到的真的是不可将就的爱情？还是可将就的请帖？！而此时此刻的你，是在将就着恋爱，还是在不愿将就着等待亦或者是已经得到了不可将就的幸福……', '女');
