INSERT INTO `hongniang` VALUES ('2462', '月草', 'Loveid:10594675', 'http://www.hongniang.com/data/upload/photo/20170703/5959f8678e05a_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959f8678e05a_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959f8678e05a_2_mid.jpg', '35岁', '165CM', '未婚', '20-35万元', '大学本科', '浙江金华', '我理想中的TA：比我大(最好大多点这样才会感觉自己像孩子)。够成熟够男人。把我放第一位（不是备胎）。想撒娇就撒娇，想不理他就不理他（当然不是真的不理额）。我想到的他想到了，我没想到的他也帮我想到了。\r\n每个女子心中都装着一个公主，我也不例外，THIS IS MY DREAM ：）----------------------------分.割.线--------------------------------愿得一人心  白首不相离  如果等待是一种期盼  那么我愿意用更长的时光  静静等候你的到来  四目相对的时刻  我便知你已来了无需任何言语和告白  在纷繁明媚的春天  绚丽如魅的夏天  硕果金黄的秋天和银装素裹的冬天  我们或静静相拥  或嬉笑挠耳  直至儿女成群白发苍苍  述说着我们平淡但却真情的人生 你的眉眼气息都有我仰慕的目光追随  我的美好温润都有你柔和的关怀拥抱  仅仅只关乎于相互的倾慕与吸引并为之去守护一生.', '女');
INSERT INTO `hongniang` VALUES ('2463', '会员10594673', 'Loveid:10594673', 'http://www.hongniang.com/data/upload/photo/20170703/5959f85bd05ee_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959f85bd05ee_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959f85bd05ee_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959f85bd05ee_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959f85bd05ee_4_mid.jpg', '36岁', '163CM', '未婚', '20-35万元', '大学本科', '浙江金华', '希望对方孝顺，有爱心，幽默宽容，有责任心。热爱自己的事业，偶尔也会耍耍孩子气。', '女');
INSERT INTO `hongniang` VALUES ('2464', 'tiempo', 'Loveid:10594693', 'http://www.hongniang.com/data/upload/photo/20170703/5959f8dd7b283_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959f8dd7b283_1_mid.jpg', '34岁', '160CM', '未婚', '20-35万元', '大学本科', '浙江金华', '我理想的伴侣 现在这个年纪了，需要的是有想法，有行动，不要多有钱，但是至少要有生活目标，不会要求对方变成自己期望的那种人，给人自由，共同进步的那种\r\n要孝顺，对父母好过对自己的未来的儿女。\r\n有什么想到再说吧\r\n很多秋波啊啥的都是网站自动提醒然后随便点进去的，这个东西看缘分了，不知道我下次放个pS的照片是不是会更受欢迎。', '女');
