INSERT INTO `hongniang` VALUES ('2529', '彼岸，七七', 'Loveid:10594445', 'http://www.hongniang.com/data/upload/photo/20170703/5959f1a6c7f2d_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959f1a6c7f2d_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959f1a6c7f2d_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959f1a6c7f2d_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959f1a6c7f2d_4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959f1a6c7f2d_5_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959f1a6c7f2d_6_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959f1a6c7f2d_7_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959f1a6c7f2d_8_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959f1a6c7f2d_9_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959f1a6c7f2d_10_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959f1a6c7f2d_11_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959f1a6c7f2d_12_mid.jpg,http://www.', '25岁', '168CM', '未婚', '20-35万元', '大学本科', '浙江金华', 'PS:来珍爱找优越感的人，也远点，条件好怎么了，还不是没对象，既然大家都不是将就的人，就好好找对象，别朝三暮四，如果开始就好好珍惜遇见的人！懂？？？！\r\n我的天。。。175以下，或者抽烟的就算了。\r\n可能是我没说清楚。不是江浙沪的，或者不在江浙沪工作的别找我啦，我为了家人，不会嫁到江浙沪以外的。身高175以上，月薪必须比我高，8000+ 不知道为什么那么多人问我资料是不是真的，是因为我条件好，还是因为照片太美像假的呢？照片是11月11号在东阳江北拍的，不信的可以去看看那边景色和我图片是否符合。之前上传的是在莫干山拍的，去年八月拍的。 我是银行职员，圈子女孩居多，追的人不少，但是我并不想把一辈子的婚姻大事随便将就，我只是想借助这个平台，认识多一点的人，究竟哪个更适合自己。 我对个人素养要求比较高，不孝顺的，素质底下的就别来找我了，没有未来的。  要么疯狂，要么死亡。  我们可以选择成为朋友，但是一旦选择成为情侣，我不希望你是我人生的过客。', '女');
