INSERT INTO `hongniang` VALUES ('2742', '会员10594168', 'Loveid:10594168', 'http://www.hongniang.com/data/upload/photo/20170703/5959c4fdea964_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959c4fdea964_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959c4fdea964_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959c4fdea964_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959c4fdea964_4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959c4fdea964_5_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959c4fdea964_6_mid.jpg', '33岁', '166CM', '未婚', '15-20万元', '大专', '浙江金华', '时光它从来不等人，过往已经虚度，未来的日子里，真心希望有一份真挚的感情，有一个不离不弃的爱人，陪我一起走下去，有一个和美的家让我觉得温馨、幸福。\r\n网络，概念上非常的虚幻，也有非常多的陷阱跟疑难杂症，但愿彼此保留一颗纯洁的心，保持那份对爱的向往。\r\n平时比较宅，也没太多时间去接触这个社会大家庭，在有限的时间里，给自己一个执着、任性的理由，我要等的，会是这里的一员吗？\r\n如果，你的心不曾想过要安定，如果，你要找的只是一个窈窕美女，如果，你只想谈不以结婚为目的的恋爱，请不要打扰我，谢谢！\r\n我不漂亮，但我很真诚，希望你同样用真诚的心对待！简单、平凡、有爱心、顾家的你，给我满满幸福的你，别让我等太久……', '女');
INSERT INTO `hongniang` VALUES ('2743', 'alsuina', 'Loveid:10594147', 'http://www.hongniang.com/data/upload/photo/20170703/5959c48eb449e_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959c48eb449e_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959c48eb449e_2_mid.jpg', '27岁', '160CM', '未婚', '15-20万元', '大学本科', '浙江金华', '真心地想要找对象，非诚勿扰！独生女，条件还可以，为人随和善良，无不良嗜好。目前在永康工作。寻找省内，最好是金华地区的，只要感情好，定居哪里无所谓！', '女');
INSERT INTO `hongniang` VALUES ('2744', '会员10918429', 'Loveid:10918429', 'http://www.hongniang.com/data/upload/photo/20180328/5abb7fc8dda1a_mid.jpg', '40岁', '163CM', '离异单身', '10-15万元', '大专', '广东中山', '一个纯情善良的女人，真诚借用一个网络平台找到自己心中所爱的另一半，人生已过一半，不让妈妈为我的下半生牵挂，真诚在这里找到一个懂包容，呵护，疼爱自己，要有担当且有孝顺的男人，让妈妈放下这份牵挂，也是作为女儿的我才能真正孝顺我的老母亲。', '女');
