INSERT INTO `hongniang` VALUES ('2833', '星空', 'Loveid:10593711', 'http://www.hongniang.com/data/upload/photo/20170703/5959bcfbcef63_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959bcfbcef63_1_mid.jpg', '29岁', '164CM', '未婚', '20-35万元', '大学本科', '浙江市辖区', '人与人相遇就是一份缘，能与你相识相知是我的幸运，我会用我的真心和你交流。用我的热情换来你的真情！真心交流，以诚相待。“窝不在大，有爱就好，人不在帅，有心就好”', '女');
INSERT INTO `hongniang` VALUES ('2834', '漠小冷', 'Loveid:10593720', 'http://www.hongniang.com/data/upload/photo/20170703/5959bd2083be3_mid.jpg', '29岁', '163CM', '未婚', '15-20万元', '大学本科', '浙江市辖区', '曾经我觉得28岁结婚是正好的年纪，而现在马上就向这个年龄靠近了，生活中我是一个大大咧咧的女孩子，没有华丽的外表也没有殷实的家世，倘若能够出生在一个平凡的家庭，或许幸福感会更强烈，所以有时候才会更渴望有一份美满的婚姻。\r\n在我年幼时，母亲由于受过刺激，有些精神异常，所以这也成了我一直没有成家的一个问题所在，不过我没有埋怨，因为如果连担当都没有，又谈什么幸福呢？所以，我一直在等，等有一个人和我一起，一起去努力，一起去过得幸福。', '女');
