INSERT INTO `hongniang` VALUES ('2873', '钟艺美', 'Loveid:10593446', 'http://www.hongniang.com/data/upload/photo/20170703/5959ba78be1b4_mid.jpg', '33岁', '153CM', '未婚', '50-100万元', '高中及以下', '浙江台州', '本人老家湖南，是一名纹绣技术人员，在浙江省台州椒江经营自己的小店，想找一位浙江一带本地的或者在这边有稳定工作也一样想在这边定居的，有稳定工作，有责任心，有上进心的，有一颗感恩的心，未婚有房，以上条件优先考虑，属相羊、马、狗，不考虑请绕道，由于本人工作在浙江台州太远的不考虑，符合条件的可以联系本人，不以结婚为目的的聊天也请绕道。', '女');
