INSERT INTO `hongniang` VALUES ('2878', '冰点', 'Loveid:10593478', 'http://www.hongniang.com/data/upload/photo/20170703/5959bb029fa3d_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959bb029fa3d_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959bb029fa3d_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959bb029fa3d_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959bb029fa3d_4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959bb029fa3d_5_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959bb029fa3d_6_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959bb029fa3d_7_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959bb029fa3d_8_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959bb029fa3d_9_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959bb029fa3d_10_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959bb029fa3d_11_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959bb029fa3d_12_mid.jpg,http://www.', '23岁', '154CM', '未婚', '20-35万元', '大专', '浙江温州', '真心寻缘，想找孝顺，善良，有上进心，温柔又带着霸道，成熟稳重的男人。\r\n进过工厂洗过碗，做过白领创过业，对于感情，我没有太多时间去顾及，虽然也有过故事，但目前已经单身两年了，对于婚姻，我只想嫁给爱情，对于家庭，我或许不能完全的在家相夫教子，因为我需要工作，做一个即能够让男人尊重也能成为孩子榜样的女人，但我也会把除工作外的时间留给家人，留给家庭，对于你，我希望你是有担当，有责任心，有上进心，孝顺善良的，而我，一直是个好强的女人，在外面，给足你面子，在家，也可以做个小女人。\r\n两个人在一起，感情是需要共同维护经营和尊重的，我喜欢看书，所以会更希望你也喜欢看书，没事的时候一起看看书，可以一起下厨，一起旅游，一起努力，共同打造一个有你有我的世界。', '女');
