INSERT INTO `hongniang` VALUES ('2886', '槿月色', 'Loveid:10593319', 'http://www.hongniang.com/data/upload/photo/20170703/5959b84e2673f_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959b84e2673f_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959b84e2673f_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959b84e2673f_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959b84e2673f_4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959b84e2673f_5_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959b84e2673f_6_mid.jpg', '23岁', '160CM', '未婚', '20-35万元', '高中及以下', '浙江杭州', '过完年虚岁二十五了，想找个贵州人好好谈婚论嫁了，注册这个有点用处就是芝麻信用涨了几分??呵呵', '女');
