INSERT INTO `hongniang` VALUES ('2888', 'Katharina', 'Loveid:10593341', 'http://www.hongniang.com/data/upload/photo/20170703/5959b8ca8965a_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959b8ca8965a_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959b8ca8965a_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959b8ca8965a_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959b8ca8965a_4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959b8ca8965a_5_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959b8ca8965a_6_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959b8ca8965a_7_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/5959b8ca8965a_8_mid.jpg', '29岁', '159CM', '未婚', '20-35万元', '大学本科', '浙江宁波', '打小就喜欢夏天\r\n知了知了喊得人不住翻白眼\r\n倾盆大雨淋得人只能耸耸肩\r\n各种小生灵赶集似的在大马路上扛把子\r\n生滚的阳光一不留神就在皮肤上烫出一个表\r\n躲在树荫下偷瞄人群使劲嘬冰棍\r\n站在水洼里凝神等待迷路的小青蛙\r\n迎着夜晚凉爽的风啃一口甜到心里的瓜瓤\r\n躺在凉席上做着在浩瀚星空叱咤奔腾的美梦\r\n骑马骑驴骑骡子的那个男子\r\n大概也像极了夏天\r\n狂野地像非洲平原上一言不合就狂奔的豹子\r\n又羞赧地像乌云背后藏着掖着不露脸的阳光\r\n清亮地像独上高楼时候狠狠拽到的那轮明月\r\n又混沌地像裹着树叶塑料袋满象限冲撞的疾风骤雨在人山人海之外\r\n独自演绎空山新雨后的默默等待\r\n望着火烧云猛地蹦出一句“呵呵 我来也”\r\n对孤犬而言\r\n生活就是50%的快乐遐想与50%的耐心寻觅醉后不知天在水、满船清梦压星河\r\n一想到这美人美景呀\r\n就又对人山人海外那个骑马骑驴骑骡子的男子\r\n充满了夏天般的期待', '女');
