INSERT INTO `hongniang` VALUES ('3124', '黯然之后唯美', 'Loveid:10592575', 'http://www.hongniang.com/data/upload/photo/20170701/5957048dee24a_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957048dee24a_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957048dee24a_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957048dee24a_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957048dee24a_4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957048dee24a_5_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957048dee24a_6_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957048dee24a_7_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957048dee24a_8_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957048dee24a_9_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957048dee24a_10_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957048dee24a_11_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957048dee24a_12_mid.jpg,http://www.', '33岁', '169CM', '未婚', '15-20万元', '中专', '浙江金华', '想早点结束一个人寂寞的日子，一个人的世界太单调，希望对方善解人意，积极向上，一个人的容貌是无法抗拒岁月的摧残，两个人的感情需要在相互信任中慢慢培养，我相信有一种真诚的爱情存在，而这份情就发生在你我之间！其实自己也还好， 家人都希望我早点成家，毕竟年龄不小了，怕遇不到合适的人了，我觉得感情需要那个缘分，着急没有用的，换个城市生活也可以  离家别太远就是了，浙江省内的我是可以接受，只要未来的他真心对我好，当然，我也会爱屋及乌的……我不在乎学历，但一定要有素养，我不在乎相貌，但一定要爱干净，我不在乎过去，只要\r\n你能给我未来。我是一个外表也不算时尚，内心有点保守的女生  因为我从小在单亲的环境中成长的原\r\n因，特想找个人关心我，懂我，如果遇到，我会把心安定下来，这么多年的孤单生活，或许真的习惯了寂寞，但是内心深处告诉我，我要幸福，我一定会幸福的活下去我想在天堂的爸爸也希望我能幸福吧！！！如果有时间我 会耐心的做一顿美味的晚餐，不知合不合你的口味……我希望对方是一个有责任感，衣冠楚楚、有醉人的眼睛、体型健硕的男人、懂得生活、整洁\r\n干\r\n净、有品位、做事认真、体贴、成熟稳重、当然还须有过人的才智和魅力，最好是绅\r\n士\r\n的楷模，骑士的象征，也不缺幽默乐观的一面，说的够具体了吧…………特别申明:希望他是智慧型,有内涵,年龄品貌等与本人相当的有缘人(身心疲惫的我,不接受比我小三岁以下的男士,同时拒绝不诚交友信息,找情人者免扰,见谅!!!!).', '女');
