INSERT INTO `hongniang` VALUES ('3126', '潘宝', 'Loveid:10592592', 'http://www.hongniang.com/data/upload/photo/20170701/595704c7401ca_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595704c7401ca_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595704c7401ca_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595704c7401ca_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595704c7401ca_4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595704c7401ca_5_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595704c7401ca_6_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595704c7401ca_7_mid.jpg', '27岁', '164CM', '未婚', '100万元以上', '中专', '浙江金华', '本人是河南人，1991年1月生，性格活泼开朗，独立，乐观，有很好的心态，对自己心爱的男人会用心对待照顾，想找一个能够踏实陪我过下半辈子的男人，入得了厨房，虽然没有一副出得厅堂的模样，但是是顾家女人，贤惠型，如果眼缘，感觉没问题可以在今年结婚，你的父母我来照顾，你可以安心在外面做事业，小家我可以帮你维系，本人是单亲家庭，跟着妈妈生活，希望不要因为这点而对我有看法，在我的世界里，我的母亲从我出生到工作都是母亲陪伴，我的世界里面没有父亲的角色，所以没有体会过父爱！我拿真心对待你的家人，希望对方也是！！！非诚心请勿打扰！', '女');
