INSERT INTO `hongniang` VALUES ('3128', '尘封的心', 'Loveid:10592598', 'http://www.hongniang.com/data/upload/photo/20170701/595704d828f39_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595704d828f39_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595704d828f39_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595704d828f39_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595704d828f39_4_mid.jpg', '31岁', '158CM', '未婚', '15-20万元', '高中及以下', '浙江金华', '我姓陈，广东湛江人，86年，爱好大自然，平时跑步，瑜伽；优雅温柔、大方、体贴…会炒几个小菜…目前经营一家店面;爱情宣言：只要你能走进我心里，我会用一辈子陪伴你，风雨同舟，做你事业上的伙伴，家里能懂你的爱人，孝顺父母，疼爱幼小…未来一起努力', '女');
