INSERT INTO `hongniang` VALUES ('3140', '会员10592670', 'Loveid:10592670', 'http://www.hongniang.com/data/upload/photo/20170701/59570607b664e_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/59570607b664e_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/59570607b664e_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/59570607b664e_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/59570607b664e_4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/59570607b664e_5_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/59570607b664e_6_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/59570607b664e_7_mid.jpg', '27岁', '160CM', '未婚', '20-35万元', '高中及以下', '浙江金华', '一个人累了，只想有个依靠，由于家庭原因，不是武义人，别来烦我 ，谢谢，不是会员，看不了你们发的', '女');
INSERT INTO `hongniang` VALUES ('3141', '挚爱一生', 'Loveid:10592938', 'http://www.hongniang.com/data/upload/photo/20170703/595992abd9033_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/595992abd9033_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/595992abd9033_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/595992abd9033_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/595992abd9033_4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/595992abd9033_5_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/595992abd9033_6_mid.jpg,http://www.hongniang.com/data/upload/photo/20170703/595992abd9033_7_mid.jpg', '26岁', '166CM', '未婚', '50-100万元', '大学本科', '浙江杭州', '有人在乎，就是幸福；有人心疼，就是温暖。　　有没有一双手,握住了就不再轻易松开、　　有没有一种约定,要一辈子都要在一起、　　有没有一段情,即使一生都不会去遗忘、　　其实我要的并不多,只想与你这样、　　一起到老.....　　(非诚勿扰，不以结婚为前提的都是耍流氓）', '女');
INSERT INTO `hongniang` VALUES ('3142', 'FM笑', 'Loveid:10595876', 'http://www.hongniang.com/data/upload/photo/20170704/595ae9c8f09c0_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae9c8f09c0_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae9c8f09c0_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae9c8f09c0_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170704/595ae9c8f09c0_4_mid.jpg', '30岁', '160CM', '未婚', '20-35万元', '大学本科', '浙江金华', '想找一个谈恋爱的人容易，但想找一个结婚的人却很难。我希望未来的那个他，相处不厌，有相同的三观，因为爱情而结婚，而不是因为年纪。', '女');
