INSERT INTO `hongniang` VALUES ('3167', '让爱相随', 'Loveid:10592443', 'http://www.hongniang.com/data/upload/photo/20170701/5957025d5ebb2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957025d5ebb2_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957025d5ebb2_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957025d5ebb2_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957025d5ebb2_4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957025d5ebb2_5_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957025d5ebb2_6_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957025d5ebb2_7_mid.jpg', '39岁', '162CM', '未婚', '15-20万元', '大专', '浙江金华', '我是一个温柔善良的小女人，对另一半的要求是有上进心责任心，我对未来家有很多憧憬和希望，但愿和心爱的人一起实现。', '女');
INSERT INTO `hongniang` VALUES ('3168', 'Jackie', 'Loveid:10592446', 'http://www.hongniang.com/data/upload/photo/20170701/5957026705acf_mid.jpg', '40岁', '155CM', '未婚', '20-35万元', '大专', '浙江金华', '婚姻找的是一个生活伴侣，不应该期待陪你一生的人一定要是你的精神伴侣——应该爱你懂你理解你，同悲同喜同欢乐。', '女');
INSERT INTO `hongniang` VALUES ('3169', '会员10592451', 'Loveid:10592451', 'http://www.hongniang.com/data/upload/photo/20170701/5957026f6a61d_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957026f6a61d_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957026f6a61d_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957026f6a61d_3_mid.jpg', '39岁', '163CM', '未婚', '20-35万元', '大专', '浙江金华', '茫茫人海中.....鼓起勇气，选择了一种不曾想过的方式，只为寻找一份真正属于自己的那份缘！！！本人对另外一半的要求较高 ，最看重的是一个人的人品 ，要有很强的责任感 ，孝顺老人，懂得尊重身边的每一个人，有一定的事业心 ，积极向上，有好的思考能力，未来可以携手共同创业的那种！', '女');
INSERT INTO `hongniang` VALUES ('3170', 'Eliza', 'Loveid:10592453', 'http://www.hongniang.com/data/upload/photo/20170701/595702760422c_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595702760422c_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595702760422c_2_mid.jpg', '36岁', '158CM', '未婚', '20-35万元', '大专', '浙江金华', '我正在寻找浙江金华义乌,年龄在30-45岁,月薪在8000元以上的男性', '女');
INSERT INTO `hongniang` VALUES ('3171', '月亮', 'Loveid:10592458', 'http://www.hongniang.com/data/upload/photo/20170701/59570293933b2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/59570293933b2_1_mid.jpg', '35岁', '152CM', '未婚', '15-20万元', '大专', '浙江金华', '我是来自广西壮族的大龄剩女，来浙江工作7-8年了，因为照顾照家里，错过了缘份，但是我还是相信缘份的，我希望在这里能找到属于我的缘份，性格开朗乐观的我，喜欢简单的生活。我喜欢浙江，希望能在浙江有一个自己的，你愿意给我一个家吗？要求他浙江本地人，有房子，年龄38岁－50岁之间，成熟稳重，有上进心，有责任心。生活中我是一个很爱干净的人，没事喜欢收拾房间，把东西都摆整齐，还喜欢做饭，做菜', '女');
INSERT INTO `hongniang` VALUES ('3172', '紫研', 'Loveid:10592460', 'http://www.hongniang.com/data/upload/photo/20170701/5957029bc069a_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957029bc069a_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957029bc069a_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957029bc069a_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957029bc069a_4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957029bc069a_5_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957029bc069a_6_mid.jpg', '34岁', '168CM', '未婚', '15-20万元', '大专', '浙江金华', '我正在寻找浙江金华义乌,年龄在28-35岁,学历为大专,月薪在5000元以上的男性', '女');
INSERT INTO `hongniang` VALUES ('3173', '会员10592471', 'Loveid:10592471', 'http://www.hongniang.com/data/upload/photo/20170701/595702beb4c97_mid.jpg', '34岁', '165CM', '未婚', '50-100万元', '大专', '浙江金华', '最重要是能沟通，对于房子车子我没有太大的渴望，因为自己也可以挣来这些。但是得有生活下去的积蓄。然后彼此的原生家庭是可以相处的。有婚史的比较困难', '女');
INSERT INTO `hongniang` VALUES ('3174', '小影', 'Loveid:10592473', 'http://www.hongniang.com/data/upload/photo/20170701/595702c6cd20b_mid.jpg', '33岁', '170CM', '未婚', '20-35万元', '大专', '浙江金华', '希望是以结婚为目的的认识，希望他是懂得尊重，希望他的包容心和宽恕的心态大于我，彼此懂得欣赏，最重要是懂得珍惜身边的每一天，和每一位亲朋好友！', '女');
INSERT INTO `hongniang` VALUES ('3175', '汪安某人', 'Loveid:10592475', 'http://www.hongniang.com/data/upload/photo/20170701/595702d0e22d3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595702d0e22d3_1_mid.jpg', '32岁', '160CM', '未婚', '20-35万元', '大专', '浙江金华', '我正在寻找浙江金华义乌,年龄在25-40岁,月薪在8000元以上的男性', '女');
