INSERT INTO `hongniang` VALUES ('3178', '微微', 'Loveid:10592484', 'http://www.hongniang.com/data/upload/photo/20170701/595702f40a520_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595702f40a520_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595702f40a520_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595702f40a520_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595702f40a520_4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595702f40a520_5_mid.jpg', '27岁', '160CM', '未婚', '20-35万元', '大专', '浙江金华', '现在在一个小医院里面上班，每天工作家里两点一线，生活比较简单，所以到现在都没有找到另一半，下班后基本上在健身房健身练瑜伽，诚心想找一位有稳定工作，爱好健身旅行的男士，会是你吗？', '女');
INSERT INTO `hongniang` VALUES ('3179', '叶淅', 'Loveid:10592485', 'http://www.hongniang.com/data/upload/photo/20170701/595702f7ee034_mid.jpg', '27岁', '155CM', '未婚', '15-20万元', '大专', '浙江金华', '本人乐观，开朗，对生活充满信心。周末空的时候，会窝在家里做做家务，钻研钻研厨艺，平时也会出去爬爬山，比较喜欢养些花花草草。本人不是漂亮，妖娆型的，但绝对是顾家，贤惠型的。\r\n理想的伴侣：阳关，开朗，有上进心及责任心，对父母孝顺，对家庭负责。同时希望另一半能够在我累的时候能够给我一个安全，坚实的臂膀，一个温暖的拥抱。\r\n婚姻的期望：周末空的时候可以一起做做家务，搞搞卫生，节假日的时候，能够一起出去旅游，遇到事情的时候，两个人能够一起商量对策，一起面对，不离不弃。性格方面能够相互迁就，', '女');
INSERT INTO `hongniang` VALUES ('3180', '会员10592489', 'Loveid:10592489', 'http://www.hongniang.com/data/upload/photo/20170701/595702fee3f5c_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595702fee3f5c_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595702fee3f5c_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595702fee3f5c_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595702fee3f5c_4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595702fee3f5c_5_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595702fee3f5c_6_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595702fee3f5c_7_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595702fee3f5c_8_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595702fee3f5c_9_mid.jpg', '27岁', '160CM', '未婚', '15-20万元', '大专', '浙江金华', '一个人可以走的很快，但两个人却可以走的很远。我喜欢旅行，爬山，骑摩托车，打台球，写字，我希望那个他，身高176以上，大专学历以上，性格开朗，孝顺有担当', '女');
