INSERT INTO `hongniang` VALUES ('3182', 'anny', 'Loveid:10592496', 'http://www.hongniang.com/data/upload/photo/20170701/59570312e27a8_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/59570312e27a8_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/59570312e27a8_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/59570312e27a8_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/59570312e27a8_4_mid.jpg', '45岁', '161CM', '未婚', '100万元以上', '高中及以下', '浙江金华', '72年的我——有了一份对生活的自信与洒脱，也多了一点点自身的内敛及韵味。金牛座,未婚妈妈。主要经营门锁，合页，插销，拉手，门吸以及其它小五金配件，一直从事这行业已18年。有自己的品牌在温州贴牌生产，在义乌开店出口为主，由于自身能力一般所赚无几。目前的生活作息时间规律，已习惯独自一人的充实与悠闲;兴趣爱好广泛;人多时一般是个倾听者，只对有感觉的人有兴趣的事热情，对邻里同事朋友比较仁义，对长辈亲切，孝顺，总的来说是一个仁厚，心善，明白事理，心无城府，人缘不错的一个漂亮女人。缺点也不少，不会理财，性子急，不计得失－－－－喜欢自己的就是最好的，想找一个生活背景，成长阅历和我差不多的一起携手充实丰盈的生活。希对方没有不良嗜好，最好不会吸烟，因为我闻了烟味嗓子就发炎，若个人能力，修养都胜过我的话那就最好不过了。在这里的时间长得我都记不太清了，我一直是个认真严谨生活的人，非常感谢那些对我来信的人，之前我的冷漠与无语-----失去了一个女人最美的季节，希望从现在开始我还有机会。', '女');
