INSERT INTO `hongniang` VALUES ('3185', '淡然', 'Loveid:10592536', 'http://www.hongniang.com/data/upload/photo/20170701/595703bacee2c_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595703bacee2c_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595703bacee2c_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595703bacee2c_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595703bacee2c_4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595703bacee2c_5_mid.jpg', '39岁', '158CM', '未婚', '15-20万元', '中专', '浙江金华', '一个人久了，累了，真的好想能遇上一个能疼我，懂我，包容我的人，牵手，一起夕阳西下，一起旅行，一起白头偕老。', '女');
INSERT INTO `hongniang` VALUES ('3186', '会员10592537', 'Loveid:10592537', 'http://www.hongniang.com/data/upload/photo/20170701/595703c0b3e01_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595703c0b3e01_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595703c0b3e01_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595703c0b3e01_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595703c0b3e01_4_mid.jpg', '39岁', '160CM', '未婚', '20-35万元', '中专', '浙江金华', '一个人的天空很蓝，蓝的有点忧郁。一个人的日子自由，自由的有点孤单；一个人的日子，背影多了份孤独，身边少了份快乐；一个人的日子，心灵多了份宁静，面容添了一丝忧郁……有人心疼我的那一份孤独，有人羡慕我的那一份宁静……而我，总是一个人在等待你的出现。　　2014年不管走到哪里都是各种晒幸福，说真的我也好着急了但事与愿违，我也知道心急吃不了热豆腐。今年是我的本命年，愿在这里可以让我早点遇到你，组一个温馨的家，也晒晒我们之间的小幸福.加油，加油!!　　真心想成家非诚勿扰', '女');
