INSERT INTO `hongniang` VALUES ('3191', '会员10592400', 'Loveid:10592400', 'http://www.hongniang.com/data/upload/photo/20170701/5957019b1e6a7_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957019b1e6a7_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957019b1e6a7_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957019b1e6a7_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957019b1e6a7_4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957019b1e6a7_5_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957019b1e6a7_6_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957019b1e6a7_7_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957019b1e6a7_8_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957019b1e6a7_9_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957019b1e6a7_10_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957019b1e6a7_11_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5957019b1e6a7_12_mid.jpg,http://www.', '31岁', '163CM', '未婚', '100万元以上', '大学本科', '浙江金华', '喜欢养花，喜欢旅游，喜欢做自己的小事业，很专一，生活简单，每个月都会出差几天，性格很好，几乎不会发脾气，懂得感恩，爱学习，孝敬长辈，不爱慕虚荣，喜欢的东西自己挣钱买，想找一个有包容心，有责任感的好男人，样貌也要过得去，宁缺毋滥，爱情应该是甜蜜的，我向往～我是以结婚为目的的，非诚勿扰！！！', '女');
INSERT INTO `hongniang` VALUES ('3192', '旭旭', 'Loveid:10592409', 'http://www.hongniang.com/data/upload/photo/20170701/595701eadee37_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595701eadee37_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595701eadee37_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595701eadee37_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595701eadee37_4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595701eadee37_5_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595701eadee37_6_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595701eadee37_7_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595701eadee37_8_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595701eadee37_9_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595701eadee37_10_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595701eadee37_11_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595701eadee37_12_mid.jpg,http://www.', '30岁', '160CM', '未婚', '50-100万元', '大学本科', '浙江金华', '不是什么花容月貌，才高八斗。只需要两个人都能对上眼就好了！我是家里独女，现工作地义乌，对方最好是在义乌工作的。本地人介意外地人甚至排斥外地人，免谈！爸妈把我当儿子养当女儿宠，虽然独立但是也有小脾气。爱玩爱美爱时尚爱旅游，性格静时如处子，动时如脱兔。想了解我的，会把我了解的缺点都告诉你，能包容一个人的一切是一辈子的事不是一分钟也不是一小时。动机不纯的请你绕道，软妹子也会发飙的！', '女');
INSERT INTO `hongniang` VALUES ('3193', '会员10592401', 'Loveid:10592401', 'http://www.hongniang.com/data/upload/photo/20170701/595701c36bc4d_mid.jpg', '31岁', '155CM', '未婚', '50-100万元', '大学本科', '浙江金华', '长期从事互联网工作，圈子太小。由于不在本地工作，连家里介绍相亲都没机会。还是借助网络来解决终身大事！在网络上我是个很活跃的人 现实生活中跟熟人可能更聊得来 养了一只阿拉 好几年了 所以你要喜欢宠物 平时喜欢动一动 所以你也要喜欢运动 保持体型和健康是对自己负责 希望你能稍微懂一点互联网 如果你真的值得我可以放弃在义乌打拼多年的基础 主张男女平等 家务等事情希望一起完成 做不了家庭主妇 因为我也有我的社会价值需要实现 不需要大富大贵 一起努力过想要的生活就可以了 最重要的是有共同语言 有类似的三观 能懂我', '女');
INSERT INTO `hongniang` VALUES ('3194', '天之涯', 'Loveid:10592404', 'http://www.hongniang.com/data/upload/photo/20170701/595701cd6fc31_mid.jpg', '31岁', '166CM', '未婚', '100万元以上', '大学本科', '浙江金华', '属于慢热型，一开始不太善于主动聊天！\r\n性格不温不火，喜欢旅行、喜欢读书！\r\n有些时候容易缺乏安全感，可能是骨子里一直挥之不去的自卑感引起的吧！\r\n但愿能找到合适与我相守一辈子的那个人！', '女');
