INSERT INTO `hongniang` VALUES ('3196', '媛媛', 'Loveid:10592433', 'http://www.hongniang.com/data/upload/photo/20170701/595702363aa9c_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/595702363aa9c_1_mid.jpg', '24岁', '163CM', '未婚', '20-35万元', '大学本科', '浙江金华', '我想找的并不是简单的外表型，更看重的是有内心之间的共鸣，一段缘分不是随便说来就来的，以前我一直愿意自己单身，感觉一个人过的很好，除非我遇到能使我比单身时过的更好的人，不然我不会脱离单身。', '女');
