INSERT INTO `hongniang` VALUES ('3289', 'Grace', 'Loveid:10591655', 'http://www.hongniang.com/data/upload/photo/20170701/5956fa0b05eed_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5956fa0b05eed_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5956fa0b05eed_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5956fa0b05eed_3_mid.jpg', '32岁', '163CM', '未婚', '20-35万元', '大学本科', '浙江杭州', '不知不觉中步入了“剩女”的行列，不过不管剩不剩，那都是别人在说。而我就是我。 我不是天仙美人，亦不是天才女，所以希望此二女相伴者，可绕道。 我平凡，普通，性格低调，不喜张扬；爱好和平，与人为善，不喜争辩。 对爱情、对婚姻我没有太多的遐想，只希望是相看两不厌，在困境中可以互相扶持，在平日里可以互相分享，和平共处。 当然能让我放肆一下，能以遵循“三从四德”为爱护的宗旨，则更优。当然我也会礼尚往来。:-)', '女');
