INSERT INTO `hongniang` VALUES ('3299', '水煮鱼', 'Loveid:10591693', 'http://marry.hongniang.com/data/upload/photo/20170701/5956fa612acc2_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170701/5956fa612acc2_1_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170701/5956fa612acc2_2_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170701/5956fa612acc2_3_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170701/5956fa612acc2_4_mid.jpg', '34岁', '155CM', '未婚', '15-20万元', '大学本科', '浙江杭州', '我是个非常普通且平凡的女子，没有显赫的家庭背景和亮丽的外表，有的只是一份还算稳定的工作，收入中等，我觉得做人最主要的是要有自知之明，且安于本分，君子爱财，取之有道，我始终相信，一个人的品性决定了他的人生高度。我之所以剩下了，不是因为我不够好，或者要求太高，而是我对生活、对未来还充满了憧憬。我的生活很简单，每天都是公司宿舍两点一线，平时除了去健身房， 就是呆家里。现如今，眼看就要迈过30岁大关了，还是一个人孤单的生活，很想改变这种状态。希望珍爱网能带给我迟来的缘分。非诚勿扰。。', '女');
