INSERT INTO `hongniang` VALUES ('3573', '笨笨', 'Loveid:10591344', 'http://www.hongniang.com/data/upload/photo/20170701/5956f7d1644bf_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5956f7d1644bf_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5956f7d1644bf_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5956f7d1644bf_3_mid.jpg', '32岁', '160CM', '未婚', '100万元以上', '大学本科', '浙江绍兴', '有关笨笨---活泼开朗、性格直率，热爱工作热爱生活\r\n笨笨想找的人-----成熟稳重又不乏幽默', '女');
INSERT INTO `hongniang` VALUES ('3574', '风清扬', 'Loveid:10591369', 'http://marry.hongniang.com/data/upload/photo/20170701/5956f8121797f_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170701/5956f8121797f_1_mid.jpg,http://marry.hongniang.com/data/upload/photo/20170701/5956f8121797f_2_mid.jpg', '24岁', '160CM', '未婚', '15-20万元', '大学本科', '浙江杭州', '人无癖不可与交，以其无深情也；人无疵不可与交，以其无无真气也。只想找个有共同兴趣爱好，一起过简单而又幸福的生活的人。', '女');
