INSERT INTO `hongniang` VALUES ('3576', '電兔', 'Loveid:10591239', 'http://www.hongniang.com/data/upload/photo/20170701/5956f67dc9fa8_mid.jpg', '32岁', '163CM', '未婚', '100万元以上', '大专', '浙江杭州', '前言：我不是白富美！最多只是白而已！如果你想找个身材好的！抱歉我不是！本人小胖子一枚！！我不是会员！所以只能看到免费信件！还有！能看到的每封信我都会看，但是自己连打几个字都不愿意，靠系统发的！一概不回！\r\n正文：你们好！很高兴在这个平台认识你们！我是个活泼开朗的女生，大大咧咧的！很义气，脾气也很好！不过有点小粗心，经常看见面而忽略点！所以细节上我可能不是那么好！不过和我一起一定会很开心！我非常的喜欢音乐，以前喜欢玩音乐，弹弹吉他啊，打打架子鼓啊，现在忙了很少玩！也忘了很多！但是偶尔还会摸摸琴，现在在家么有兴致了喜欢唱歌录音！我很喜欢旅游！我认为在旅游的途中可以学习到很多知识，挖掘新鲜食物，去过很多地方！有和朋友一起，有和家人一起，也有一个人独自旅行，唯独缺少另一半的旅途，我希望我的他也和我一样热爱旅游！我爱美食！所以我才是个小胖子！嘿嘿！！我去哪儿旅游都会先去发现当地的特色美食！我也喜欢做！一般家常菜，西餐，一些地方小吃，都会做点，还会一些其他国家的料理！比较喜欢研究新菜！我爱看恐怖片，警匪片，枪战片，哈哈，朋友都说除了长的像女生，其他地方都像男生！其实我觉得还好啦我最最最最爱的就是汽车！从小就喜欢！每天能开一圈摸摸方向盘是哟最开心的，我喜欢研究汽车，喜欢汽车文化，喜欢汽车改装以及维修，所以我的工作也是和汽车有关！我喜欢开车！去想去的地方，奔驰的时候特别的自由！平时休息要么在家！要么和朋友出去逛街，看电影，吃饭，唱歌，聚聚聊聊天！也就这样了！我想大家也基本都这样的！\r\n好了暂时说到这里！', '女');
