INSERT INTO `hongniang` VALUES ('3619', '七七', 'Loveid:10591232', 'http://www.hongniang.com/data/upload/photo/20170701/5956f66076191_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5956f66076191_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5956f66076191_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5956f66076191_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5956f66076191_4_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5956f66076191_5_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5956f66076191_6_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5956f66076191_7_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5956f66076191_8_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5956f66076191_9_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5956f66076191_10_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5956f66076191_11_mid.jpg', '29岁', '155CM', '未婚', '20-35万元', '大学本科', '浙江杭州', '外表公主，内心奴隶，上得厅堂，下得厨房。聪明也傻，脆弱也坚强，固执也心软，直爽也敏感，八面玲珑的多变女人。希望你懂我所不懂，能我所不能，我会努力让你成为最幸福的男人。', '女');
INSERT INTO `hongniang` VALUES ('3620', '会员10591233', 'Loveid:10591233', 'http://www.hongniang.com/data/upload/photo/20170701/5956f66be91ba_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5956f66be91ba_1_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5956f66be91ba_2_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5956f66be91ba_3_mid.jpg,http://www.hongniang.com/data/upload/photo/20170701/5956f66be91ba_4_mid.jpg', '31岁', '160CM', '未婚', '15-20万元', '大专', '浙江杭州', '随着社会发展与改变，朋友圈子变得越来越小，在大城市生活的外来打工族一般都是比较宅的，所以导致很多大男大女，俗称剩男剩女，来珍爱网注册也是碰碰运气，试试缘分。我真的不知道我把我的缘分丢在哪里了。\r\n我希望我的另一半身高在173到185（个高者只要你不嫌弃我矮，俺就不嫌弃你个高）职业稳定就好，最好是做生意的，因为本人以前也是自己开店的，虽然现在上班，但是未来的发展趋势还是要自己做生意的。\r\n我并不是要求我的另一半是大富大贵，但是一定是要潜力股，至少我们可以通过我们彼此的努力，去争取去创造更好的生活。用东北话来说，别懒驴扶不上磨，干啥啥不行，吃啥啥没够的。\r\n还有就是要有责任心，要孝顺父母，心胸宽阔，别动不动就生气，小性子巴拉的。\r\n对于家务，我觉得是谁比较空闲谁可多做一点，没有说什么东西一定要谁去做，虽然俺洗衣服做饭收拾房间都会做，但是你也不能拿俺当佣人使吧，对不。啥玩意都是相互的，真心换真心，你真我也真。', '女');
